(1, 25, 64, '2019-04-01', 'hasil tingkat kepatuhan code red triwulan II periode April-Juni 2019 mengalami penurunan tiap bulan sampai 46.32% yang dibandingkan di triwulan I yang sebesar 64.21%. rata-rata dari hasil tersebut diperoleh hasil 53.08% dan hasil tersebut masih jaug dari target yang direncanakan yaitu 100%. dan untuk selanjutnya tetap melakukan monitoring ke semua unit kerja tiap bulan dan membuat laporan bulanan.', '2020-01-07 03:34:43', '2020-01-07 03:34:43', 4, 2, 2019),
(2, 25, 65, '2019-01-01', 'hasil penanganan tumpahan B3 di ruang IBS RSUD RAA Soewondo Pati untuk Triwulan I periode Januari-Maret 2019 diperoleh capaian 0% sesuai target yang direncanakan yaitu 0%. Dari hasil tersebut tetap melakukan monitoring ke semua unit kerja un tuk menimalisir terjadinya tumpahan B3 dan membuat laporan bulanan.', '2020-01-07 03:34:43', '2020-01-07 03:34:43', 1, 1, 2019),
(3, 25, 65, '2019-04-01', 'hasil penanganan tumpahan untuk triwulan II periode April- Juni 2019 diperoleh capaian o% sesuai target yang direncanakan yaitu 0%.  Dari hasil tersebut tetap melakukan monitoring ke semua unit kerja untuk menimalisir terjadinya tumpahan B3 dan membuat laporan bulanan.', '2020-01-07 03:34:43', '2020-01-07 03:34:43', 4, 2, 2019),
(4, 26, 68, '2018-10-01', 'Pemenuhan pendidikan dan pelatihan SDM RSUD RAA Soewondo Pati periode Oktober hingga Desember mengalami penurunan yang sangat pesat seperti yang ditunjukkan pada grafik yang tertera. Penurunan yang siginifikan di bulan Desember karena sudah tidak adanya kegiatan eksternal maupun internal yang terlaksana, dimana kegiatan pelatihan baik internal maupun eksternal banyak dilaksanakan pada bulan-bulan sebelumnya seperti yang ditunjukkan pada grafik, kita dapat melihat jika pada bulan Oktober, indikator Diklat telah melebihi goal measurement. Sedangkan di bulan selanjutnya, pola grafik turun sebab memang sudah terbatasnya kegiatan jika pada akhir tahun datang terkait perhitungan pembukuan Rumah Sakit.', '2020-01-07 03:34:43', '2020-01-07 03:34:43', 10, 4, 2018),
(5, 25, 64, '2019-01-01', 'Tingkat kepatuhan pengisian papan code red untuk Triwulan I periode Januari-Maret 2019 diperoleh hasil 64.21 % dibandingkan dengan bulan Januari yang mencapai 56.32% . rata-rata kepatuhan pengisian papan code red untuk triwulan I adalah 59.47% dan hasil tersebut masih jauh dari target yang direncanakan yaitu 100%. dari hasil tersebut tetap melakukan monitoring kepatuhan pengisian papan code red dan membuat laporan bulanan.', '2020-01-07 03:34:43', '2020-01-07 03:34:43', 1, 1, 2019),
(6, 25, 66, '2019-04-01', '', '2020-01-07 03:34:43', '2020-01-07 03:34:43', 4, 2, 2019),
(7, 25, 66, '2019-04-01', 'hasil kecelakaan kerja karyawan RSUD RAA Soewondo Pati Triwulan II diperoleh hasil o.o8% pada bulan mei dari target yang direncanakan yaitu 0%. rata-rata kecelakaan untuk triwulan II diperoleh hasil 0.03%. dari hasil tersebut tetap melakukan monitoring K3 ke semua unit kerja tiap bulan, menerapkan regulasi K3 , melaporkan kejadian kecelakaan ke Direktur dan menindaklanjuti Disposisi Direktur.', '2020-01-07 03:34:43', '2020-01-07 03:34:43', 4, 2, 2019),
(8, 26, 68, '2019-01-01', 'Realisasi pemenuhan pendidikan dan pelatihan SDM RSUD RAA Soewondo Pati sejumlah 20 JPL periode Januari sampai Maret telah menagalami perubahan yang signifikan tetapi masih belum mencapai angka target dengan alasan masih belum terorganisirnya beberapa kegiatan dalam RBA Diklat tahun 2019 terkait untuk kegiatan pelatihan Internal sehingga belum terlalu banyak kegiatan seperti Inhouse Training yang terlaksana pada awal tiga bulan tahun 2019. Namun, dengan melihat meningkatnya angka grafik pada bulan Maret dapat dikatakan bahwa telah berjalan dengan baik kegiatan yang ada untuk memenuhi jumlah SDM yang harus mencapai 20 JPL setiap tahunnya.', '2020-01-07 03:34:43', '2020-01-07 03:34:43', 1, 1, 2019),
(9, 26, 68, '2019-04-01', 'Berdasarkan grafik indikator mutu Diklat terkait pemenuhan pendidikan dan pelatihan SDM RSUD RAA Soewondo Pati sejumlah 20 JPL per tahun periode April sampai Juni digambarkan dengan kurva turun dan naik. Pada bulan April ke bulan Mei kurva turun ditunjukkan pada grafik karena menurunnya/ sedikitnya kegiatan pelatihan internal maupun eksternal pada bulan Mei sehingga hanya mencapai 2% realisasi diklat pada bulan ini. Namun, terjadi peningkatan yang sangat signifikan pada bulan Juni hingga hampir mencapai goal measurement yang ditetapkan disebabkan ada beberapa kegiatan yang terlaksana dengan jumlah besar SDM sebagai peserta kegiatan pelatihan internal (inhouse training). Maka dari itu, perubahantampak sangat signifikan kenaikan kurva pada bulan Mei ke bulan Juni. ', '2020-01-07 03:34:43', '2020-01-07 03:34:43', 4, 2, 2019),
(10, 25, 67, '2019-04-01', 'hasil penanganan Tumpahan B3 di RSUD RAA Soewondo Pati untuk Triwulan I periode April-Juni 2019 capaian 0% sesuai target karena hasil tidak terjadi Tumpahan B3 atau NIHIL. Dari hasil tersebut tetap melakukan monitoring ke semua unit kerja untuk menimalisir terjadinya tumpahan B3 dan membuat laporan bulanan .', '2020-01-07 03:34:43', '2020-01-07 03:34:43', 4, 2, 2019),
(11, 18, 49, '2018-10-01', 'Berdasarkan hasil pengamatan triwulan 4 (oktober - desember 2018) sisa makanan yang tidak termakan oleh pasien rata-rata 21,69%. Hasil ini masih belum sesuai dengan target 20%. hal ini disebabkan karena faktor internal pasien yang sedang mengalami gangguan kesehatan. Sehingga bisa mempengaruhi berkurangnya nafsu makan.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 10, 4, 2018),
(12, 25, 64, '2019-01-01', 'Hasil penanganan Tumpahan B3 di RSUD RAA Soewondo Pati untuk Triwulan I periode April-Juni 2019 capaian 0% sesuai target karena hasil tidak terjadi Tumpahan B3 atau NIHIL. Dari hasil tersebut tetap melakukan monitoring ke semua unit kerja untuk menimalisir terjadinya tumpahan B3 dan membuat laporan bulanan .', '2020-01-07 03:34:44', '2020-01-12 19:22:32', 4, 2, 2019),
(13, 25, 67, '2019-04-01', 'hasil penanganan Tumpahan B3 di RSUD RAA Soewondo Pati untuk Triwulan II periode April-Juni 2019 capaian 0% sesuai target karena hasil tidak terjadi Tumpahan B3 atau NIHIL. Dari hasil tersebut tetap melakukan monitoring ke semua unit kerja untuk menimalisir terjadinya tumpahan B3 dan membuat laporan bulanan .', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 4, 2, 2019),
(14, 26, 68, '2019-07-01', 'Realisasi indikator mutu diklat pada bulan Juli hingga Agustus menunjukkan angka yang sangat besar bahkan lebih dari atrget yang ditentukan ini menunjukkan bahwa dalam dua bulan saja atau jika dibandingkan dengan bula-bulan sebelumnya. Evaluasi mutu tahun 2019 dapat tercapai, dengan kata lain setengah dari SDM RSUD RAA Soewondo Pati sudah dapat terpenuhi 20 JPL nya pada tahun 2019. Kurva realisasi pada bulan Agustus menunjukkan angka yang fantastis yaitu 115.32% menunjukkan bahwa banyaknya kegiatan serta partisipasi peserta (SDM RSUD RAA Soewondo Pati) dalam kegiatan pelatihan internal khususnya seperti Inhouse Training.  Sedangkan, pada bulan September, gambar kurva mengalami penurunan dikarenakan tidak banyaknya kegiatan seperti bulan sebelumnya.', '2020-01-07 03:34:44', '2020-01-06 20:46:43', 4, 2, 2019),
