(17, 18, 47, '2019-01-01', 'Berdasarkan hasil pengamatan triwulan I tahun 2019 (januari-maret), rata-rata pasien post operasi yang mendapartkan asuhan gizi sebesar 67,87%. masih belum mencapai standar 100%. bila dilihat dari perkembangan tiap bulan ada peningkatan capaian dari bulan februari ke maret 2019, yaitu 57.14% menjadi 77.17%.   ', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 1, 1, 2019),
(18, 18, 48, '2019-03-01', 'Berdasarkan hasil pengamatan di triwulan I tahun 2019 (januari - maret ) rata-rata  petugas penjamah makanan yang memakai APD dengan lengkap dan benar sebesar 83.46%. Penjamah makanan yang belum taat pemakaian APD nya sebesar 16.54% semua memakai masker yang tidak menutup hidung. hal ini dikarenakan petugas merasa sulit bernafas bila masker menutup hidung.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 3, 1, 2019),
(19, 18, 48, '2019-06-01', 'berdasarkan hasil pengamatan di triwulan ke II tahun 2019 ( april - juni ) kepatuhan pemakaian APD penjamah makanan rata-rata 97.34%. Ada peningkatan capaian dari trimester sebelumnya 83.46%. hal ini menunjukkan adanya upaya para penjamah makanan memakai APD sesuai standar.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 6, 2, 2019),
