(25, 5, 15, '2018-10-01', 'Capaian indikator emergency respon time ( waktu tanggap pelayanan gawat darurat kurang dari sama dengan 5 menit ) di IGD RSUD RAA Soewondo Patipada tri wulan IV tahun 2018, capaian belum bisa 100 %  dan masih dibawah rerata capaian ( 92,37% ) yaitu pada bulan oktober realisasi 93,11%, Nopember 91,93 % dan bulan Desember angka capaian 92, 08 % Hal ini disebabkan karena angka kunjungan pasien pada bulan nopember dan desember memang terjadi peningkatan kunjungan  dan kebanyakan pasien datang pada sore dan malam hari sehingga sering erjadi penumpukan pasien pada saat datang.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 10, 4, 2018),
