(30, 26, 69, '2018-10-01', 'Pemenuhan Kelengkapan Sertifikat Peserta Diklat setelah pelatihan dalam periode Oktober hingga Desember 2018 mengalami kurva turun-naik, dimana kita dapat melihat jika pada bulan Oktober kepatuhan peserta untuk mengumpulkan sertifikat setelah pelatihan eksternal berjalan dengan baik (lengkap), sedangkan mengalami penurunan pada bulan November karena pada bulan tersebut memang tidak ada SDM Rumah Sakit yang diberangkatkan untuk mengikuti pelatihan eksternal sehingga akan berpengaruh terhadap kelengakapan sertifikat. Selanjutnya mengalami kenaikan bahkan melebihi target pada bulan Desember dikarenakan SDM yang mengikuti kegiatan pelatihan eksternal pada bulan tersebut semua mengumpulkan sertifikat sesuai ketentuan yang telah dibuat.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 10, 4, 2018),
