(35, 19, 50, '2018-10-01', 'Dari hasil pemeriksaan air limbah yang dilakukan bulan oktober - desember 2018, dapat dilihat di grafik hasil dibulan oktober 81,25 % ada dua parameter yang tidak sesuai baku mutu. Tetapi pada bulan november hasil pemeriksaan air limbah mencapai target 100 % karena 16 parameter yang diperiksa telah memenuhi baku mutu/ standar. Hanya saja pada bulan desember terjadi penurunan dengan nilai 93,75 % disebabkan ada 1 parameter yang tidak memenuhi baku mutu atau standart.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 10, 4, 2018),
(36, 19, 50, '2019-01-01', 'Dari hasil pemeriksaan air limbah yang dilakukan bulan Januari - Maret 2019, dapat dilihat di grafik hasil dibulan Januari 100 % dan sudah mencapai target. Tetapi pada bulan november hasil pemeriksaan air limbah melngalami penurunan dengan nilai 93,75 % karena 1 parameter yang diperiksa tidak memenuhi baku mutu/ standar. Hanya saja pada bulan desember terjadi peningkatan kembalui dengan nilai 100 % dan 16 parameter pemeriksaan air limbah telah memenuhi baku mutu/ standart.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 1, 1, 2019),
(37, 19, 50, '2019-04-01', 'Dari hasil pemeriksaan air limbah yang dilakukan pada bulan April - Juni 2019, dapat dilihat di grafik hasil dibulan April 81,25 % ada dua parameter yang tidak sesuai baku mutu. Tetapi pada bulan mei hasil pemeriksaan air limbah mencapai target 100 % karena 16 parameter yang diperiksa telah memenuhi baku mutu/ standar. Hanya saja pada bulan juni terjadi penurunan dengan nilai 75 % disebabkan ada 4 parameter yang tidak memenuhi baku mutu atau standart.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 4, 2, 2019),
(38, 25, 64, '2019-01-01', 'Tingkat kepatuhan pengisian papan code red untuk Triwulan I periode Januari-Maret 2019 diperoleh hasil 64.21 % dibandingkan dengan bulan Januari yang mencapai 56.32% . rata-rata kepatuhan pengisian papan code red untuk triwulan I adalah 59.47% dan hasil tersebut masih jauh dari target yang direncanakan yaitu 100%. dari hasil tersebut tetap melakukan monitoring kepatuhan pengisian papan code red dan membuat laporan bulanan.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 1, 1, 2019),
(39, 25, 64, '2019-04-01', 'hasil tingkat kepatuhan code red triwulan II periode April-Juni 2019 mengalami penurunan tiap bulan sampai 46.32% yang dibandingkan di triwulan I yang sebesar 64.21%. rata-rata dari hasil tersebut diperoleh hasil 53.08% dan hasil tersebut masih jaug dari target yang direncanakan yaitu 100%. dan untuk selanjutnya tetap melakukan monitoring ke semua unit kerja tiap bulan dan membuat laporan bulanan.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 4, 2, 2019),
(40, 20, 54, '2019-01-01', 'Grafik pada Judul Respon Time terhadap laporan kerusakan alat kesehatan â‰¤ 15 menit menunujukkan bahwa Realisasi dari data grafik Triwulan bulan januari sampai maret yang ada pada Instalasi Alkes rata-rata capaian  Grafik adalah 83,13% dan data Realisasi mengalami kenaikan jumlah presentase karena jumlah laporan dan tanggapan tindak lanjut oleh petugas Alkes data setiap bulan berbeda namun Grafik menunjukkan bahwa bulan Januari Grafik rata-rata menunjukkan 62,50% dari Target 100%, dari Grafik tersebut menunjukkan bahwa capaian respons time petugas Alkes terhadap laporan kerusakan alat Triwulan I pada setiap ruangan sudah baik', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 1, 1, 2019),
(41, 20, 54, '2019-04-01', 'Grafik pada Judul Respon Time terhadap laporan kerusakan alat kesehatan â‰¤ 15 menit menunujukkan bahwa Realisasi dari data grafik Triwulan bulan April sampai Juni yang ada pada Instalasi Alkes rata-rata capaian  Grafik adalah 90% dan data Realisasi mengalami kenaikan jumlah presentase karena jumlah laporan dan tanggapan tindak lanjut oleh petugas Alkes data setiap bulan berbeda namun Grafik menunjukkan bahwa bulan Januari Grafik rata-rata menunjukkan 90% dari Target 100%, dari Grafik tersebut menunjukkan bahwa capaian respons time petugas Alkes terhadap laporan kerusakan alat Triwulan II pada setiap ruangan sudah hampir mencapai Target yaitu 100%.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 4, 2, 2019),
(42, 26, 70, '2019-01-01', 'Kesediaan TOR pada periode ini mengalami perubahan yang cukup baik walaupun pada bulan Januari dan Februari belum ada TOR yang masuk ke Diklat karena memang belum ada kegiatan internal yang terlaksana. Namun, pada bulan Maret jumlah kesediaan TOR sudah terpenuhi sesuai dengan kegiiatan internal yang akan terlaksana.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 1, 1, 2019),
