(107, 32, 92, '2019-04-01', 'Tren kepatuhan petugas dalam melakukan doubel cek terhadap pemberian obat high alert medication selama bulan April - Juni 2019 mengalami penurunan pada bulan April ke Mei 2019 sebesar 2,83% ( 65,33% - 62,50%). Tetapi pada bulan Mei ke Juni 2019 mengalami tren naik sebesar 3,29% ( 65,79% - 62,50% ). Hal ini menunjukkan bahwa masih ada beberapa petugas yang belum melakukan doubel cek terhadap pemberian obat high alert medication.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 4, 2, 2019),
