(212, 27, 71, '2019-04-01', 'Capaian reliasasi angka cost recovery bulan April sampai dengan Juni 2019 mengalami penurunan yang sangat signifikan yang pada bulan april mencapai 159% menurun menjadi 56% pada bulan mei dan semakin menurun kembali menjadi 26,57% pada bulan juni. Penurunan angka cost recovery ini mengindikasikan nilai pendapatan yang diterima belum bisa membiayai belanja yang dikeluarkan. salah satu penyebab turunnya nilai pendapatan karena keterlambatan pembayaran klaim oleh pihak asurasi BPJS, sebagai penjamin utama di rumah sakit.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 4, 2, 2019),
(213, 34, 98, '2019-08-01', 'Penilaian penggunaan antibiotik secara kuantitas dilakukan dengan cara menghitung DDD (Defined Daily Doses) per 100 hari rawat yang telah direkomendasikan oleh WHO. Penilaian kuantitas penggunaan antibiotik dari 252 pasien yang masuk dalam ruang perawatan didapat dari perhitungan DDD/100 hari rawat. Semakin kecil kuantitas antibiotik yang digunakan menunjukkan bahwa dokter lebih selektif dalam peresepan antibiotik sehingga lebih mendekati prinsip penggunaan antibiotik yang rasional. Dalam penelitian ini didapatkan 14 variasi jenis antibiotik yang dikonsumsi pasian pada ruang Flamboyan, Dahlia, dan Gading 1, pada tahun 2018 terdapat 19 jenis antibiotic yang dikonsumsi pasien. Sehingga dapat disimpulkan bahwa terjadi penurunan jenis antibiotic yang dikonsumsi pasien pada ruang Flamboyan, Dahlia, dan Gading.<br />\r\nSedangkan untuk prosentase jumlah pasien yang menggunakan antibiotic dari ketiga ruangan tersebut, diperoleh rata â€“ rata pasien yang menggunakan antibiotik pada tahun 2019 sebesar 67,26 %, dan pada tahun 2018 sebesar 68,42%. Sehingga dapat disimpulkan penggunaan antibiotic pada ruang Flamboyan, Dahlia, dan Gading 1 terjadi penurunan sebesar 1,16%.<br />\r\n', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 8, 2, 2019),
(214, 34, 100, '2019-08-01', 'Prosentase jumlah pasien yang menggunakan antibiotic ceftriaxon dari ketiga ruangan tersebut sebesar 15 pasien, sedangkan penggunaan ceftriaxon yang rasional (kategori 0) sebanyak 5 pasien atau sebesar 30%. Hal ini tidak memenuhi target indikator mutu dimana targetnya sebesar 100% yang artinya semua pasien yang mendapatkan ceftriaxon penggunaannya rasional. Penggunaan ceftriaxon akan dievaluasi kembali pada tahun 2020 bulan agustus.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 8, 2, 2019),
(215, 20, 56, '2019-10-01', 'Grafik pada Judul Alat Kesehatan di Instalasi Bedah Sentral (IBS) Terkalibrasi Tepat Waktu Sesuai Dengan Ketentuan menunujukkan bahwa Realisasi dari data grafik Triwulan IV yang ada pada Instalasi Alkes terdapat di bulan Oktober karena pengadaan kalibrasi diadakan 1tahun sekali rata-rata capaian Grafik adalah 90.53% dan data Realisasi  presentase jumlah Alat yang ada di IBS sebanyak 92 Alat keseehatan dan yang sudah di kalibrasi adalah sebanyak 86 alat kesehatan laporan dan tanggapan tindak lanjut oleh petugas kalibrasi data setiap ruangan sudah baik jumlah petugas kalibrasi dengan jumlah alat juga memadai sehingga di dapat perolehan grafik yang baik.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 10, 4, 2019),
