(236, 26, 69, '2019-07-01', 'Pemenuhan kelengkapan sertifikat pada bulan Juli hingga September mengalami penurunan yang signifikan dikarenakan minimnya kegaiatan eksternal yang terlaksana, terlebih di bulan September yang mana dapat dilihat bahwa angka grafik menunjukkan jauh dari angka target jika dibandingkan dengan  dua bulan sebelumnya mampu mencapai atau dapat dikatakan melebihi angka target.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 7, 2, 2019),
(237, 26, 70, '2019-07-01', 'Pada periode bulan Juli sampai September, kurva grafik menunjukkan angka yang cukup baik karena angka yang ditunjukkan mampu bahkan melebihi angkantarget yang ada. Meskipun begitu, penurunan yang terjadi tidak lah begitu buruk karena tidak jauh dari angka target yang ditentukan. Kesediaan TOR di periode tiga bulan ini termasuk cukup baik dibandingkan bulan-bulan sebelumnya karena mengalami kurva penurunan, tapi tidak terlalu jauh dengan goal measurement.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 7, 2, 2019),
(238, 5, 15, '2019-04-01', 'capaian indikator emergency respon time ( waktu tanggap pelayanan gawat darurat kurang dari samadengan 5 menit ) di IGD RSUD RAA Soewondo Pati di triwulan II mengalami sedikit penurunan dari triwulan I,hal ini dapat kita lihat darihasi capaian bulan april 92,55%, Mei 91,45%, Juni 89,34 % dan rerata realisasi hasil 91,11% hal menandakan adanya penurunan 1,1% dari triwulan sebelumnya, dan masih belum sesuai dengan target dari rumah sakit yaitu 100% hal ini mungkin disebabkan karena ada kaitan dengan aturan BPJS yang terbaru dengan adanya rujukan berjenjang yang mempengaruhi jumlah kunjungan pasien ke Rumah Sakit.Rekomendasi tingkatkan pelayanan terhadap waktu tanggap di IGD sesuai dengan SPO dan standar SPM, motivasi tenaga medis maupun non medis yang ada keterkaitan dengan waktu tanggap pelayanan untuk memberikan pelayanan sesuai SPO dan ikhlas melayani sesuai semboyan RSU. ', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 4, 2, 2019),
