(256, 34, 99, '2019-01-01', 'Dalam laporan peta kuman dan uji sensitivitas yang tersusun berdasarkan data pola kuman RSUD RAA Soewondo Pati tahun 2018, ditemukan jumlah kuman ESBL yang berada di ruang Anggrek terdeteksi 1, ruang Bougenville terdeteksi 1, ruang Catleya I terdeteksi 1, ruang ICU terdeteksi 1, ruang Mawar terdeteksi 2, ruang Melati terdeteksi 2, ruang Poli dalam terdeteksi 1, ruang WK II terdeteksi 1, serta ruang WK III terdeteksi 1.<br />\r\n<br />\r\nTotal jumlah kuman ESBL yang terdeteksi di 9 ruangan RSUD RAA Soewondo Pati ialah 11, sedangkan total sampel gram negative 37. Ruangan yang memiliki deteksi ESBL tertinggi ialah ruang Mawar dan Melati, yakni masing masing 2. Dan untuk prosentase kuman ESBL periode Januari â€“ Desember 2018 ialah 29,73% ((11/37) x 100% = 29,73%). Target ESBL seharusnya 10% tetapi hasil tahun 2018 ini melebihi target, sehingga akan dilakukan sosialisasi terkait hasil pola kuman terutama tentang ESBL (penyebab, klinis, cara penularan, pengelolaan dan pencegahan)  serta koordinasi dengan PPI terkait cara cuci tangan yang benar, pelaksanaan kohorting, desinfeksi ruangan dan pencegahan PPRA meliputi pengendalian restriksi antibiotik dalam perbaikan kuantitas dan kualitas antibiotik.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 1, 1, 2019),
(257, 34, 101, '2019-01-01', 'Dalam laporan peta kuman dan uji sensitivitas yang tersusun berdasarkan data pola kuman RSUD RAA Soewondo Pati tahun 2018, ditemukan jumlah kasus kuman MRSA yang berada seluruh lingkungan RSUD RAA Soewondo Pati terdeteksi 1 di ruang Edelways. Sedangkan total sampel gram positif yang terdeteksi di lingkungan RSUD RAA Soewondo Pati sejumlah 11. Dari hasil tersebut dapat diketahui prosentase kuman MRSA RSUD RAA Soewondo Pati periode Januari â€“ Desember 2019 sejumlah 9% ((1/11) x 100 % = 9 %), dimana hasil tersebut memenuhi target.', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 1, 1, 2019),
(258, 20, 56, '2019-09-01', 'Grafik pada Judul Alat Kesehatan di Instalasi Bedah Sentral (IBS) Terkalibrasi Tepat Waktu Sesuai Dengan Ketentuan menunujukkan bahwa Realisasi dari data grafik Triwulan IV yang ada pada Instalasi Alkes terdapat di bulan Oktober karena pengadaan kalibrasi diadakan 1tahun sekali rata-rata capaian Grafik adalah 90.11% dan data Realisasi presentase jumlah Alat yang ada di IBS sebanyak 91 Alat keseehatan dan yang sudah di kalibrasi adalah sebanyak 82 alat kesehatan laporan dan tanggapan tindak lanjut oleh petugas kalibrasi data setiap ruangan sudah baik jumlah petugas kalibrasi dengan jumlah alat juga memadai sehingga di dapat perolehan grafik yang baik', '2020-01-07 03:34:44', '2020-01-07 03:34:44', 9, 2, 2019),
