INSERT INTO `indikator` (`id`, `kode`, `id_unit`, `area`, `judul_indikator`, `definisi_operasional`, `numerator`, `denumerator`, `cara_pengumpulan`, `target`, `target_grafik`, `frekuensi_pengumpulan_data`, `penanggung_jawab`, `created_at`, `updated_at`, `keterangan`, `validasi`, `status`, `analisa`) VALUES
(6, '001.01', 2, 'Klinis', 'Waktu tunggu di Rawat Jalan â‰¤ 60 menit ', 'Waktu tunggu adalah waktu yang diperlukan mulai pasien kontak dengan petugas pendaftaran sampai dilayani oleh dokter/ dokter spesialis. Catatan: Yang dimaksud  kontak dengan petugas pendaftaran adalah waktu petugas mencatat identitas pasien. Yang dimaksud dilayani oleh dokter/ dokter spesialis adalah waktu pasien kontak awal dengan dokter/ dokter spesialis', 'Jumlah komulatif waktu tunggu pasien rawat jalan yang disurvey', 'Jumlah seluruh pasien rawat jalan yang disurvey', 'Retrospektif', '100%', '100', 'Bulanan', 'Ka Instalasi Rawat Jalan', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(7, '002.01', 1, 'Klinis', 'Kepatuhan jam visite dokter spesialis', 'Kepatuhan Jam Visite Dokter Spesialis sebagai DPJP adalah kunjungan dokter spesialis untuk melihat perkembangan pasien yang menjadi tanggung jawabnya setiap hari sebelum jam 14.00 termasuk hari libur.   Catatan : 1.pasien baru masuk 2.batasan pukul 14.00 3.hari libur 4. RS. Swasta', 'Jumlah visite dokter spesialis sebelum jam 14:00pada hari berjalan', 'Jumlah visite dokter spesialis pada hari berjalan', 'Retrospektif', '80%', '80', 'Bulanan', 'Ka Instalasi Rawat Inap', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(8, '002.02', 1, 'Klinis', 'Kepatuhan terhadap clinical pathway ', 'Kepatuhan terhadap clinical pathway adalah kepatuhan para staf medis/ DPJP dalam menggunakan clinical pathway untuk memberikan asuhan klinis pasien secara terstandarisasi dan terintegrasi sehingga dapat meminimalkan adanya variasi proses asuhan klinis. Setiap RS menetapkan 5 clinical pathway untuk penyakit atau kondisi yang memenuhi satu atau lebih kriteria yang berlaku di RS tersebut berdasarkan: a.Penyakit atau kondisi yang paling sering atau banyak terjadi (High Volume) b.Penyakit atau kondisi yang memiliki risiko tinggi (High Risk) c.Penyakit atau kondisi yang memerlukan biaya tinggi (High Cost) d.Penyakit atau kondisi yang terdapat variasi/keragaman dalam pengelolaannya. Setiap CP mampu menunjukan komponen standar LOS, obat dan penunjang. Disebut patuh apabila mengikuti ketiga proses asuhan yang telah distandarisasi dalam CP', 'Jumlah kasus yang penanganannya patuh dengan kriteria 5 clinical pathways', 'Jumlah total kasus yang masuk dalam kriteria 5 clinical  pathways yang ditetapkan', 'Retrospektif', '80%', '80', 'Bulanan', 'Ka Instalasi Rawat Inap', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(9, '002.03', 1, 'Klinis', 'Ketepatan waktu tunggu operasi elektif', 'Waktu tunggu operasi elektif adalah rata- rata tanggal waktu sejak pasien masuk rawat inap dengan rencana operasi sampai dengan operasi dilaksanakan ', 'Jumlah waktu tunggu operasi yang terencana', 'Jumlah seluruh sampel atau jumlah seluruh pasien dengan operasi yang terencana', 'Retrospektif', '100%', '100', 'Bulanan', 'Ka Instalasi Rawat Inap', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(10, '003.01', 3, 'Klinis', 'Ketidaklengkapan laporan operasi ', 'Ketidaklengkapan penulisan laporan operasi setelah pasien keluar dari kamar operasi', 'Jumlah pasien yang laporan operasi tidak lengkap', 'Jumlah pasien operasi ', 'Retrospektif', '0%', '0', 'Bulanan', 'Ka Instalasi Bedah Sentral ', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(11, '003.02', 3, 'Klinis', 'Penundaan operasi elektif', 'Penundaan operasi elektif adalah perubahan jadwal operasi yang direncanakan. Operasi Elektif adalah operasi atau tindakan yang dijadwalkan.  Tindakan operasi elektif termasuk mata, paru', 'Jumlah pasien yang waktu jadwal operasinya berubah', 'Jumlah pasien operasi elektif', 'Retrospektif', '5%', '5', 'Bulanan', 'Ka Instalasi Bedah Sentral', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(12, '004.01', 4, 'Klinis', 'Kepatuhan upaya pencegahan resiko cidera akibat pasien jatuh pada pasien post anestesi ', 'Upaya pencegahan jatuh meliputi: 1. screning di IBS pada setiap pasien yang selesai dilakukan anestesi 2. asesment awal resiko jatuh 3. asesment ulang resiko jatuh 4. edukasi pencegahan pasien jatuh Disebut patuh apabila melaksanakan seluruh upaya pencegahan jatuh pada pasien yang berisiko sesuai dengan standar yang ditetapkan oleh rs. Catatan: 1. asesment awal hanya dilakukan pada pasien rawat inap 2. untuk pasien rawat jalan dan IGD hanya dilakukan screening', 'Jumlah kasus yang mendapat ketiga upaya pencegahan pasien jatuh', 'Jumlah kasus yang berisiko jatuh. Semua pasien yang dilakukan tindakan anesthesi', 'Retrospektif', '100%', '100', 'Bulanan', 'Tim Mutu RS ', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(13, '004.02', 4, 'Klinis', 'Komplikasi selama pemberian sedasi', 'Komplikasi sedasi yang disebabkan oleh pemberian obat-obatan sedasi dan terjadi dalam waktu 6 jam sejak pemberian sedasi ditandai dengan oenurunan SpO2 â‰¤ 94%', 'Jumlah pemberian sedasi yang ditemukan komplikasi dalam periode satu bulan', 'Semua pasien yang mendapat pemberian sedasi dalam periode satu bulan', 'Retrospektif', '<6%', '6', 'Bulanan', 'Ketua tim mutu anesthesi', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(14, '004.03', 4, 'Klinis', 'Pemberian edukasi anestesi pada keluarga pasien pre operasi elektif', 'Pemberian inform concent tentang komplikasi dan teknik pembiusan pada keluarga pasien pre operasi elektif', 'Jumlah keluarga pasien pre operasi elektif yang hadir untuk edukasi', 'Jumlah program operasi elektif di hari yang sama', 'Retrospektif', '100%', '100', 'Bulanan', 'Ketua tim mutu anesthesi', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(15, '005.01', 5, 'Klinis', 'Emergency Respon Time (Waktu tanggap pelayanan gawat darurat â‰¤ 5 menit)', 'Emergency Response Time (Waktu tanggap) adalah waktu yang dibutuhkan mulai pasien dilakukan Triage di IGD sampai mendapat pelayanan dokter. Triage adalah usaha pemilahan pasien sebelum ditangani berdasarkan tingkat kegawatdaruratan/trauma/penyakit dengan mempertimbangkan prioritas penanganan dan sumber daya yang ada.', 'Jumlah total waktu respon time pasien gawat, pasien darurat dan pasien gawat darurat dalam sebulan', 'Jumlah total pasien gawat, pasien darurat dan pasien gawat darurat dalam sebulan', 'Concurent', '100%', '100', 'Bulanan', 'Ka IGD', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(16, '005.02', 5, 'Klinis', 'Angka keterlambatan operasi Sectio Caesarea (SC) Emergency > 30 menit ', 'Sectio Caesarea Emergency adalah suatu tindakan pembedahan untuk mengeluarkan janin dari perut ibu. Keterlambatan SC adalah penundaan pelaksanaan SC Emergency > 30 menit dari waktu yang telah dijadwalkan.', 'Jumlah pasien SC Emergency yang terlambat > 30 menit', 'Jumlah semua pasien SC emergency', 'Concurent', '0%', '0', 'Bulanan', 'Ketua tim Ponek', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(18, '006.01', 6, 'Klinis', 'Kepatuhan petugas IBS melengkapi transfer internal pasien post operasi di ruang ICU ', 'Kepatuhan petugas IBS melengkapi transfer internal pasien post operasi di ruang ICU adalah kepatuhan para petugas IBS dalam menggunakan dan melengkapi transfer internal untuk memberikan asuhan klinis pasien secara terstandarisasi dan terintegrasi sehingga dapat meminimalkan adanya kesalahan timbang terima pasien baru post operasi yang dirawat di ruang ICU', 'Jumlah pasien baru post operasi dari IBS yang transfer internalnya diisi dan dilengkapi oleh petugas IBS', 'Jumlah total pasien baru post operasi dari IBS', 'Retrospektif', '100%', '100', 'Bulanan', 'Ka Instalasi ICU', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(19, '006.02', 6, 'Klinis', 'Kepatuhan petugas anestesi melengkapi transfer internal pasien post operasi di ruang ICU', 'Kepatuhan petugas Anestesi melengkapi transfer internal pasien post operasi di ruang ICU adalah kepatuhan para petugas Anestesi dalam menggunakan dan melengkapi transfer internal untuk memberikan asuhan klinis pasien secara terstandarisasi dan terintegrasi sehingga dapat meminimalkan adanya kesalahan timbang terima pasien baru post operasi yang dirawat di ruang ICU', 'Jumlah pasien baru post operasi dari IBS yang transfer internalnya diisi dan dilengkapi oleh petugas Anestesi', 'Jumlah total pasien baru post operasi dari IBS', 'Retrospektif', '100%', '100', 'Bulanan', 'Ka Instalasi ICU', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(20, '006.03', 6, 'Klinis', 'Kepatuhan petugas IBS mendampingi pasien baru post operasi di ruang ICU ', 'Kepatuhan petugas IBS mendampingi pasien post operasi di ruang ICU adalah kepatuhan para petugas IBS dalam mendampingi pasien baru post operasi dari IBS untuk memberikan asuhan klinis pasien secara terstandarisasi dan terintegrasi sehingga dapat meminimalkan adanya kesalahan timbang terima pasien baru post operasi yang dirawat di ruang ICU', 'Jumlah pasien baru post operasi dari IBS yang datang ke ICU didampingi oleh petugas IBS', 'Jumlah total pasien baru post operasi dari IBS', 'Retrospektif', '100%', '100', 'Bulanan', 'Ka Instalasi ICU', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(21, '006.04', 6, 'Klinis', 'Pasien yang kembali ke ICU dengan kasus yang sama < 72 jam ', 'Pasien kembali ke pelayanan intensif dari ruang rawat inap dengan kasus yang sama dalam waktu < 72 jam', 'Jumlah total pasien yang kembali ke instalasi pelayanan intensif  (ICU) dengan kasus yang sama < 72 jam', 'Jumlah pasien yang di rawat di ruang ICU dalam waktu satu bulan', 'Retrospektif', '0%', '0', 'Bulanan', 'Ka Instalasi ICU', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(22, '007.01', 7, 'Klinis', 'Nullipara hamil naterm janin tunggal letak verteks/belakang kepala lahir dengan SC', 'Wanita hamil pertama/lebih dan belum pernah melahirkan bayi, umur kehamilan saat ini cukup bulan/aterm, janin tunggal letak verteks/ belakang kepala', 'Jumlah pasien kamar bersalin nullipara hamil aterm letak verteks/belakang kepala lahir dengan SC', 'Jumlah semua nullipara yang melahirkan di kamar bersalin', 'Retrospektif', '15%', '15', 'Bulanan', 'Ketua Mutu IKB', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(23, '007.02', 7, 'Klinis', 'Ketertiban waktu distribusi hasil pemeriksaan laborat pasien rawat bersalin', 'Rentan waktu dan alur / sistem yang jelas , petugas ruang Bersalin mendapatkan / mengambil hasil laborat pasien barunya baik yang sampel laborat dikirim dari ruang Bersalin maupun dikirim dari ruang Ponek IGD', 'Pasien baru yang dalam rentan waktu 7 - 10 jam ( 1 siff jaga ) waktu operan jaga hasil laborat sudah didapatkan', 'Semua pasien baru ruang Bersalin yang dilakukan pemeriksaan laborat baik dari Ponek IGD maupun dari ruang IKB', 'Concurent', '100%', '100', 'Bulanan', 'Ketua Mutu IKB', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(24, '007.03', 7, 'Klinis', 'Kejadian tidak dilakukan Inisiasi Menyususi Dini ( IMD ) yang maksimal ( minimal lama waktu 2 jam atau bayi sudah menemukan putting susu ibu / dihisap ) pada bayi yang lahir di ruang Bersalin ada indikasi untuk diobservasi di ruang Perinatal level 1', 'Suatu kejadian persalinan fisiologis maupun patologis di ruang Bersalin yang sesuai indikasi dr. SpA, bayi perlu dilakukan observasi diruang Perinatal level 1 dan harus dilakukan IMD dulu, yang mana ibu bayi masih diobservasi di ruang Bersalin sampai nantinya ibu dipindah diunit nifas', 'Jumlah bayi yang lahir di ruang Bersalin yang ada yang ada indikasi diobservasi di ruang Perinatal level 1 dan dilakukan IMD dulu oleh petugas ruang Bersalin sampai waktu 2 jam atau bayi sudah menemukan putting susu ibu dihisap', 'Jumlah bayi yang dilahirkan di ruang Bersalin yang ada indikasi dari dr. SpA untuk diobservasi diruang Perinatal level 1 tapi bayi dilakukan IMD dulu', 'Concurent', '100%', '100', 'Bulanan', 'Ketua Mutu IKB', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(25, '008.01', 8, 'Klinis', 'Keterlambatan waktu tindakan hemodialisa', 'Keterlambatan waktu tindakan hemodialisa adalah terjadinya penundaan waktu tindakan pasien hemodialisa lebih dari 1 jam dari waktu yang ditentukan (dijadwalkan)', 'Semua pasien dengan keterlambatan tindakan hemodialisa yang disebabkan oleh pihak pasien atau keluarga', 'Semua pasien dengan keterlambatan tindakan hemodialisa', 'Concurent', '0%', '0', 'Bulanan', 'Ka Instalasi Hemodialisa', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(26, '008.02', 8, 'Klinis', 'Insiden kesalahan setting program hemodialisa', 'Kesalahan setting program mesin hemodialisa adalah terjadi ketidaksesuaian antara program dokter dengan program yang dilakukan sehingga dapat mempengaruhi kondisi pasien', 'Jumlah insiden Kesalahan setting Program Hemodialisa', 'Jumlah Tindakan HD', 'Concurent', '0%', '0', 'Bulanan', 'Ka Instalasi Hemodialisa', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(27, '008.03', 8, 'Klinis', 'Insiden ketidaktepatan insersi vena dan arteri pada pasien hemodialisa', 'Ketidaktepatan insersi akses vena dan arteri adalah ketidaktepatan pelaksanaan akses intravaskuler baik vena maupun arteri perifer atau AV shunt.', 'Jumlah insiden ketidaktepatan /kegagalan insersi vena/arteri pasien hemodialisa', 'Semua tindakan HD', 'Concurent', '0%', '0', 'Bulanan', 'Ka Instalasi Hemodialisa', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(28, '008.04', 8, 'Klinis', 'Ketidakpatuhan pasien tentang jadwal HD', 'Ketidakpatuhan pasien tentang jadwal HD adalah ketidak taatan pasien HD dalam menjalani terapi HD sesuia jadwal dan saran dokter', 'Jumlah pasien yang tidak hadir sesuai jadwal', 'Jumlah semua pasien yang dilakukan tindakan HD', 'Concurent', '0%', '0', 'Bulanan', 'Ka Instalasi Hemodialisa', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(29, '008.05', 8, 'Klinis', 'Insiden kegagalan pemasangan Kateter Double Lumen di IBS', 'Kegagalan Pemasangan Kateter Double lumen adalah ketidakberhasilan penggunaan kateter double lumen setelah pemasangan sehingga menimbulkan efek kateter macet dan timbul pembengkakan serta perdarahan', 'Semua pasien yang mengalami kagagalan dalam pemasangan kateter double lumen ', 'Semua pasien yang dilakukan pemasangan kateter doube lumen', 'Concurent', '0%', '0', 'Bulanan', 'Ka Instalasi Hemodialisa', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(30, '009.01', 9, 'Klinis', 'Ketidakmampuan menangani BBLR 1500 â€“ 2500 gram', 'BBLR adalah bayi yang lahir dengan berat badan 1500 â€“ 2500 gram', 'Kematian bayi yang lahir dengan berat badan 1500 -2500 gram', 'Semua bayi yang lahir dengan berat badan 1500 â€“ 2500 gram', 'Retrospektif', '50%', '50', 'Bulanan', 'Ka Instalasi Perinatal', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(31, '032.03', 33, 'Klinis', 'Kejadian tidak dilakukan inisiasi menyusu dini ( IMD ) pada bayi baru lahir  ', 'Inisiasi Menyusu Dini adalah  bayi baru lahir diberikan kesempatan untuk memulai atau inisiasi menyusu sendiri segera setelah lahir dengan membiarkan kontak kulit bayi dan ibu setidaknya satu jam atau sampai menyusu pertama selesai', 'Jumlah bayi yang tidak dilakukan IMD', 'Jumlah bayi baru lahir yang tidak mempunyai masalah kesehatan', 'Retrospektif', '0,5%', '0.5', 'Bulanan', 'Ka Tim Ponek', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(32, '010.01', 10, 'Klinis', 'Keterlambatan waktu tunggu  ekspertise foto thorax untuk persiapan operasi elektif rawat jalan â‰¥ 3 jam ', 'Waktu yang diperlukan untuk mendapatkan ekspertise foto thorax pada persiapan operasi elektif rawat jalan', 'Jumlah keterlambatan waktu tunggu ekspertise foto thorax untuk persiapan operasi elektif rawat jalan  â‰¥ 3 jam dalam 1 bulan', 'Jumlah keseluruhan pasien operasi elektif rawat jalan di radiologi dalam 1 bulan', 'Retrospektif', '0%', '0', 'Bulanan', 'Ka Instalasi Radiologi', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(33, '010.02', 10, 'Klinis', 'Keterlambatan waktu tunggu ekspertise pemeriksaan pasien nilai kritis â‰¥ 1 jam', 'Waktu yang diperlukan untuk mendapatkan ekspertise pasien nilai kritis ', 'Jumlah keterlambatan waktu tunggu ekspertise pemeriksaan pasien nilai kritis â‰¥ 1 jam dalam 1 bulan', 'Jumlah keseluruhan pemeriksaan pasien nilai kritis di radiologi dalam 1 bulan', 'Retrospektif', '0%', '0', 'Bulanan', 'Ka Instalasi Radiologi', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(34, '010.03', 10, 'Klinis', 'Pelaksanaan ekspertise hasil pemeriksaan rontgen', 'Pelaksanaan ekspertise foto rontgen adalah dokter spesialis radiologi yang mempunyai kewenangan untuk melakukan pembacaan foto rontgen yang hasil pemeriksaannya dikirimkan kepada dokter yang meminta', 'Jumlah foto rontgen yang dibaca dan diverifikasi oleh dokter spesialis radiologi dalam 1 bulan', 'Jumlah seluruh pemeriksaan foto rontgen dalam 1 bulan', 'Retrospektif', '100%', '100', 'Bulanan', 'Ka Instalasi Radiologi', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(35, '011.01', 13, 'Klinis', 'Pelayanan pemeriksaan laboratorium pasien pre operasi dari rawat jalan', 'Waktu tunggu hasil pemeriksaan laboratorium pre operasi di rawat jalan <140 menit', 'Jumlah kumulatif waktu tunggu hasil pelayanan laboratorium pasien pre operasi dari rawat jalan yang disurvey dalam waktu 1 bulan', 'Jumlah pasien yang diperiksa pre operasi dalam bulan tersebut', 'Concurent', '100%', '100', 'Bulanan', 'Ka Instalasi Laboratorium', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(36, '011.02', 13, 'Klinis', 'Waktu pelaporan hasil kritis', 'Hasil kritis adalah hasil pemeriksaan laboratorium yang abnormal dan mengindikasikan kelainan yang dapat mengancam jiwa ', 'Jumlah pelaporan hasil kritis yang < 30', 'Jumlah semua pelaporan hasil kritis', 'Concurent', '100%', '100', 'Bulanan', 'Ka Instalasi Laboratorium', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(37, '012.01', 14, 'Klinis', 'Ketersediaan obat dan BMHP live saving di Ruang Pemulihan IBS', 'Obat dan BMHP live saving adalah obat dan bahan medis habis pakai yang ditujukan untuk mengatasi kondisi kegawatan dalam upaya penyelamatan pasien dari komplikasi, kecacatan dan kematian ', 'Jumlah item obat dan BMHP yang tersedia lengkap termasuk jenis dan jumlahnya sesuai daftar inventaris di troley emergency IBS ', 'Jumlah total item obat dan BMHP sesuai daftar inventaris di troley emergency IBS', 'Retrospektif', '100%', '100', 'Bulanan', 'Ka Instalasi Farmasi', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(38, '012.02', 14, 'Manajemen', 'Kepatuhan Penggunaan Formularium Nasional ', 'Kepatuhan Penggunaan Formularium Nasional adalah kepatuhan para dokter dalam meresepkan obat kepada pasien BPJS sesuai dengan daftar obat Formularium Nasional Disebut patuh bila seluruh obat dalam resep mengikuti Formularium Nasional ', 'Jumlah item resep yang sesuai dengan Formularium Nasional', 'Jumlah keseluruhan item resep ', 'Retrospektif', '80%', '80', 'Bulanan', 'Ka Instalasi Farmasi', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
