(72, '025.02', 27, 'Manajemen', 'Ketidaklengkapan dokumen pendukung penagihan', 'Dokumen pendukung penagihan adalah dokumen yang harus disertakan didalam proses penagihan pada pihak asuransi / perusahaan sesuai dengan permintaan yang tercantum didalam surat perjanjian kerjasama', '-', '-', 'Keseluruhan data', '1%', '1', 'Bulanan', 'Ka Mutu Unit Bagian Keuangan', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(73, '025.03', 27, 'Manajemen', 'Ketepatan waktu penyusunan laporan keuangan', 'Laporan Keuangan meliputi Laporan realisasi anggaran, realiasi pendapatan, laporan piutang, arus kas, laporan persediaan, Laporan harus diselesaikan sebelum tanggal 10 setiap bulan berikutnya ', 'Jumlah Laporan Keuangan yang diselesaikan sebelum tanggal 10 setiap bulan berikutnya dalam 3 bulan  ', 'Jumlah laporan keuangan yang harus diselesaikan dalam 3 bulan', 'Keseluruhan data', '100%', '100', 'Bulanan', 'Ka Mutu Unit Bagian Keuangan', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(74, '026.01', 28, 'Manajemen', 'Kepuasan pasien dan kelurga ', '-	Kepuasan adalah pernyataan tentang persepsi pelanggan terhadap jasa pelayana kesehatan yang diberikan oleh rumah sakit -	Kepuasan pelanggan dapat dicapai apabila pelayanan yang diberikan sesuai atau melampaui harapan pelanggan. Dalam hal ini dapat diketahui dengan melakukan survey kepuasan pelanggan untuk mengetahui tingkat kepuasan pelanggan dengan mengacu pada pelanggan berdasarkan Indeks Kepuasan Masyarakat (IKM) -	Pemantauan dan pengukuran kepuasan pasien dan keluarga adalah kegiatan untuk mengukur tingkatan kesenjangan pelayanan rumah sakit yang diberikan dengan harapan pasien dan keluarga di rawat jalan, rawat inap dan gawat darurat -	Kepuasan pasien dan keluarga diukur dengan mendapatkan gambaran persepsi pasien dan keluarga pada saat mendapatkan pengalaman selama melayani di rumah sakit melalui metode kuesioner atau interview dengan konfersi tentang angka â€œTidak Puasâ€ sampai â€œPuasâ€ -> 1-5 -	Jumlah responden berdasarkan sampling rawat jalan, rawat inap dan gawat darurat -	Pelayanan yang diukur berdasarkan persepsi dan pengalaman pasien terhadap : Fasilitas : sarana, prasarana dan alat SDM : perawat, dokter dan petugas lain -	Farmasi : kecepatan, sikap petugas, penjelasan penggunaan obat -	Service -> pendaftaran, ruang tunggu dan pelayanan : Kecepatan, kemudahan dan kenyamanan -	Pengambilan Kuesioner -> sesuai kebijakan rumah sakit minimal satu kali persemester dan dilaksanakan oleh internal / eksternal rumah sakit -	Pengukuran IKM dilaksanakan dilokasi layanan sesuai dengan metode dan layanan ketentuan sebagaimana diatur dalam pedoman umum penyusunan indeks kepuasan masyarakat unit layanan instalasi pemerintah', 'Jumlah kumulatif hasil penilaian kepuasan dari pasien yang disurvei (dalam prosen)', 'Jumlah total pasien yang disurvei (minimal 50)', 'Concurent', '80%', '80', 'Bulanan', 'Ka Bagian Hukmas', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(75, '026.02', 28, 'Manajemen', 'Kecepatan respon terhadap komplain ', 'Kecepatan respon terhadap komplain adalah kecepatan Rumah sakit dalam menanggapi komplain baik tertulis, lisan atau melalui mass media yang sudah diidentifikasi tingkat risiko dan dampak risiko dengan penetapan grading/ dampak risiko berupa ekstrim (merah), Tinggi (kuning), Rendah (hijau), dan dibuktikan dengan data, dan tindak lanjut atas respon time komplain tersebut sesuai dengan kategorisasi/grading/dampak risiko. Warna Merah: cenderung    berhubungan    dengan    polisi,    pengadilan,    kematian, mengancam    sistem/kelangsungan    organisasi,    poptensi    kerugian material dll. Warna Kuning: cenderung berhubungan dengan pemberitaan media, potensi kerugian in material, dll. Warna Hijau: tidak menimbulkan kerugian berarti baik material maupun immaterial. Kriteria Penilaian : 1. Melihat data rekapitulasi komplain yang dikategorikan merah, kuning, hijau 2. Melihat data tindak lanjut komplain setiap kategori yan dilakukan dalam kurun waktu sesuai standar 3. Membuat persentase jumlah komplain yang ditindaklanjuti terhadap seluruh komplain disetiap kategori a. Komplain kategori merah (KKM) ditanggapi dan ditindaklanjuti maksimal 1x24 jam Komplain kategori kuning (KKK) ditanggapi dan ditindaklanjuti maksimal 3 hari c. Komplain kategori hijau (KKH) ditanggapi dan ditindaklanjuti maksimal 7 hari', 'Jumlah KKM, KKK dan KKH yang sudah ditanggapi dan ditindaklanjuti', 'Jumlah seluruh KKM, KKK dan KKH', 'Hasil kompilasi komplain yang diterima berupa lisan, tertulis, dan media massa', '75%', '75', 'Bulanan', 'Ka Bagian Hukmas', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(76, '027.01', 29, 'Manajemen', 'Kelengkapan pengisian inform concent pasien IBS setelah mendapatkan informasi yang jelas', 'Informed consent adalah persetujuan yang diberikan oleh pasien atau keluarganya atas dasar penjelasan mengenai tindakan medik yang akan dilakukan terhadap pasien', 'Jumlah pasien yang mendapat tindakan medis yang disurvei mendapat informasi lengkap sebelum memberikan persetujuan tindakan medis dalam satu bulan', 'Jumlah pasien yang mendapat tindakan medis yang disurvei dalam satu bulan', 'Concurent', '100%', '100', 'Bulanan', 'Ka Bagian Sim & RM', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(77, '027.02', 29, 'Manajemen', 'Kelengkapan pengisian formulir rekam medis laporan operasi (RM RI 23.18)', 'Formulir rekam medis Laporan operasi RM RI 23.18 adalah formulir yang diisi dan ditandatangani oleh Dokter yang melakukan operasi  yang berisi informasi Nama ahli bedah, nama asisten, nama perawat, nama ahli anestesi, jenis anestesi, Diagnosis pre-operatif, Diagnosis post-operatif, macam pembedahan, jenis operasi, tanggal jam operasi dan selesai operasi, lama operasi serta laporan operasi', 'Jumlah pasien yang dilakukan tindakan operasi yang pengisian laporan operasinya lengkap disurvei dalam satu bulan', 'Jumlah pasien yang dilakukan tindakan operasi yang disurvei dalam satu bulan', 'Concurent', '100%', '100', 'Bulanan', 'Ka Bagian Sim & RM', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(78, '027.03', 29, 'Manajemen', 'Kelengkapan pengisian formulir rekam medis laporan anestesi (RM RI 23.11)', 'Formulir rekammedis Laporan anestesi (RM RI 23.11) adalah formulir yang diisi dan ditandatangani oleh Dokter yang melakukan anestesi  yang berisi informasi jam mulai anestesi , tanda tanda vital , premedikasi, induksi, teknikanestesi, komplikasiakut, penanganan, catatan untuk ruangan, diperiksa oleh Nama dan tandatangan Dokter anestesi serta perawat anestesi', 'Jumlah pasien yang mendapat tindakan anestesi dalam satu bulan', 'Jumlah pasien yang mendapat tindakan anestesi yang disurvei dalam satu bulan', 'Concurent', '100%', '100', 'Bulanan', 'Ka Bagian Sim & RM', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(79, '028.01', 30, 'Manajemen', 'Ketepatan Waktu Pengusulan Kenaikan Pangkat', 'Ketepatan waktu pelayanan pengusulan kenaikan pangkat yaitu proses pengusulan kenaikan pangkat yang dipengaruhi baik itu kelengkapan berkas kenaikan pangkat,  dan waktu pengusulannya', 'Jumlah realisasi pengusulan kenaikan pangkat pegawai dalam satu tahun', 'Jumlah pengusulan kenaikan pangkat pegawai dalam satu tahun', 'Retrospektif', '100%', '100', 'Bulanan', 'Ka Bagian Kepegawaian', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(80, '028.02', 30, 'Manajemen', 'Ketepatan waktu pengusulan kenaikan gaji berkala', 'Ketepatan waktu pelayanan pengusulan kenaikan pangkat yaitu proses pengusulan kenaikan gaji berkala yang dipengaruhi baik itu kelengkapan berkas kenaikan pangkat,  dan waktu pengusulannya', 'Jumlah realisasi pengusulan kenaikan gaji berkala pegawai dalam satu bulan', 'Jumlah pengusulan kenaikan gaji berkala pegawai dalam satu bulan', 'Retrospektif', '100%', '100', 'Bulanan', 'Ka Bagian Kepegawaian', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(81, '029.01', 12, 'Manajemen', 'Keterlambatan pelayanan ambulan di    rumah sakit', 'Keterlambatan pelayanan ambulan adalah waktu yang tidak diharapkan mulai permintaan ambulan / kereta jenazah di ajukan oleh pasien atau keluarga pasien dirumah sakit sampai tersedianya ambulan / kereta jenazah. Maximal 15 menit', 'Jumlah penyediaan ambulan / kereta jenazah waktu yang tidak diharapkan ( > 15 menit) dalam 1 bulan', 'Jumlah seluruh permintaan ambulan / kereta jenazah dalam 1 bulan', 'Concurent', '0%', '0', 'Bulanan', 'Ka Bagian Umum', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(82, '029.02', 12, 'Manajemen', 'Satuan pengaman (SATPAM) melakukan pengawasan keliling rumah sakit', 'Kegiatan satuan pengamanan (SATPAM) mengelilingi fasilitas rumah sakit setiap dua jam dalam rangka kewaspadaan terhadap kondisi keamanan rumah sakit', 'Jumlah hari yang disampling yang memenuhi kriteria definisi operasional', 'Jumlah hari yang disampling yang (minimal 10 hari) ', 'Data dikumpulkan dari buku kegiatan patroli keliling SATPAM harian', '<70%', '70', 'Bulanan', 'Ka Bagian Umum', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(83, '030.01', 31, 'Manajemen', 'Tingkat Kepatuhan Kebersihan Tangan', 'Kebersihan tangan (hand hygiene) adalah segala usaha yang dilakukan untuk membersihkan kotoran yang secara kasat mata terlihat dan pengangkatan mikroorganisme yang tinggal sementara di tangan dengan menggunakan sabun dan air mengalir (hand wash) atau dengan cairan berbasis alkohol (handrub) dalam 6 langkah (WHO,2009) Audit kebersihan tangan adalah prosedur penilaian kepatuhan petugas melakukan kebersihan tangan sesuai 5 indikasi dari WHO yaitu sebelum kontak dengan pasien, setelah kontak dengan pasien, sebelum melakukan tindakan invasif dan aseptik, setelah kontak dengan cairan tubuh, dan setelah  kontak dengan lingkungan dengan menjalankan 6 tahap teknik melakukan kebersihan tangan.  Lima indikasi kebersihan tangan:  1.	Sebelum kontak dengan pasien 2.	Sebelum melakukan tindakan aseptik 3.	Setelah kontak dengan cairan tubuh pasien 4.	Setelah kontak dengan pasien 5.	Setelah kontak dengan lingkungan pasien  Enam langkah teknik melakukan kebersihan tangan sesuai WHO 1.	Ratakan dan gosokkan sabun dengan kedua telapak tangan 2.	Gosok punggung dan sela-sela jari tangan kiri dengan tangan kanan dan sebaliknya 3.	Gosok kedua telapak dan sela-sela jari 4.	Jari-jari sisi dalam dari kedua tangan saling mengunci 5.	Gosok ibu jari kiri berputar dalam genggaman tangan kanan dan lakukan sebaliknya 6.	Gosokkan dengan memutar ujung jariâ€“jari tangan kanan di telapak tangan kiri dan sebaliknya, telapak tangan kiri dan sebaliknya   Petugas yang dinilai mencakup SEMUA PETUGAS yang bertugas di ruangan (dokter, perawat, peserta didik, pekarya, cleaning service) ', 'Jumlah petugas yang patuh melakukan kebersihan tangan', 'Jumlah petugas yang patuh dan yang tidak patuh melakukan kebersihan tangan', 'Monitoring/audit masing-masing area', '100%', '100', 'Bulanan', 'Ka Komite PPI', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(84, '030.02', 31, 'Klinis', 'Infeksi Daerah Operasi (IDO)', 'Infeksi Daerah Operasi adalah Infeksi yang terjadi pada  daerah insisi daerah operasi dalam waktu 30 hari tanpa implan dan satu tahun dengan implan pasca bedah.  Kriteria : A.	Pus keluar dari luka operasi atau drain yang dipasang diatas fascia B.	Biakan positif dari cairan  yang keluar dari luka atau jaringan yang diambil secara aseptik C.	Sengaja dibuka oleh dokter karena terdapat tanda peradangan kecuali hasil biakan negatif (paling sedikit terdapat satu dari tanda â€“ tanda infeksi berikut ini : nyeri, bengkak lokal, kemerahan, dan hangat lokal) D.	Dokter yang menangani menyatakan terjadi infeksi', 'Jumlah kasus Infeksi Daerah Operasi (IDO)', 'Jumlah kasus operasi', 'Monitoring/audit masing-masing area', '2%', '2', 'Bulanan', 'Ka Komite PPI', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(85, '030.03', 31, 'Klinis', 'Plebitis', 'Phlebitis merupakan inflamasi pada vena, yang ditandai dengan adanya daerah yang merah, nyeri dan pembengkakan di daerah penusukan atau sepanjang vena (Brunner dan Sudarth, 2002)', 'Jumlah kasus Phlebitis', 'Seluruh pasien yang terpasang kateter intravena', 'Monitoring/audit masing-masing area', '5%', '5', 'Bulanan', 'Ka Komite PPI', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(86, '030.04', 31, 'Klinis', 'Infeksi Aliran Darah Primer  (IADP)', 'Keadaan infeksi yang terjadi akibat masuknya mikroba melalui peralatan yang dimasukkan langsung ke sistem pembuluh darah melalui insersi intravena kateter, baik berupa kateter vena maupun arteri dalam rangka perawatan maupun diagnostik (CVC / Central Venous Catheter, vena perifer / infus, double lumen untuk hemodialisa) infeksi timbul minimal 3 kali 24 jam  (72 jam) setelah pemasangan', 'Jumlah kasus infeksi aliran darah primer karena pemasangan intravaskular kateter', 'Jumlah hari pemasangan intra vena central line', 'Monitoring/audit masing-masing area', '5%', '5', 'Bulanan', 'Ka Komite PPI', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', '');
INSERT INTO `indikator` (`id`, `kode`, `id_unit`, `area`, `judul_indikator`, `definisi_operasional`, `numerator`, `denumerator`, `cara_pengumpulan`, `target`, `target_grafik`, `frekuensi_pengumpulan_data`, `penanggung_jawab`, `created_at`, `updated_at`, `keterangan`, `validasi`, `status`, `analisa`) VALUES
(87, '030.06', 31, 'Klinis', 'Ventilator Associated Pneumonia (VAP)', 'Ventilator Associated Pneumonia (VAP) adalah infeksi saluran napas bawah yang mengenai parenkim paru setelah pemakaian ventilasi mekanik > 48 jam, dan sebelumnya tidak ditemukan tanda-tanda infeksi saluran napas. Kriteria : Ditemukan minimal dari tanda dan gejala klinis : -	Demam (â‰¥38â°C) tanpa ditemui penyebab lainnya. -	Leukopenia (< 4.000 WBC/mm3) atau Leukositosis (â‰¥12.000SDP/mm3). -	Untuk penderita berumur â‰¥ 70 tahun, adanya perubahan status mental yang tidak ditemui penyebab lainnya. Minimal disertai 2 dari tanda berikut : -	Timbulnya onset baru sputum purulen atau perubahan sifat sputum. -	Munculnya tanda atau terjadinya batuk yang memburuk atau dyspnea (sesak napas) atau tachypnea. -	Ronki basah atau suara napas bronchial. -	Memburuknya pertukaran gas, misalnya desaturasi O2 (PaO2/FiO2 â‰¤240), peningkatan kebutuhan oksigen, atau perlunya peningkatan ventilator.	 Dasar diagnosis : Adanya bukti secara radiologis adalah jika ditemukan > 2 foto serial : Infiltrat baru atau progresif yang menetap ; Konsolidasi ; Kavitasi ; Pneumatoceles pada bayi berumur < 1 tahun', 'Jumlah kasus infeksi Ventilator Associated Pneumonia (VAP)', 'Jumlah lama hari pemakaian ETT atau terpasang Ventilator', 'Monitoring/audit masing-masing area', '5%', '5', 'Bulanan', 'Ka Komite PPI', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(88, '030.07', 31, 'Klinis', 'Dekubitus', 'Kejadian dekubitus adalah terjadinya pasien yang mengalami dekubitus selama dalam perawatan di rawat inap RS. Dekubitus adalah luka pada jaringan kulit yang disebabkan oleh tekanan yang berlangsung lama dan terus menerus (Doh, 1993 dalam Martin, 1997) Kriteria : A.	Pasien paling tidak mempunyai 2 gejala dan tanda berikut, yang tidak diketahui penyebab lainnya : kemerahan sakit atau pembengkakan ditepian luka dekubitus B.	Minimal ditemukan 1 dari bukti berikut : Hasil kultur positif dari cairan atau jaringan yang diambil secara benar -	Hasil kultur darah positif -	Dokter yang merawat menyatakan adanya dekubitus dan diberi pengobatan antimikroba.', 'Jumlah kejadian dekubitus', 'Jumlah hari tirah baring', 'Monitoring/audit masing-masing area', '1,5%', '1,5', 'Bulanan', 'Ka Komite PPI', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(89, '030.08', 31, 'Klinis', 'Angka kejadian TB RO dengan pengobatan OAT', 'Pasien TB dengan pengobatan OAT yang mengalami TB RO', 'Jumlah pasien TB RO', 'Jumlah pasien TB yang berobat rutin di RSU RAA Soewondo Pati', 'Monitoring/audit masing-masing area', '20%', '20', 'Bulanan', 'Ka Komite PPI', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(90, '031.01', 32, 'Klinis', 'Kepatuhan Identifikasi Pasien', 'Identifikasi pasien adalah proses pengecekan identitas pasien menggunakan minimal 2 identitas dari 3 identitas yang tercantum, pada gelang, label atau bentuk identitas lainnya sebelum memberikan pelayanan seseuai dengan regulasi yang berlaku di rumah sakit.  Disebut patuh bila proses identifikasi pasien dilakukan secara benar oleh petugas pada saat, antara lain : 1.	Pemberian obat 2.	Pemberian pengobatan termasuk nutrisi 3.	Pemberian darah dan produk darah 4.	Pengambilan specimen 5.	Sebelum melakukan tindakan diagnostic/therapeutic Pengukuran dilakukan terpisah untuk masing â€“ masing proses tersebut diatas dan menghasilkan lima sub indikator yaitu : 1.	Kepatuhan pengecekan identitas pasien sebelum pemberian obat 2.	Kepatuhan pengecekan identitas pasien sebelum pemberian pengobatan termasuk nutrisi 3.	Kepatuhan pengecekan identitas pasien sebelum pemberian darah dan produk darah 4.	Kepatuhan pengecekan identitas pasien sebelum pengambilan specimen 5.	Kepatuhan pengecekan identitas pasien sebelum melakukan tindakan diagnostic/therapeutic  ( contoh : pungsi lumbal, endoscopy, dsb ) dan terapi (operasi, debridement dll)', 'Jumlah proses yang telah dilakukan identifikasi dengan benar', 'Jumlah proses pelayanan yang diobservasi', 'Concurent', '100%', '100', 'Bulanan', 'Kepala Ruang', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(91, '031.02', 32, 'Klinis', 'Kepatuhan Petugas untuk Melakukan Hand Over dengan SBAR', 'Hand over adalah proses serah terima pasien oleh tenaga keperawatan (perawat/bidan) antar shift (Pagi, Siang dan Malam)', 'Jumlah pasien yang dilakukan hand over dengan SBAR', 'Jumlah pasien yang dilakukan hand over', 'Concurent', '100%', '100', 'Bulanan', 'Kepala Ruang', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(92, '031.03', 32, 'Klinis', 'Kepatuhan Petugas dalam Melakukan doubel cek terhadap pemberian obat High Alert Medication', 'Doubel cek adalah cek kebenaran obat oleh 2 petugas. High Alert Medication adalah Obat yang      sering menyebabkan kesalahan/kesalahan serius(sentinel event), obat yang berisiko tinggi menyebabkan dampak yang tidak diinginkan (adverse outcome) seperti obat-obat yang terlihat mirip dan kedengarannya mirip (Look Alike Sound Alike / LASA ), elektrolit pekat, obat dengan rentang dosis pendek.', 'Jumlah pasien yang dilakukan doubel cek saat pemberian obat HAM', 'Jumlah pasien yang diberikan obat HAM', 'Concurent', '100%', '100', 'Bulanan', 'Kepala Ruang', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(93, '031.04', 32, 'Klinis', 'Kepatuhan Petugas dalam Melakukan Surgical Safety terhadap Pasien Operasi di IBS', 'Surgical Safety adalah Ceklist pembedahan pasien yang meliputi : Sign In,  Time Out, dan Sign Out', 'Jumlah pasien operasi yang dilakukan surgical safety ceklist dengan benar', 'Jumlah pasien operasi', 'Retrospektif', '100%', '100', 'Bulanan', 'Kepala Ruang', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(94, '031.05', 32, 'Klinis', 'Kepatuhan petugas dalam melakukan penandaan (Marking) dalam proses pembedahan', 'Penandaan (Marking) yang dilakukan operator pada tubuh pasien yang akan dilakukan operasi untuk mencegah terjadinya kesalahan bagian tubuh yang akan operasi. Pemberian marker site dilakukan dengan membuat tanda V pada atau dekat lokasi sayatan memakai spidol permanen oleh operator, dilakukan pada semua kasus operasi kecuali pada mukosa, bayi prematur, dan kasus luka bakar.', 'Jumlah pembedahan yang dilakukan penandaan ', 'Jumlah seluruh pembedahan yang harus dilakukan penandaan', 'Retrospektif', '100%', '100', 'Bulanan', 'Kepala Ruang', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(95, '031.06', 32, 'Klinis', 'Kepatuhan Upaya Pencegahan Risiko Cedera Akibat Pasien Jatuh pada Pasien Rawat Inap', 'Upaya pencegahan jatuh meliputi : 1.	Screening di rawat jalan/IGD 2.	Asesmen awal risiko jatuh Asesmen awal risiko jatuh adalah asesmen yang dilakukan pada saat awal pasien masuk di rawat inap 3.	Asesmen ulang risiko jatuh Asesmen ulang risiko jatuh adalah asesmen yang dilakukan pada saat :  a.	Pasien pindah ke unit lain. b.	Setiap ada perubahan kondisi pasien. c.	Setelah jatuh. d.	Pasien post operasi. e.	Untuk pasien risiko jatuh tinggi jatuh tiap 1 x 24 jam. f.	Untuk pasien risiko jatuh sedang atau rendah tiap 2 x 24 jam. 4.	Edukasi pencegahan pasien jatuh. Edukasi pencegahan pasien jatuh adalah edukasi yang diberikan kepada pasien dan keluarga tentang langkah-langkah pencegahan pasien jatuh.  Disebut patuh apabila melaksanakan seluruh upaya pencegahan jatuh pada pasien yang berisiko sesuai dengan standar yang ditetapkan oleh RS. Catatan :  1.	Asesmen awal hanya dilakukan pada pasien rawat inap. 2.	Untuk pasien rawat jalan dan IGD hanya dilakukan screening', 'Jumlah pasien yang mendapatkan ketiga upaya pencegahan pasien jatuh', 'Jumlah semua pasien yang berisiko jatuh', 'Retrospektif', '100%', '100', 'Bulanan', 'Kepala Ruang', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
