(103, '030.05', 31, 'Klinis', 'Infeksi Saluran Kemih', 'Infeksi Saluran Kencing (ISK) adalah Infeksi yang terjadi sebagai akibat dari pemasangan kateter > 48 jam Kriteria : A.	Gejala dan Tanda : Umum : demam, urgensi, frekuensi, disuria, nyeri suprapubik Usia < 1 tahun : demam, hipotermi, apneu, bradikardi, letargia, muntah-muntah B.	 Nitrit dan/atau leukosit esterase positip dengan carik celup (dipstick) C.	Pyuria > 10 leukosit/LPB sedimen urin atau >10 leukosit/mL atau >3 leukosit/LPB dari urine tanpa dilakukan sentrifus D.	Terdapat koloni mikroorganisme pada hasil pemeriksaan urine kultur E.	 Diagnosis dokter yang merawat menyatakan adanya ISK F.	Terapi dokter sesuai ISK', 'Jumlah kasus Infeksi Saluran Kemih (ISK)', 'Jumlah lama hari pemakaian kateter urin menetap', 'Monitoring/audit masing-masing area', 'â‰¤ 4.7 â€°', '4,7', 'Harian', 'Ka Komite PPI', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
