(122, '001.02.01', 37, 'Klinis', 'Terukurnya Status Gizi Pasien di poliklinik Anak', 'Status gizi anak adalah salah satu tolak ukur penilaian tercukupinya kebutuhan gizi harian,serta penggunaan zat gizi tersebut oleh tubuh.Jika asupan nutrisi anak terpenuhi maka tumbuh kembangnya akan optimal', 'Jumlah seluruh pasien anak yang terukur status gizinya di poliklinik anak', 'Jumlah seluruh pasien poliklinik Anak yang disurvey', 'Retrospektif', '100%', '100', 'Bulanan', 'Ka. tim mutu poliklinik Anak', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
