(127, '001.07.01', 42, 'Klinis', 'Kehilangan dokumen rekam medis pasien di unit rawat jalan dalam', 'Rekam medis adalah  catatan identitas pasien, anamnesa, pengobatan, tindakan medis, serta pelayanan lainnya yang diberikan selama di RS. Rekam medis yang hilang  adalah berkas rekam medis yang tidak ditemukan pada saat sedang diperlukan, berkas rekam medis ini bisa terselip,di tempat lain, dipinjam untuk keperluan lain atau terbawa pasien.', 'berkas rekam medis rawat jalan yang tidak ditemukan pada saat sedang diperlukan,', 'Semua berkas rekam medis di rawat jalan', 'Retrospektif', '0%', '0', 'Bulanan', 'Kepala ruang rawat jalan', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
