(133, '001.13.01', 48, 'Klinis', 'Waktu tunggu di Poliklinik  Jantung ', 'Waktu tunggu adalah waktu yang diperlukan mulai pasien kontak dengan petugas pendaftaran sampai dilayani oleh dokter atau dokter spesialis. Catatan:  Yang dimaksud kontak dengan petugas pendaftaran adalah waktu petugas mencatat identitas pasien. Yang dimaksud dilayani oleh dokter atau dokter spesialis adalah waktu pasien kontak awal dengan dokter atau dokter spesialis. Target : kurang dari 120 menit', 'Jumlah komulatif waktu tunggu pasien poliklinik jantung yang disurvey', 'Jumlah seluruh pasien poliklinik jantung yang disurvey', 'Retrospektif', '100%', '100', 'Bulanan', 'Ka. tim mutu Poliklinik  Jantung', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
