(158, '002.17.01', 71, 'Klinis', 'Tidak dilakukannya penandaan lokasi operasi', 'Tidak dilakukannya penandaaan lokasi operasi oleh operator . Target 0 %', 'Jumlah kejadian tidak dilakukannya penandaan lokasi operasi pada semua kasus operasi yang harus dilakukan penandaan lokasi operasi per bulan.', 'Jumlah semua kasus operasi yang harus dilakukan penandaan operasi dalam bulan tersebut.', 'Retrospektif', '0%', '0', 'Bulanan', 'Kepala Ruang Edelways', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
