(160, '002.20.01', 74, 'Klinis', 'Kepatuhan DPJP dalam pelaksanaan CP Diare Akut Dehidrasi Sedang ( DADS )', 'Kepatuhan terhadap clinical pathway Diare Akut Dehidrasi Sedang (DADS) adalah kepatuhan para staf medis/DPJP dalam menggunakan clinical pathway Diare Akut Dehidrasi Sedang (DADS) untuk memberikan asuhan klinis pasien secara terstandarisasi dan terintegrasi sehingga dapat meminimalkan adanya variasi proses asuhan klinis. Target 100%', 'Jumlah pasien Diare Akut dehidrasi Sedang (DADS) yang sesuai dengan CP Diare Akut Dehidrasi Sedang (DADS) ', 'Jumlah semua pasien Diare Akut Dehidrasi Sedang (DADS) yang dirawat', 'Retrospektif', '100%', '100', 'Bulanan', 'Ketua tim mutu R. Cempaka', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', ''),
(161, '002.20.02', 74, 'Klinis', 'Persentase capaian pemberian  bronkodilator pada pasien anak dengan bronchopneumonia', 'Persentase capaian pemberian  bronkodilator pada pasien anak dengan bronchopneumonia yang dimaksud adalah banyaknya pasien anak  dengan bronchopneumonia yang mendapatkan terapi bronkodilator dari seluruh pasien anak dengan bronchopneumonia yang dirawat  Target 100%', 'Jumlah pasien anak dengan bronchopneumonia yang mendapat terapi bronkodilator ', 'Jumlah semua pasien anak dengan bronchopneumonia yang dirawat', 'Retrospektif', '100%', '100', 'Bulanan', 'Ketua tim mutu ruang cempaka', '2020-01-07 03:10:51', '2020-01-07 03:10:51', NULL, '', '1', '');
