(6, 7, 22, NULL, 'Menekan kejadian SC pada nullipara hamil aterm janin tunggal letak vertex / belakang kepala ', '1. Melakukan pengawasan semua pasien nullipara waktu proses inpartu lebih intens agar terkaji benar yang beresiko untuk dilakukan SC. 2. Kolaborasi tim medis untuk syarat pemberian induksi dan stimulasi pasien nullipara untuk meminimalkan kegagalan induksi / stimulasi. 3. Ada SPM / SPO induksi dan stimulasi agar semua petugas paham kegagalan induksi / stimulasi. 4. Edukasi awal pada semua pasien nullipara yang akan menghadapi proses persalinan tentang proses - proses persalinan dan perubahan / rasa sakit inpartu sampai tahu tingkat pemahaman pasien. 5 Penerapan sistem BPJS untuk indikasi SC ( tidak ada indikasi permintaan sendiri ) bisa terklaim BPJS.', '1. Petugas dalam memantai pasien nullipara inpartu belum mengacu partograf. 2. Belum patuh SPO kriteria gagal induksi dan stimulasi. 3. Indikasi Sc tidak tegas sesuai acuan BPJS. ', '1. Tingkatkan kwalitas skill bidan dalam pemantauan inpartu dengan menggunakan partograf dan penilaian bishop schore. 2. Ada SPO / SPM tentang induksi dan stimulasi. 3. Ada pembahasan kasus dam evaluasi secara periodik diprogramkan di unit obsgyn untuk menurunkan kejadian kasus ini. 4. Pengisian dokumen / les pasien yang lengkap dan terbukti terutama di RM edukasi dan CPPT.  ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(7, 7, 23, NULL, 'Waktu distribusi hasil pemeriksaan laborat Kamar Bersalin tertib ( pada waktu operan jaga hasil laborat sudah ada ).', '1. Ada SPO dari pelayanan tentang pemeriksaan laborat dan pemberitahuan / pengambilan hasil laborat terutama pasien Obsgyn. 2. Semua petugas jaga patuh SPO sehingga pada waktu operan jaga hasil laborat sudah ada. 3. Ada data pasien yang pengiriman sampel laborat 7 - 10 jam hasil belum jadi atau belum ada. 4. Belum semua petugas Kamar Bersalin mengetahui indikator mutu ini.', '1. Petugas jaga kurang paham fungsi hasil laborat dalam menegakkan diagnosa, fokusnya diagnosa kebidanan cuma hasil pemeriksaan kebidanan. 2. Petugas IKB dan petugas laborat belum patuh SPO.', '1. Terealisasinya SPO dari pelayanan. 2. Meningkatkan kinerja / kerja sama antara petugas IKB dan petugas laborat. 3. Meningkatkan kwalitas bidan untuk membuat diagnosa kebidanan / assesment kebidanan sudah ada data penunjang. 4. Sosialisasi dari PIC ruangan kepada semua anggota Kamar Bersalin. ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(8, 7, 24, NULL, 'Bayi lahir di IKB dengan penyulit diindikasikan IMD sebelum dirawat di Perinatal Level 1 petugas IKB bisa melakukan IMD sampai berhasil yaitu bayi bisa aktif menghisap puting susu ibu atau dengan lama waktu  kurang lebih 2 jam.', '1. Semua petugas ruang IKB paham dengan program mutu unit ini sehingga mau melakukan program ini sesuai prosedur. 2. Ada panduan / SPO indikasi ibu dan bayi IMD yang tegas sehingga petugas patuh. 3 Ada program dari RS di RSSIB klien / petugas mendukung keberhasilan IMD dan evaluasinya sering ada kejadian bayi sudah indikasi rawat gabung / IMD masuk rawat level 1, 2 dan NICU.  ', '1. Tim mutu unit ruang IKB melakukan sosialisasi program ini diruangan. 2. Tim mutu unit ruang IKB koordinasi dengan pokja MDGs PN 1 untuk dimunculkan panduan / SPO tentang IMD dan panduan di RSSIB.', '1. Program edukasi perorangan dan kelompok di ruang IKB untuk IMD selalu diangkat / diberikan. 2. Ada data atau buku catatan tentang masalah - masalah atau keberhasilan IMD di ruang IKB. 3. Semua petugas melakukan IMD sesuai SPO.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
