(10, 21, 57, NULL, 'Input data pelaporan kerusakan AC pendingin ruangan hampir setiap hari ,Dengan berkurangnya kerusakan AC pendingin ruangan akan mengurangi pengeluaran biaya operasional ,Dengan berfungsinya AC pendingin ruangan akan menambah kenyamanan pasien dan petugas.', 'Unit sudah mengumpulkan dan melaporkan data rekapitulasi indikator mutu utama Kerusakan pendingin AC ruangan mulai bulan oktober sapai dengan bulan desember 2018,unit sudah melakukan perawatan rutin dan melakukan perbaikan juga membuat SOP cara menggunakan Ac pendingin ruangan.', 'Angka perbaikan AC pendingin ruangan pada bulan oktober-desember 2018 masih dibawah standart indikator yang ditetapkan dimana pada bulan okt 0,06%,bulan Nov 0,36%,bulan Des  0,15%', 'Melakukan pemeliharaan AC sesuai jadwal yang sudah ditentukan,Membuat rekomendasi ke ruangan terkait agar tidak menyalakan AC pendingin saat ruangan kosong,Mengajukan usulan pembelian AC yang berkwalitas .', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(11, 21, 102, NULL, 'Input data pelaporan kerusakan bangunan gedung sesuai dengan laporan ruangan', 'Unit sudah mengumpulkan dan melaporkan data rekapitulasi indikator utama Penanganan pemeliharaan sarana bangunan gedung di ruangan selama 3 bulan mulai dari bulan Okt-bulan Des 2018,Melakukan perbaikan  sesuai laporan dari ruangan dan melakukan penggantian sarana yang dibutuhkan,melakukan pengecatan rutin.', 'Penanganan pemeliharaan sarana bangunan gedung di ruangan semakin meningkat karena faktor usia bangunan semakin bertambah dan kwalitas barang pengganti semakin menurun serta kurang tahunya cara penggunaan sarana bangunan gedung yang ada', 'Melakukan pemeliharaan secara rutin ,Mengusulkan pengadaan sarana pengganti yang berkwalitas.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
