(13, 21, 58, NULL, 'Input data pelaporan kerusakan lampu penerangan sesuai dengan laporan dari ruangan', 'Unit sudah mengumpulkan dan melaporkan data rekapitulasi indikator utama kesiapan penerangan bila lampu penerangan mati mulai bln Okt-Des 2018,Melakukan penggantian lampu sesuai dengan laporan dari ruangan.', 'Penggantian lampu penerangan ruangan semakin menurun karena sebagian lampu TL sudah diganti dengan lampu jenis LED', 'Merencanakan dan mengusulkan penggantian lampu yang memakai trafo dengan lampu LED juga menghimbau kepada semua ruangan agar mematikan lampu bila tidak dibutuhkan.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(14, 10, 33, NULL, '1. Memutuskan tim mutu untuk melakukan evaluasi terhadap capaian pelayanan pemeriksaan radiologi nilai kritis.2.	Mengupayakan capaian waktu keterlambatan ekspertise dokter spesialis radiologi terhadap pemeriksaan nilai kritis mencapai 0 %. 3.	Meningkatkan kualitas petugas dengan mengirimkan ke pelatihan, diklat maupun seminar secara berkala dan berkelanjutan. 4.	Kalibrasi secara berkala untuk semua peralatan x-ray. 5.	Menambah  pesawat x-ray baru, sehingga faktor kerusakan yang disebabkan oleh umur pesawat x-ray dapat dieliminir. 6.	Meningkatkan komunikasi yang efektif kepada pasien sebelum pemeriksaan. 7.	Meningkatkan komunikasi yang efektif kepada dokter spesialis radiologi dengan menggunakan media WA ( WhatsApp ). 8.	Dokter spesialis radiologi standby ditempat.', '', '', '', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(15, 10, 33, NULL, '', '1.	Tim mutu melakukan evaluasi terhadap capaian pelayanan pemeriksaan radiologi pasien nilai kritis. 2.	Melakukan sensus harian dan bulanan waktu ekspertise dokter spesialis radiologi terhadap pelayanan pemeriksaan radiologi pasien nilai kritis. 3.	Mengajukan ke Rumah Sakit agar diprogramkan pelatihan dan seminar untuk meningkatkan kualitas petugas secara bergiliran dan kontinyu. 4.	Melakukan kalibrasi secara berkala  untuk semua pesawat x-ray. 5.	Mengajukan ke Rumah Sakit untuk peremajaan pesawat x-ray dengan menambah pesawat x-ray terbaru sesuai perkembangan iptek. 6.	Membangun komunikasi efektif dengan memberikan pengertian dan penjelasan seperlunya kepada pasien sebelum dilakukan pemeriksaan sehingga pasien memahami proses pemeriksaan yang dilakukan. 7.	Membangun komunikasi efektif antara radiografer dengan dokter spesialis radiologi dalam penanganan pemeriksaan radiologi pasien nilai kritis. 8.	Dibuat jadwal secara periodik dan dikondisikan agar selalu ada dokter radiologi yang standby.', '1.	Tidak meratanya petugas yang dilibatkan dalam dalam pelatihan dan seminar. 2.	Banyaknya kasus pemeriksaan pasien nilai kritis di luar jam dinas. 3.	Karena dokter radiologi masih terbatas di wilayah pati sehingga dokter radiologi masih dibutuhkan di RS lain. 4.	Dokter radiolog kadang terlambat merespon.', '1.	Membangun komunikasi antara radiografer dengan dokter pengirim sehingga dicapai kesepakatan untuk kasus pemeriksaan pasien nilai kritis sehingga tercapai tujuan yang diinginkan oleh dokter pengirim. 2.	Membangun komunikasi dan pendekatan personal dengan dokter spesialis radiologi sehingga ekspertise pasien nilai kritis di luar jam dinas dapat terlaksana. 3.	Mengajukan  tambahan dana seminar dan pelatihan untuk even-even pengembangan sumber daya manusia. 4.	Petugas berkewajiban memberikan edukasi terhadap semua pasien dan pengantar pasien tentang pemeriksaan pasien nilai kritis. 5.	Meningkatkan dan menjaga kualitas radiografer dan dokter  radiolog sehingga dokter radiolog bisa memberikan ekspertise tepat waktu.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(16, 10, 33, NULL, '1. Memutuskan tim mutu untuk melakukan evaluasi terhadap capaian pelayanan pemeriksaan radiologi nilai kritis. 2. Mengupayakan capaian waktu keterlambatan ekspertise dokter spesialis radiologi terhadap pemeriksaan nilai kritis mencapai 0 %. 3.	Meningkatkan kualitas petugas dengan mengirimkan ke pelatihan, diklat maupun seminar secara berkala dan berkelanjutan. 4.Meningkatkan kualitas peralatan x-ray dan accesoriesnya. 5. Meningkatkan komunikasi yang efektif kepada dokter spesialis radiologi dengan menggunakan media WA ( WhatsApp ).', '1. Tim mutu melakukan evaluasi terhadap capaian pelayanan pemeriksaan radiologi pasien nilai kritis. 2. Melakukan sensus harian dan bulanan waktu ekspertise dokter spesialis radiologi terhadap pelayanan pemeriksaan radiologi pasien nilai kritis. 3.	Mengajukan ke Rumah Sakit agar diprogramkan pelatihan dan seminar untuk meningkatkan kualitas petugas secara bergiliran dan kontinyu. 4.	Melakukan kalibrasi secara berkala  untuk semua pesawat x-ray. 5.	Mengajukan ke Rumah Sakit untuk peremajaan pesawat x-ray dengan menambah pesawat x-ray terbaru sesuai perkembangan iptek. 6. Membangun komunikasi efektif antara radiografer dengan dokter spesialis radiologi dalam penanganan pemeriksaan radiologi pasien nilai kritis. 7. Dibuat jadwal secara periodik dan dikondisikan agar selalu ada dokter radiologi yang standby.', '1. Capaian pada bulan Januari sampai Maret 2019 belum semuanya mencapai target. 2. Tidak meratanya petugas yang dilibatkan dalam dalam pelatihan dan seminar. 3. Banyaknya kasus pemeriksaan pasien nilai kritis di luar jam dinas. 4. Karena dokter radiologi masih terbatas di wilayah pati sehingga dokter radiologi masih dibutuhkan di RS lain. 5.	Dokter radiolog kadang terlambat merespon.', '1. Membangun komunikasi antara radiografer dengan dokter pengirim sehingga dicapai kesepakatan untuk kasus pemeriksaan pasien nilai kritis sehingga tercapai tujuan yang diinginkan oleh dokter pengirim. 2. Membangun komunikasi dan pendekatan personal dengan dokter spesialis radiologi sehingga ekspertise pasien nilai kritis di luar jam dinas dapat terlaksana. 3.	Mengajukan  tambahan dana seminar dan pelatihan untuk even-even pengembangan sumber daya manusia. 4. Meningkatkan dan menjaga kualitas radiografer dan dokter  radiolog sehingga dokter radiolog bisa memberikan ekspertise tepat waktu.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
