(18, 25, 67, NULL, 'meminimalisir Tumpahan B3 ke semua unit kerja sebesar 0%', 'sosialisasi tentang pentingnya bahaya Tumpahan B3 terhadap karyawan, pengunjung dan Pasien Rumah Sakit.', 'untuk Triwulan IV periode Oktober-Desember 2018 capaian 0%  karena tidak terjadi Tumpahan Material B3 atau sesuai dengan target yang direncanakan yaitu  0%', 'tetap melakukan monitoring ke semua unit kerja tiap bulan dan membuat laporan bulanan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(19, 10, 34, NULL, '1. Menugaskan tim mutu untuk melakukan evaluasi terhadap capaian pelaksanaan ekspertise hasil pemeriksaan rontgen. 2. Mengupayakan capaian pelaksanaan ekspertise hasil pemeriksaan rontgen 100%. 3. Meningkatkan profesionalitas petugas radiologi dan dokter spesialis radiologi. 4. Mempercepat waktu expertise dokter spesialis radiologi.', '1. Tim mutu melakukan evaluasi terhadap capaian pelaksanaan ekspertise hasil pemeriksaan rontgen. 2. Melakukan sensus harian dan bulanan tentang pelaksanaan ekspertise hasil pemeriksaan rontgen 3. Mengajukan ke Rumah Sakit agar diprogramkan pelatihan dan seminar untuk meningkatkan kualitas dokter spesialis radiologi secara bergiliran dan kontinyu. 4. Dibuat jadwal secara periodik dan dikondisikan agar selalu ada dokter radiologi yang standby.', '1. Pelaksanaan ekspertise oleh Dokter spesialis Radiologi belum memenuhi target. 2. Banyaknya foto rontgen yang di pinjam oleh dokter pengirim sebelum dilakukan ekspertise dokter Radiologi. 3. Adanya pemeriksaan foto rontgen diluar jam kerja sehingga oleh petugas ruangan rawat inap diambil sebelum di ekspertise. 4. Karena dokter radiologi masih terbatas di wilayah pati sehingga dokter radiologi masih dibutuhkan di RS lain.', '1. Membangun komunikasi dengan petugas rawat inap dan dokter pengirim untuk tidak mengambil foto sebelum diexpertise oleh radiolog. 2. Dokter spesialis radiologi datang tepat waktu dan standby di radiologi selama jam kerja.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
