(21, 5, 15, NULL, '', 'Sosialisasi ke unit kerja tentang pentingnya ketepatan emergency respon time di IGD untuk mengurangi tingkat kecacatan maupun kematian serta meningkatkan kepuasan pasien', 'Proses : Sosialisasi ke unit kerja tentang pentingnya ketepatan emergency respon time di IGD RSUD RAA Soewondo Pati,Output : Emergency Respon Time  < 5 mnt', 'Monitoring dan evaluasi terhadap emergency respon time pasien di IGD, evaluasi hasil output', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
