(23, 5, 15, NULL, 'Emergency Respon Time ( waktu tanggap pelayanan gawat darurat < 5 mnt ) capaian 100 %', 'Sosialisasi ke unit kerja tentang pentingnya ketepatan emergency respon time di IGD untuk mengurangi tingkat kecacatan maupun kematian serta meningkatkan kepuasan pasien', 'Proses : Sosialisasi ke unit kerja tentang pentingnya ketepatan emergency respon time di IGD RSUD RAA Soewondo Pati,Output : Emergency Respon Time < 5 mnt', 'Monitoring dan evaluasi terhadap emergency respon time pasien di IGD, evaluasi hasil output', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(24, 5, 15, NULL, ' mengupayakan Emergency Respon Time ( waktu tanggap pelayanan gawat darurat < 5 mnt ) capaian 100 %', 'meningkatkan pemahaman dan ketrampilan petugas IGD dalam melakukan triage ', 'Input : Ketepatan emergency respon time untuk mengurangi tingkat kecacatan maupun kematian serta meningkatkan kepuasan pasien,Proses :  Peningkatan sosialisasi ke unit kerja tentang pentingnya ketepatan emergency respon time di IGD RSUD RAA Soewondo Pati,Output : Emergency Respon Time < 5 mnt rerata pada tri wulan ke 2 capaian indikator 91,11%', 'Monitoring dan evaluasi terhadap emergency respon time pasien di IGD lebih diperketat, sehubungan adanya penurunan angka capaian pada bulan juni, evaluasi hasil output lebih dicermati, mengusulkan adanya penyegaran tentang triage dengan mengadakan IHT ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(25, 3, 11, NULL, 'Mencapai angka penundaan operasi elektif kurang dari 5%', 'a. mengurangi keluhan terhadap proses pembatalan terutama bagi pasien dan keluarga serta tim operasi', '', '', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(26, 3, 11, NULL, 'Mencapai angka penundaan operasi elektif kurang dari 5%', 'mengurangi keluhan terhadap proses pembatalan terutama bagi pasien dan keluarga serta tim operasi, mengurangi angka penundaan operasi elektif', 'Input : angka penundaan operasi elektif kurang dari 5%. Proses : sebelum dipituskan melakukan penundaan pembedahan, DPJP bedah / Operator melakukan reviewnkembali meliputi : kondisi pasien pra bedah, ketersediaan ruang rawat khusus jika diperlukan, ketersediaan peralatan khusus jika diperlukan dan tersedia. Output : Angka penundaan operasi elektif kurang dari 5%.', 'Semua kelengkapan persyaratan administrasi, alat kesehatan dan pasien itu sendiri sudah harus siap sebelum dijadwalkan atau minimum sebelum pasien masuk kamar operasi', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(27, 3, 11, NULL, 'Pada triwulan III tahun 2019 Mencapai angka penundaan operasi elektif kurang dari 5%', 'Mengadakan rapat mengundang operator untuk sosialisasi ulang tentang pendaftaran operasi serta persyaratan sebelum didaftarkan mengurangi keluhan terhadap proses pembatalan terutama bagi pasien dan keluarga serta tim operasi, mengurangi angka penundaan operasi elektif', 'Input : terjadi penurunan angka penundaan operasi elektif kurang dari 5%. Proses : sebelum diputuskan melakukan penundaan pembedahan, DPJP bedah / Operator melakukan reviewnkembali meliputi : kondisi pasien pra bedah, ketersediaan ruang rawat khusus jika diperlukan, ketersediaan peralatan khusus jika diperlukan dan tersedia. Output : Angka penundaan operasi elektif kurang dari 5%.', 'melakukan sosialisasi ulang kepada operator tentang Semua kelengkapan persyaratan administrasi, alat kesehatan dan pasien itu sendiri sudah harus siap sebelum dijadwalkan atau minimum sebelum pasien masuk kamar operasi', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(28, 3, 10, NULL, 'Pada triwulan ke II tahun 2019 akan melakukan sosialisasi ulang ke operator untuk melengkapi pembuatan laporan operasi sehingga Mencapai angka ketidaklengkapan laporan operasi 0%', 'Sosialisasi tentang pentingnya kelengkapan laporan operasi, Monitoring dan evaluasi kelengkapan laporan operasi', 'Input : Angka ketidaklengkapan laporan operasi 0%, Proses : Sosialisasi tentang pentingnya kelengkapan laporan operasi dan sosialisasi tentang pembuatan laporan operasi secara online. Output : tidak adanya kejadian ketidaklengkapan laporan operasi', 'Monitoring dan evaluasi ketidaklengkapan laporan operasi pada saat rapat.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(29, 3, 10, NULL, 'pada triwulan III tahun 2019 mengingatkan lagi kepada operator dengan sosialisasi ulang sehingga Mencapai angka ketidaklengkapan laporan operasi 0%', 'Sosialisasi dengan mengundang operator tentang pentingnya kelengkapan laporan operasi serta menyampaikan hasil capaian triwulan I, Monitoring dan evaluasi kelengkapan laporan operasi', 'Input : Angka ketidaklengkapan laporan operasi akan menurun bahkan sapai 0%, Proses : Sosialisasi tentang pentingnya kelengkapan laporan operasi dan sosialisasi tentang pembuatan laporan operasi secara online. Output : tidak adanya kejadian ketidaklengkapan laporan operasi', 'Monitoring dan evaluasi ketidaklengkapan laporan operasi', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(30, 25, 66, NULL, 'Menimalisir kecelakaan kerja sampai 0%', 'Sosialisasi Kesehatan dan Keselamatan Kerja (K3) ke semua staff Rumah Sakit yang dilakukan setiap bulan sekali', 'Untuk Triwulan IV bulan Oktober-Desember tahun 2018 ada kenaikan angka kecelakaan kerja dibandingkan dengan pada Triwulan III ( Juli-September) Tahun 2018 sebesar 0.08% pada bulan Oktober dan 0.08% pada bulan Desember Tahun 2018 .', 'Tetap melakukan monitoring K3 ke semua unit kerja setiap bulan sekali, menerapkan Regulasi K3 di Rumah Sakit, Melaporkan kecelakaan kerja ke Direktur dan menindaklanjuti Disposisi Direktur', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(31, 32, 90, NULL, 'Trimester 1 Mencapai target kepatuhan identifikasi pasien 100%.', 'Kepatuhan identifikasi dilakukan pada saat pasien sebelum pemberian obat, pemberian nutrisi, pemberian darah, pengambilan spesimen, dan sebelum dilakukan tindakan diagnostik. ', 'Input : Angka kepatuhan identifikasi pasien mencapai 100%. Proses : Sosialisasi tentang pentingnya identifikasi pasien. Output : Proses identifikasi pasien dilakukan dengan benar.', 'Pemberian gelang identitas pasien dengan benar, Kepatuhan identifikasi pasien dilakukan oleh petugas dengan benar, Monitoring dan evaluasi kepatuhan identifikasi pasien.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(32, 21, 58, NULL, 'Input data pelaporan kerusakan lampu penerangan sesuai dari ruangan.', 'Unit sudah mengumpulkan dan melaporkan data rekapitulasi indikator utama kesiapan penerangan bila lampu penerangan mati mulai bln April - juni 2019,Melakukan penggantian lampu dan perbaikan sesuai dengan laporan kerusakan dari ruangan.', 'Penggantian lampu penerangan ruangan masih belum mencapai target karena pada bulan April mencapai 1,44%,Mei 0,99%,Juni 1,22% ', 'Merencanakan dan mengusulkan penggantian lampu yang memakai trafo dengan lampu LED juga menghimbau kepada semua ruangan agar mematikan lampu bila tidak dibutuhkan.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(33, 18, 49, NULL, '1.Edukasi kepada pasien baru terkait peraturan pemberian makanan di RS.  2.Melakukan koordinasi dengan dietisien yg bertugas di Ruang Rawat Inap agar menuliskan preskripsi diet secara jelas sesuai kondisi dan kebiasaan makan pasien. 3. Dietisien memotivasi pasien untuk menghabiskan makanan yang disajikan RS.', '', '', '', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(34, 21, 57, NULL, 'Input data pelaporan kerusakan AC pendingin ruangan hampir setiap hari ,dengan berkurangnya kerusakan AC pendingin ruangan akan mengurangi biaya operasional dan dengan berfungsinya AC pendingin ruangan akan menambah kenyaman pasien dan petugas.', 'Unit sudah mengumpulkan dan melaporkan data rekapitulasi indikator utama penanganan alat pendingin ruangan/AC  .mulai bln April -Juni 2019,Melakukan perawatan rutin dan perbaiakan AC serta membuat SOP cara menggunakan Ac pendingin.', 'Angka perbaikan AC pendingin ruangan pada bulan April - Juni 2019 masih dibawah standar indikator dimana pada bulan April 0,10,Mei 0,64,Juni 0,40', 'Melakukan pemeliharaan AC secara rutin ,membuat rekomendasi ke ruangan agar tidak menghidupkan AC saat ruangan kosong,Mengajukan usulan pembelian AC yang berkwalitas.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(35, 21, 102, NULL, 'Input data pelaporan kerusakan bangunan gedung sesuai dengan laporan ruangan.', 'Unit sudah mengumpulkan dan melaporkan data rekapitulasi indikator utama penanganan pemeliharaan sarana bangunan gedung selama 3 bulan mulai dari April - Juni 2019,Melakukan perbaikan sesuai laporan dari ruangan dan melakukan penggantian sarana yang dibutuhkan,Melakukan pengecatan bangunan gedung secara rutin.', 'Penanganan pemeliharaan sarana bangunan gedung di ruangan masih belum memenuhi target terbukti dengan grafik yang masih naik turun.pada bulan April 0,14%,Mei 0,91%,Juni 0,31%', 'Melakukan pemeliharaan secara rutin,mengusulkan pengadaan sarana pengganti yang berkwalitas', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(36, 18, 49, NULL, '1. Koordinasi dengan dietisien Ruang Rawat Inap terkait pemberian edukasi pasien baru. 2. Pengembangan resep yang berbahan dasar ayam negeri.', '1.Edukasi kepada pasien baru terkait peraturan pemberian makanan di RS. 2.Melakukan koordinasi dengan dietisien yg bertugas di Ruang Rawat Inap agar menuliskan preskripsi diet secara jelas sesuai kondisi dan kebiasaan makan pasien. 3. Dietisien memotivasi pasien untuk menghabiskan makanan yang disajikan RS. 4. menyusun menu dan resep olahan ayam negeri.', 'Berdasarkan hasil pengamatan selama 3 bulan ( januari - maret 2019) diperoleh hasil sisa makanan yang tidak termakan oleh pasien sebesar 25,46 %. hal ini disebabkan oleh kondisi internal pasien ( mual, muntah, nyeri post op),  kebiasaan makan pasien ( porsi kecil, tidak suka ayam negeri), pasien sudah makan makanan dari luar RS.', '1. dietisien mengunjungi pasien baru untuk melakukan edukasi makasimal 2X24 jam. 2.  uji coba pengembangan resep olahan ayam negeri. 3. dietisien memantau ketepatan penyajian  makanan dengan preskripsi diet.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(37, 18, 49, NULL, 'dietisien mengunjungi pasien baru untuk melakukan edukasi makasimal 2X24 jam. 2. uji coba pengembangan resep olahan ayam negeri. 3. dietisien memantau ketepatan penyajian makanan dengan preskripsi diet.', '1. dietisien datang ke Ruang Rawat Inap sesuai waktu yang sudah ditentukan yaitu pkl.08.00. 2. Revisi siklus menu', '', '', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(38, 26, 68, NULL, 'Segera menyelesaikan pembahasan RBA Diklat 2019 sehingga beberapa kegiatan pelatihan internal dapat segera dilaksanakan berdasarkan biaya pelatihan dan pendidikan yang telah tercantum.', 'Masih kurangnya realisasi yang terlaksana dikarenakan kurang siapnya dari pihak TIM pelaksana (unit terkait) dalam melakukan kegiatan pelatihan internal selain itu untuk kegiatan eksternal masih belum banyak pelatihan, seminar ataupun workshop yang dapat ditindaklanjuti terkait pembahasan yang dibutuhkan.', 'Belum memenuhi sasaran yang menjadi goal measurement karena masih terbatasnya pelatihan internal maupun eksternal untuk setiap sumber daya manusia di Rumah Sakit.', 'Dapat ditarik kesimpulan jika kurangnya angka realisasi dari angka target pada bulan Januari sampai Maret 2019 dibutuhkan koordinasi baik antara pihak unit terkait dengan Diklat sehingga kegiatan pelatihan internal maupun eksternal dapat berjalan dengan baik.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(39, 26, 68, NULL, 'Melaksanakan kegiatan pelatihan internal yang telah tercatat dalam RBA Diklat 2019 maka telah terlaksana beberapa kegiatan dalam periode April hingga Juni.', 'Realisasi pada bulan April hingga Juni mengalami sedikit peningkatan sesuai dengan gambaran grafik karena Diklat telah menindaklanjuti beberapa kegiatan pelatihan internal yang belum atau sama sekali belum terlaksana pada bulan -bulan sebelumnya.', 'Masih belum mencapai target yang diinginkan disebabkan hanya beberapa unit saja yang mengonfirmasikan terkait kegiatan pelatihan internal sedangkan untuk kegiatan eksternal sudah berjalan beberapa kegiatan untuk pemenuhan pendidika setiap SDM di Rumah Sakit', 'Koordinasi antara pihak unit terkait yang ingin menyelenggarakan kegiatan pelatihan internal dengan pihak Diklat telah berjalan baik adanya. Namun, masih ada beberapa yang belum konfirmasi lebih lanjut untuk kegiatan yang akan dilaksanakan sehingga hanya sebagian yang terlaksana.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(40, 7, 22, NULL, 'Menekan kejadian SC pada nullipara hamil aterm janin tunggal letak vertex / belakang kepala', '1. Melakukan pengawasan semua pasien nullipara waktu proses inpartu lebih intens agar terkaji benar yang resiko untuk di SC. 2. Kolaborasi tim medis untuk syarat pemberian induksi dan stimulasi pasien nullipara untuk meminimalkan kegagalan induksi dan stimulasi.3. Ada SPM / SPO induksi dan stimulasi agar semua petugas paham kegagalan induksi / stimulasi. 4. Edukasi awal pada semua pasien nullipara yang akan menghadapi proses persalinan tentang proses - proses persalinan dan perubahan / rasa sakit inpartu sampai tahu tingkat pemahaman pasien.5. Penerapan sistem BPJS untuk indikasi Sc ( tidak ada indikasi permintaan pasien ) bisa terklaim BPJS.', '1. Petugas dalam memantau pasien nullipara inpartu belum mengacu partograf. 2. Belum patuh SPO kriteria gagal induksi dan stimulasi. 3. Induksi SC tidak tegas sesuai aturan BPJS.', '1.Tingkatkan kualitas skill bidan dalam pemantauan inpartu dengan menggunakan  partograf dan penilaian bishops score. 2. Ada SPO / SPM tentang induksi dan stimulasi. 3. Ada pembahasan kasus dan evaluasi secara periodik diprogramkan di unit Obsgyn untuk menurunkan kejadian kasus ini, 4. Pengisian dokumen / les pasien yang lengkap dan terbukti terutama di RM edukasi dan CPPT.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(41, 25, 66, NULL, 'Menimalisir kecelakaan kerja sampai 0%', 'Sosialisasi Kesehatan dan Keselamatan Kerja (K3) ke semua staff Rumah Sakit yang dilakukan setiap bulan sekali', 'Untuk Triwulan I bulan Januari-Maret tahun 2019 ada 1 (satu) kejadian kecelakaan kerja yang terjadi pada bulan Maret sebesar 0.08% dari hasil kecelakaan tersebut diperoleh rata-rata sebesar 0.03% dari target 100% yang direncanakan', 'Tetap melakukan monitoring K3 ke semua unit kerja setiap bulan sekali, menerapkan Regulasi K3 di Rumah Sakit, Melaporkan kecelakaan kerja ke Direktur dan menindaklanjuti Disposisi Direktur', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(42, 7, 23, NULL, 'Wakku distribusi hasil laborat pasien kamar bersalin tertib ( pada waktu operan jaga hasil laborat sudah ada )', '1. Ada SPO dari pelayanan tentang pemeriksaan laborat dan pemberitahuan / pengambilan hasil laborat terutama pasien Obsgyn. 2. Semua petugas / bidan jaga patuh SPO, operan jaga hasil laborat sudah ada.3. Ada data pasien yang pengiriman sampel laborat 7 - 10 jam hasil belum ada / belum jadi. 4. Belum semua petugas iKB mengetahui dan paham tentang indikator ini. ', '1. Petugas jaga / bidan kurang peka fungsi hasil laborat dalam menegakkan diagnosa, fokusnya diagnosa kebidanan. 2. Petugas IKB dan petugas laborat belum patuh SPO.', '1. Terealisasinya SPO dari pelayanan tentang pendistribusian hasil laborat. 2. Meningkatkan kinerja / kerja sama antara petugas IKB dan petugas laborat. 3. Meningkatkan kualitas bidan untuk membuat diagnosa kebidanan / assesment kebidanan sudah ada data penunjang laborat. 4. Sosialisasi dari PIC mutu kepada semua anggota kamar bersalin. ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(43, 25, 66, NULL, 'Menimalisir kecelakaan kerja sampai 0%', 'Sosialisasi Kesehatan dan Keselamatan Kerja (K3) ke semua staff Rumah Sakit yang dilakukan setiap bulan sekali', 'untuk triwulan II Periode April-Juni 2019 kejadian kecelakaan kerja yang terjadi  pada bulan mei sebesar 0.08% dari hasil kecelakaan tersebut diperoleh rata-rata sebesar 0.03% dari target 100% yang direncanakan.', 'Tetap melakukan monitoring K3 ke semua unit kerja setiap bulan sekali, menerapkan Regulasi K3 di Rumah Sakit, Melaporkan kecelakaan kerja ke Direktur dan menindaklanjuti Disposisi Direktur', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(44, 7, 24, NULL, 'Bayi lahir di IKB dengan penyulit diindikasikan IMD sebelum dirawat di level 1 petugas ruang IKB bisa melakukan IMD sampai berhasil yaitu bayi bisa aktif menghisap puting susu ibu / dengan lama waktu kurang lebih 2 jam.', '1. Semua petugas ruang IKB paham dengan program mutu ini dan mau melaksanakan program ini sesuai prosedur. 2. Ada panduan / SPO indikasi ibu dan bayi IMD yang tegas sehingga petugas patuh. 3. Ada program dari Rumah Sakit di RSSIB, tim / petugas mendukung keberhasilan IMD dan evaluasinya sering ada kejadian bayi sudah indikasi RG masuk rawat level 1, level 2 dan NICU.', '1. Tim mutu unit ruang IKB melakukan sosialisasi program ini. 2 Tim mutu unit ruang IKB koordinasi dengan pokja MDgs PN 1 untuk dibuat panduan / SPO tentang IMD dan panduan di RSSIB.', '1. Program edukasi perorangan dan kelompok di ruang IKB untuk IMD agar selalu diberikan. 2. Ada data / buku catatan tentang masalah - masalah keberhasilan IMd di ruang IKB. 3. Semua petugas melakukan IMD sesuai SPO.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(45, 25, 64, NULL, 'tingkat kepatuhan pengisian papan code red 100%', 'sosialisai tentang pentingnya  kepatuhan pengisian papan code red', 'untuk triwulan IV periode Oktober-Desember tahun 2018 tingkat kepatuhan pengisian papan code red untuk bulan November mengalami penurunan dibandingkan dengan bulan Oktober yang dari 62.5% turun ke 49.47% tapi untuk bulan Desember mengalami kenaikan sebesar 68.42%.', 'tetap melakukan monitoring ke semua unit kerja tiap bulan dan membuat laporan bulanan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(46, 25, 67, NULL, 'meminimalisir Tumpahan B3 ke semua unit kerja sebesar 0%', 'sosialisasi tentang pentingnya bahaya Tumpahan B3 terhadap karyawan, pengunjung dan Pasien Rumah Sakit.', 'Hasil penanganan Tumpahan B3 di RSUD RAA Soewondo Pati untuk Triwulan I periode januari - maret 2019 capaian 0% sesuai target karena hasil tidak terjadi Tumpahan B3 atau NIHIL. Dari hasil tersebut tetap melakukan monitoring ke semua unit kerja untuk menimalisir terjadinya tumpahan B3 dan membuat laporan bulanan .', 'tetap melakukan monitoring ke semua unit kerja tiap bulan dan membuat laporan bulanan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(47, 26, 68, NULL, 'Melakukan improvisasi lebih baik di tahun 2019, menurunnya angka grafik realisasi di period ini karena telah terlaksananya beberapa kegiatan internal maupun eksternal di bulan-bulan sebelumnya. Sedangkan untuk kegiatan yang belum terlaksana akan dilakukan pergeseran RBA Tahun 2018 ke tahun 2019 sehingga dapat memenuhi target 20 JPL untuk setiap Sumber Daya Manusia di Rumah Sakit.', 'Belum mencapai target sasaran karena masih ada beberapa kegiatan pelatihan internal yang belum terlaksana.', 'Belum memenuhi sasaran yang menjadi goal measurement karena masih kurangnya koordinasi pihak pelaksana kegiatan pelatihan internal dengan Diklat sehingga tidak terlaksananya beberapa pelatihan.', 'Diharapkan koordinasi atau komunikasi antara pihak pelaksana pelatihan internal dengan Diklat dapat berjalan dengan baik. Sedangkan untuk pelatihan eksternal dapat lebih merata untuk peserta yang akan diberangkatkan untuk mengikuti pelatihan tersebut. ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(48, 5, 16, NULL, 'Menekan angka keterlambatan SC Cito > 30 menit', '1. Evaluasi hal hal yang berkaitan dengan SC Cito>30 menit 2. koordinasi dengan IBS dan tim terkait', '1. Petugas menunggu hasil Laborat 2. Petugas menunggu kesiapan IBS dan tim terkait', '1. Monitoring dan evaluasi pelaksanaan SC cito 2. Meningkatkan koordinasi dengan tim terkait', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(49, 5, 16, NULL, '', '', '', '1. Monitoring dan evaluasi pelaksanaan SC cito 2. Meningkatkan koordinasi dengan tim terkait', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(50, 10, 32, NULL, ' 1.Menugaskan tim mutu untuk melakukan evaluasi terhadap capaian pelayanan radiologi rawat jalan pemeriksaan foto thorax untuk persiapan operasi elektif. 2. Mengupayakan capaian waktu keterlambatan ekspertise dokter spesialis radiologi terhadap pelayanan pasien foto thorax persiapan operasi elektif 0 %', '1. Tim mutu melakukan evaluasi terhadap capaian pelayanan rawat jalan foto thorax persiapan operasi elektif. 2. Meningkatkan profesionalitas petugas radiologi. 3. Meningkatkan kualitas peralatan x-ray dan accesoriesnya. 4. Membangun komunikasi dengan unit terkait dalam hal ini poli rawat jalan yang akan mengirim pasien operasi elektif, sehingga ada informasi yang tepat tentang pasien yang di kirim ke instalasi radiologi.', '1. Pada bulan Januari sampai Maret 2019 capaian indikator mutu sudah mencapai target yang ditetapkan yaitu 0%.', '1. Membangun komunikasi dengan poli rawat jalan dan dokter pengirim sehingga di capai kesepakatan terutama untuk kasus-kasus persiapan pasien operasi elektif. 2. Menjaga kualitas radiografer dan dokter  radiolog sehingga dokter radiolog bisa datang tepat waktu.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(51, 16, 42, NULL, 'Ketersediaan linen di ruang rawat inap mutlak harus terpenuhi guna menunjang pelayanan di ruang rawat inap.', 'Petugas distribusi linen selalu mengirim dan mencatat linen bersih ke ruang rawat inap tepat waktu, tepat jumlah dan jenisnya.', 'Angka ketepatan waktu penyediaan linen di ruang rawat inap bulan Oktober sampai Desember 2018 tercapai 100 %.', 'Untuk pencapaian ketepatan waktu penyediaan linen ruang rawat inap untuk dipertahankan kerjasama yang baik antara petugas linen dan petugas ruangan sebagai pengguna.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
