(53, 25, 64, NULL, 'tingkat kepatuhan pengisian papan code red 100%', 'sosialisai tentang pentingnya  kepatuhan pengisian papan code red', 'tingkat kepatuhan pengisian papan code red pada triwulan I periode Januari-Maret 2019 mengalami kenaikan pada bulan Maret sebesar 64,21% dari bulan sebelumnya bulan februari 57.89% dan rata-rata tingkat kepatuhan triwulan I 2019 diperoleh rata-rata 59.47% dari target yang direncanakan 100%', 'tetap melakukan monitoring ke semua unit kerja tiap bulan dan membuat laporan bulanan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
