(87, 32, 95, NULL, 'Mencapai kepatuhan upaya pencegahan risiko cedera akibat pasien jatuh pada pasien rawat inap 100%.', 'Setiap pasien yang rawat inap dilakukan skreening, asesmen awal, asesmen ulang dan edukasi. Pasien yang risiko jatuh tinggi diberikan gelang kuning risiko jatuh dan penanda risiko jatuh pada tempat tidur pasien. ', 'Input : Kurangnya kepatuhan Upaya pencegahan risiko cedera akibat jatuh pada pasien rawat inap. Proses : Setiap pasien yang rawat inap dilakukan skreening, asesmen awal, asesmen ulang dan edukasi. Pasien yang risiko jatuh tinggi diberikan gelang kuning risiko jatuh dan penanda risiko jatuh pada tempat tidur pasien. Output : Kepatuhan upaya pencegahan risiko cedera akibat pasien jatuh pada pasien rawat inap', 'Pemberian gelang risiko jatuh pada pasien risiko jatuh tinggi pada pasien rawat inap. Pemberian pita kuning risiko jatuh tinggi pada psien rawat jalan. Sosialisasi ulang mencegah agar pasien risiko jatuh tidak ada dengan cara sosialisasi SPO asesmen risiko jatuh dan SPO langkah - langkah pencegahan pasien jatuh.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(88, 32, 95, NULL, 'Mencapai kepatuhan upaya pencegahan risiko cedera akibat pasien jatuh pada pasien rawat inap 100%.', 'Setiap pasien yang rawat inap dilakukan skreening, asesmen awal, asesmen ulang dan edukasi. Pasien yang risiko jatuh tinggi diberikan gelang kuning risiko jatuh dan penanda risiko jatuh pada tempat tidur pasien. ', 'Input : Kurangnya kepatuhan Upaya pencegahan risiko cedera akibat jatuh pada pasien rawat inap. Proses : Setiap pasien yang rawat inap dilakukan skreening, asesmen awal, asesmen ulang dan edukasi. Pasien yang risiko jatuh tinggi diberikan gelang kuning risiko jatuh dan penanda risiko jatuh pada tempat tidur pasien. Output : Kepatuhan upaya pencegahan risiko cedera akibat pasien jatuh pada pasien rawat inap', 'Pemberian gelang risiko jatuh pada pasien risiko jatuh tinggi pada pasien rawat inap. Pemberian pita kuning risiko jatuh tinggi pada psien rawat jalan. Sosialisasi ulang mencegah agar pasien risiko jatuh tidak ada dengan cara sosialisasi SPO asesmen risiko jatuh dan SPO langkah - langkah pencegahan pasien jatuh.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(89, 10, 32, NULL, '1. Mengupayakan capaian waktu keterlambatan ekspertise dokter spesialis radiologi terhadap pelayanan pasien foto thorax persiapan operasi elektif 0 %. 2. Meningkatkan profesionalitas petugas radiologi.', '1. Melakukan sensus harian dan bulanan waktu ekspertise dokter spesialis radiologi terhadap pelayanan pasien rawat jalan foto thorax persiapan operasi elektif. 2. Membangun komunikasi dengan unit terkait dalam hal ini poli rawat jalan yang akan mengirim pasien operasi elektif, sehingga ada informasi yang tepat tentang pasien yang di kirim ke instalasi radiologi.', 'Pada triwulan II capaian indikator mutu keterlambatan waktu tunggu ekspertise foto thorax untuk persiapan operasi elektif rawat jalan sudah sesuai target yaitu 0%.', 'Menjaga kualitas kinerja radiografer dan radiolog agar pelayanan radiologi berjalan lancar sehingga hasil expertise dapat keluar tepat waktu.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(90, 10, 33, NULL, '1. Memutuskan tim mutu untuk melakukan evaluasi terhadap capaian pelayanan pemeriksaan radiologi nilai kritis. 2. Mengupayakan capaian waktu keterlambatan ekspertise dokter spesialis radiologi terhadap pemeriksaan nilai kritis mencapai 0 %. 3. Meningkatkan kualitas petugas dengan mengirimkan ke pelatihan, diklat maupun seminar secara berkala dan berkelanjutan. 4. Kalibrasi secara berkala untuk semua peralatan x-ray. 5.	Menambah  pesawat x-ray baru, sehingga faktor kerusakan yang disebabkan oleh umur pesawat x-ray dapat dieliminir. 6. Meningkatkan komunikasi yang efektif kepada pasien sebelum pemeriksaan. 7. Meningkatkan komunikasi yang efektif kepada dokter spesialis radiologi dengan menggunakan media WA ( WhatsApp ). 8. Dokter spesialis radiologi standby ditempat.', '1. Tim mutu melakukan evaluasi terhadap capaian pelayanan pemeriksaan radiologi pasien nilai kritis. 2. Melakukan sensus harian dan bulanan waktu ekspertise dokter spesialis radiologi terhadap pelayanan pemeriksaan radiologi pasien nilai kritis. 3.	Mengajukan ke Rumah Sakit agar diprogramkan pelatihan dan seminar untuk meningkatkan kualitas petugas secara bergiliran dan kontinyu. 4. Melakukan kalibrasi secara berkala  untuk semua pesawat x-ray. 5. Mengajukan ke Rumah Sakit untuk peremajaan pesawat x-ray dengan menambah pesawat x-ray terbaru sesuai perkembangan iptek. 6. Membangun komunikasi efektif dengan memberikan pengertian dan penjelasan seperlunya kepada pasien sebelum dilakukan pemeriksaan sehingga pasien memahami proses pemeriksaan yang dilakukan. 7. Membangun komunikasi efektif antara radiografer dengan dokter spesialis radiologi dalam penanganan pemeriksaan radiologi pasien nilai kritis. 8. Dibuat jadwal secara periodik dan dikondisikan agar selalu ada dokter radiologi yang standby.', '1. Capaian pada bulan April sampai Juni 2019 sama sekali belum ada yang mencapai target 0%. 2. Banyaknya kasus pemeriksaan pasien nilai kritis di luar jam dinas. 3. Karena dokter radiologi masih terbatas di wilayah pati sehingga dokter radiologi masih dibutuhkan di RS lain. 4.	Dokter radiolog kadang terlambat merespon.', '1. Meningkatkan komunikasi antara radiografer dengan dokter pengirim sehingga dicapai kesepakatan untuk kasus pemeriksaan pasien nilai kritis sehingga tercapai tujuan yang diinginkan oleh dokter pengirim. 2. Membangun komunikasi dan pendekatan personal dengan dokter spesialis radiologi sehingga ekspertise pasien nilai kritis di luar jam dinas dapat terlaksana. 3. Mengajukan tambahan dana seminar dan pelatihan untuk even-even pengembangan sumber daya manusia. 4. Meningkatkan dan menjaga kualitas radiografer dan dokter radiolog sehingga dokter radiolog bisa memberikan ekspertise tepat waktu.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(91, 10, 34, NULL, '1. Menugaskan tim mutu untuk melakukan evaluasi terhadap capaian pelaksanaan ekspertise hasil pemeriksaan rontgen. 2. Mengupayakan capaian pelaksanaan ekspertise hasil pemeriksaan rontgen 100%. 3. Meningkatkan profesionalitas petugas radiologi dan dokter spesialis radiologi. 4. Mempercepat waktu expertise dokter spesialis radiologi.', '1. Tim mutu melakukan evaluasi terhadap capaian pelaksanaan ekspertise hasil pemeriksaan rontgen. 2. Melakukan sensus harian dan bulanan tentang pelaksanaan ekspertise hasil pemeriksaan rontgen 3. Mengajukan ke Rumah Sakit agar diprogramkan pelatihan dan seminar untuk meningkatkan kualitas dokter spesialis radiologi secara bergiliran dan kontinyu. 4. Dibuat jadwal secara periodik dan dikondisikan agar selalu ada dokter radiologi yang standby.', '1. Pelaksanaan ekspertise oleh Dokter spesialis Radiologi belum memenuhi target. 2. Banyaknya foto rontgen yang di pinjam oleh dokter pengirim sebelum dilakukan ekspertise dokter Radiologi. 3. Adanya pemeriksaan foto rontgen diluar jam kerja sehingga oleh petugas ruangan rawat inap diambil sebelum di ekspertise. 4. Dokter atau perawat ruangan yang meminjam foto tidak langsung mengembalikan foto yang belum terekspertise ke radiologi. 5. Karena dokter radiologi masih terbatas di wilayah pati sehingga dokter radiologi masih dibutuhkan di RS lain.', '1. Membangun komunikasi dengan petugas rawat inap dan dokter pengirim untuk tidak mengambil foto sebelum diexpertise oleh radiolog. 2. Setelah selesai digunakan, petugas ruangan harus segera mengembalikan foto yang belum diekspertise ke radiologi. 3. Menjaga dan meningkatkan kualitas kinerja dokter Radiolog. 4. Dokter spesialis radiologi datang tepat waktu dan standby di radiologi selama jam kerja.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(92, 25, 64, NULL, 'tingkat kepatuhan pengisian papan code red 100%', 'sosialisai tentang pentingnya  kepatuhan pengisian papan code red', 'Tingkat kepatuhan pengisian papan code red untuk Triwulan I periode Januari-Maret 2019 diperoleh hasil 64.21 % dibandingkan dengan bulan Januari yang mencapai 56.32% . rata-rata kepatuhan pengisian papan code red untuk triwulan I adalah 59.47% dan hasil tersebut masih jauh dari target yang direncanakan yaitu 100%. dari hasil tersebut tetap melakukan monitoring kepatuhan pengisian papan code red dan membuat laporan bulanan.	', 'tetap melakukan monitoring ke semua unit kerja tiap bulan dan membuat laporan bulanan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(93, 25, 64, NULL, 'tingkat kepatuhan pengisian papan code red 100%', 'sosialisai tentang pentingnya  kepatuhan pengisian papan code red', 'hasil tingkat kepatuhan code red triwulan II periode April-Juni 2019 mengalami penurunan tiap bulan sampai 46.32% yang dibandingkan di triwulan I yang sebesar 64.21%. rata-rata dari hasil tersebut diperoleh hasil 53.08% dan hasil tersebut masih jaug dari target yang direncanakan yaitu 100%. dan untuk selanjutnya tetap melakukan monitoring ke semua unit kerja tiap bulan dan membuat laporan bulanan.', 'tetap melakukan monitoring ke semua unit kerja tiap bulan dan membuat laporan bulanan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(94, 26, 68, NULL, 'Melaksanakan pergeseran RBA Diklat terkait pendidikan dan pelatihan internal yang belum terlaksana. Pada indikator mutu Diklat tahun 2018 telah berjalan dengan baik dapat dilihat pada grafik, dimana pada bulan Oktober Diklat telah mampu mencapai goal measurement yang ditentukan sehingga setiap SDM dapat memenuhi 20 JPL dalam kegaiatn pelatihan internal maupun eksternal.', 'Sudah terlampaui target sasaran pada bulan Oktober, namun tetap masih ada beberapa ada kegiatan yang tidak terlaksana.', 'Angka target terpenuhi tetapi masih ada beberapa kegiatan tidak terlaksana karena kurangnya koordinasi antara pihak pelaksana kegiatan pelatihan internal dengan Diklat sebagai fasilitator sehingga diharuskan adanya pergeseran ke tahun selanjutnya untu pelaksanaan kegiatan yang belum terlaksana.', 'Dapat berkoordinasi dan bekomunikasi dengan baik jika ingin melaksanakan kegiatan pelatihan internal dengan Diklat, sehingga sebagai fasilitator kita dapat menindaklanjuti terkait kegaiatan yang akan dilaksanakan nantinya.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(95, 25, 67, NULL, 'meminimalisir Tumpahan B3 ke semua unit kerja sebesar 0%', 'sosialisasi tentang pentingnya bahaya Tumpahan B3 terhadap karyawan, pengunjung dan Pasien Rumah Sakit.', 'hasil penanganan Tumpahan B3 di RSUD RAA Soewondo Pati untuk Triwulan II periode April-Juni 2019 capaian 0% sesuai target karena hasil tidak terjadi Tumpahan B3 atau NIHIL. Dari hasil tersebut tetap melakukan monitoring ke semua unit kerja untuk menimalisir terjadinya tumpahan B3 dan membuat laporan bulanan .	', 'tetap melakukan monitoring ke semua unit kerja tiap bulan dan membuat laporan bulanan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(96, 26, 68, NULL, 'Melaksanakan beberapa kegiatan pelatihan internal yang telah terorganisir dengan baik dalam RBA Diklat 2019 dan melakukan koordinasi dengan para pelaksana kegiatan untuk segera konfirmasi ke pihak fasilitator (Diklat) ', 'Realisasi pada tiga bulan awal tahun 2019 dapat dikatakan mengalami perubahan yang lumayan bagus karena tergambarnya kurva naik pada periode bulan Januari hingga Maret. Meskipun, masih belum mencapai goal mesurement tapi bisa dikatakan adanya perkembangan untuk tiga bulan awal tahun 2019.', 'Belum mencapai angka target karena masih terbatasnya pelatihan internal maupun eksternal untuk setiap SDM Rumah Sakit.', 'Kurva naik yang ditunjukkan pada grafik menandakan bahwa lumayan banyak SDM yang mengikuti kegiatan pelatihan internal maupun eksternal untuk pemenuhan 20 JPL per tahun setiap individu, khususnya pada bulan Maret. ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(97, 18, 49, NULL, 'Dietisien mengunjungi pasien baru  melakukan edukasi maksimal 2x24 jam.2. uji coba pengembangan resep olahan ayam negeri. 3. Dietisien memantau ketepatan penyajian makanan dengan preskripsi diet.', '1. dietisien datang ke Ruang Rawat Inap sesuai waktu yang sudah ditentukan yaitu pkl.08.00. 2. Revisi siklus menu', 'Berdasarkan hasil pengamatan triwulan 2 (april - juni 2019) sisa makanan yang tidak termakan oleh pasien rata-rata 21,58%. hasil tersebut menunjukkan adanya peningkatan capaian dari triwulan sebelumnya sisa makanan yang tidak termakan 25,64%. Namun demikian masih belum dapat mencapai standart yang di tentukan yaitu 20%. Hal ini disebabkan karena faktor internal pasien yang sedang mengalami gangguan kesehatan, sehingga dapat mempengaruhi menurunnya nafsu makan.', 'Dietisien memberikan edukasi kepada pasien dan keluarga, tentang peran nutrisi dalam proses penyembuhan penyakit. dengan harapan pasien akan menghabiskan makanan yang disajikan.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(98, 6, 18, NULL, 'meningkatkan kepatuhan petugas IBS melengkapi transfer internal pasien post operasi yang masuk ke ruang ICU', 'melakukan pemantauan terhadap petugas IBS yang mengirim pasien ke ICU untuk menulis tranfer internal', 'petugas IBS dalam mengisi transfer internal pasien baru yang masuk ruang ICU belum patuh 100%', 'evaluasi dan ingatkan petugas IBS dalam mengisi transfer internal. Koordinasi dengan kepala ruang IBS dan petugas IBS dalam penyampaian hasil evaluasi pengisisn transfer internal', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
