(103, 18, 48, NULL, 'Triwulan I Peningkan capaian kepatuhan pemakaian APD pada petugas produksi menjadi 100 %  Langkah : Meningkatkan pengawasan terhadap petugas dari mulai persiapan sampai dendan distribusi  2.Meningkatkan supervisi oleh Ka unit/Penanggung Jawab mutu  3. Sosialisasi SPO oleh Tim Mutu Unit.', 'Menyediakan APD lengkap di tempat penyimpanan.  2. Sosialisasi standar pemakaian APD  3.Sosialisasi target capaian pemakaian APD setiap brefing AG,Pengolah  dan penyaji makanan.', '1.Suhu ruang yang panas   2.Petugas tidak paham SPO  3. APD tidak tersedia lengkap  4. Pemakaian APD  {(masker) belum tepat masih naik turun. 5. Kerja di hari libur. 6, Kesadaran pemakaian APD masih rendah .7. Kurangnya supervisi dari PJ mutu', '1. Meningkatkan monitoring dan edukasi secara berkala kepada tenaga penjamah makanan. 2. merencanakan item kepatuhan pemakaian APD dimasukan dalam penilaian kinerja karyawan , dengan harapan ada peningkatan kepatuhan.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(104, 6, 20, NULL, 'meningkatkan dan mempertahankan kepatuhan petugas IBS mendampingi  pasien baru post operasi yang masuk ke ruang ICU', 'melakukan pemantauan terhadap petugas IBS yang mengirim pasien ke ICU untuk mendampingi pasien baru post operasi yang masuk ke ruang ICU', 'petugas IBS dalam mendampingi pasien baru post operasi yang masuk ruang ICU belum patuh 100%', 'evaluasi dan ingatkan petugas IBS dalam mendampingi pasien baru post operasi yang masuk ruang ICU . Koordinasi dengan kepala ruang IBS dan petugas IBS dalam penyampaian hasil evaluasi dalam mendampingi pasien baru post operasi yang masuk ruang ICU', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
