(106, 6, 21, NULL, 'meurunkan angka kejadian pasien yang kembali ke ICU dengan kasus yang sama kurang dari 72 jam', 'melakukan pemantauan terhadap angka kejadian pasien yang kembali ke ICU dengan kasus yang sama kurang dari 72 jam', 'masih ada kejadian pasien yang kembali ke ICU dengan kasus yang sama kurang dari 72 jam', 'evaluasi penyebab terjadinya pasien kembali di rawat di ruang ICU  dengan kasus yang sama kurang dari 72 jam. Mencari penyebab masalah kembalinya pasien yang di rawat di icu dengan kasus yang sama  kurang dari 72 jam. Melaporkan kejadian ke tim PMKP', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(107, 26, 68, NULL, 'Tetap melaksanakan beberapa kegiatan pelatihan internal yang belum terlaksana sesuai yang ada dalam RBA Diklat 2019 dan segera menetapkan beberapa anggaran untuk beberapa kegiatan yang belum tertera dalam RBA Diklat 2019.', 'Realisasi pada bulan April hingga juni mengalami kurva turun-naik yang menandakan bahwa adanya peningkatan pada bulan Juni dan dapat ditingkatkan lagi agar memenuhi goal measurement yang ditetapkan.', 'Masih belum mencapai angka target yang diinginkan disebabkan hanya beberapa unit saja yang mengonfirmasikan terkait kegiatan pelatihan internal sedangkan untuk kegiatan eksternal sudah berjalan dengan baik untuk pemenuhan JPL dan selalu melakukan koordinasi dengan baik.', 'Koordinasi antara pihak unit terkait yang ingin menyelenggarakan kegiatan pelatihan internal dengan pihak Diklat telah berjalan baik adanya. Namun, masih ada beberapa yang belum konfirmasi lebih lanjut untuk kegiatan yang akan dilaksanakan sehingga hanya sebagian yang terlaksana.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(108, 1, 8, NULL, 'Meningkatkan kepatuhan dari DPJA terhadap pelaksanaan CP ', 'Petugas case manager ruangan mengingatkan kepada DPJA bila ada pelaksanaan CP yang tidak sesuai karena dari hasil evaluasi pelaksanaan CP yang telah dilakukan dari 5 CP yang diambil sampel setiap 1 CP 10 kasus masih ditemukan ketidaksesuaian pelaksanaan CP pada bagian pemeriksaan penunjang, obat dan lama hari rawat.', 'Dari hasil evaluasi CP yang telah dilakukan sebagian besar Dokter Spesialis telah mengikuti CP yang berlaku ketidaksesuaian terhadap CP sebagian besar disebabkan karena kebutuhan asuransi untuk pemeriksaan penunjang, ketidaksesuaian obat dikarenakan belum disesuaikan dengan formularium nasional dan PPK terbaru, hari rawat lebih lama dikarenakan menunggu hasil pemeriksaan penunjang.', '1. Melakukan sosialisasi lebih lanjut dengan DPJA agar melakukan perawatan medis sesuai dengan CP. 2. Memaparkan hasil evaluasi CP dalam rapat komite medik. 3. Merevisi CP agar obat - obatan yang digunakan sesuai dengan formularium nasional dan PPK terbaru. 4. Melaksanakan audit medis dengan rutin bila ada penyimpangan dari pelaksanaan CP. 5. Kepatuhan CP dijadikan sebagai penilaian kinerja tenaga medis.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(109, 1, 8, NULL, 'Meningkatkan kepatuhan dari DPJA terhadap pelaksanaan CP ', 'Petugas case manager ruangan mengingatkan kepada DPJA bila ada pelaksanaan CP yang tidak sesuai karena dari hasil evaluasi pelaksanaan CP yang telah dilakukan dari 5 CP yang diambil sampel setiap 1 CP 10 kasus masih ditemukan ketidaksesuaian pelaksanaan CP pada bagian pemeriksaan penunjang, obat dan lama hari rawat.', 'Dari hasil evaluasi CP yang telah dilakukan sebagian besar Dokter Spesialis telah mengikuti CP yang berlaku ketidaksesuaian terhadap CP sebagian besar disebabkan karena kebutuhan asuransi untuk pemeriksaan penunjang, ketidaksesuaian obat dikarenakan belum disesuaikan dengan formularium nasional dan PPK terbaru, hari rawat lebih lama dikarenakan menunggu hasil pemeriksaan penunjang.', ' Melakukan sosialisasi lebih lanjut dengan DPJA agar melakukan perawatan medis sesuai dengan CP. 2. Memaparkan hasil evaluasi CP dalam rapat komite medik. 3. Merevisi CP agar obat - obatan yang digunakan sesuai dengan formularium nasional dan PPK terbaru. 4. Melaksanakan audit medis dengan rutin bila ada penyimpangan dari pelaksanaan CP. 5. Kepatuhan CP dijadikan sebagai penilaian kinerja tenaga medis. ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(110, 18, 47, NULL, 'semua pasien post operasi mendapatkan asuhan gizi  maksimal 2x24 jam sejak selesai operasi. ', '1. Dietisien mengidentifikasi pasien yang program operasi hari itu. 2. tentukan jadwal kunjungan . 3. mengatur jadwal agar dietisien aktif diruangan, maksimal 2 hari tidak diruangan bila ada kepentingan.', 'asuhan gizi pasien post operasi pada trimester I th 2019, rata-rata 67.87%. berdasarkan analisa hal ini terjadi karena nutrisionis yang bertugas di Ruang Rawat Inap masih melakukan kegiatan di penyelenggaraan makanan. sehingga ada 3 jadwal kegiatan yang menyebabkan nutrisionis tidak bisa ke ruang rawat inap untuk melakukan asuhan gizi.', '1. dibuat sistem delegasi, apabila nutrisionis tidak bisa ke ruang rawat inap. 2. nutrisionis dihimbau untuk menyelesaikan semua asuham gizi pasien , sebelum jadwal di penyelenggaraan makanan, cuti/libur. ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(111, 18, 47, NULL, 'Peningkatan capaian pemberian asuhan gizi pada pasien post operasi mencapai target 100%', '1. nutrisionis mengunjungi semua pasien post operasi. 2. sosialisasi terkait target yang harus dicapai pada saat breefing pagi untuk nutrisionis.', 'Rata-rata pasien post operasi yang mendapatkan asuhan gizi pada trimester ke II tahun 2019 ( april - juni ) sebesar 89.88%. Ada peningkatan capaian dari triwulan sebelumnya 67.87%. Belum tercapainya target 100% karena nutrisionis tidak bisa ke ruang rawat inap setiap hari, terkait jadwal dinas di penyelenggaraan makanan.( dinas siang, dinas penerimaan, piket hari libur)', 'nutrisionis satu blok/area bisa bekerja sama menghendel ruang rawat inap yang sedang tidak ada petugasnya.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(112, 18, 49, NULL, 'Sisa makanan yang tidak termakan oleh pasien mencapai standar yaitu kurang dari samadengan 20%. ', '1. edukasi kepada pasien terkait manfaat asupan zat gizi dalam proses penyembuhan penyakit. 2. evaluasi siklus menu. ', 'berdasarkan hasil pengamatan triwulan 4 tahun 2018 (oktober - desember) sisa makanan yang tidak termakan oleh pasien sebesar 21.69%. sisa makanan terbanyak adalah protein nabati : tahu dan tempe. Pasien lebih banyak menghabiskan lauk hewani karena merasa bosan dengan lauk nabati dikarenakan dirumah sering mengkonsumsi.', '1. nutrisionis meningkatkan kunjungan ke pasien rawat inap untuk melakukan monitoring asupan dan edukasi gizi. 2. mengurangi frekuensi pemakaian protein nabati dalam siklus menu. 3. mengembangkan resep olahan tahu dan tempe. ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
