(118, 18, 48, NULL, 'Semua penjamah makanan memakai APD secara lengkap dan tepat. Target tercapai 100%', '1. sosialisasi tentang standar penjamah makanan terkait personal higiene. 2. sosialisasi SPO pemakaian APD. 3. monitoring ketaatan pemakaian APD. ', 'penjamah makanan yang memakai APD dengan lengkap dan benar rata-rata sebesar 78.97%. Selebihnya masih ada penjamah makanan yang memakai masker tidak menutup hidung, memakai aksesoris jilbab, cincin, arloji. ', '1.merencanakan program breefing pagi untuk penjamah makanan setiap hari. 2. sosialisasi ulang tentang SPO pemakaian APD. 3. Revisi cek list ketaatan pemakaian APD agar lebih mudah dalam proses monitoring.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(119, 9, 30, NULL, 'angka kejadian kematian bblr 1500-2500 gram < 50% dari kelahiran bblr 1500-2500 gram di rsud raa soewondo pati', '- refresh tentang penatalaksanaan bblr  kepada semua nakes di perinatal 2 bekerjasama dengan dsa - tetap usulan bidang penunjang untuk kelengkapan alat penunjang -.', '- pelatihan eksternal untuk managemen bblr belum dapat terealisasi tetap usulan diklat   - usulan alat belum dapat dipenuhi oleh penunjang', 'mengikutkan tenaga peri 2 untuk ikut iht managemen bblr di rs - usulan pelatihan ekternal selalu diajukan ke diklat - menggunakan peralatan yang ada seefisien mungkin', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
