(122, 5, 15, NULL, 'Capaian indikator emergency Respon time  kurang dari sama dengan 5 menit 100%', 'Sosialisasi ke unit kerja tentang pentingnya ketepatan emergency respon time di IGD untuk mengurangi tingkat kecacatan maupun kematian serta meningkatkan kepuasan pasien', 'Input : Pelayanan berbasis  pasien untuk meningkatkan kepuasan pasien', 'Monitoring dan evaluasi terhadap emergency respon time pasien di IGD, evaluasi hasil output', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(123, 23, 60, NULL, 'Mencapai angka kejadian reaksi transfusi 0 % , penurunan angka kejadian reaksi transfusi, meningkatkan kualitas keselamatan pasien', 'unit sudah mengumpulkan dan melaporkan data rekapitulasi kejadian reaksi transfusi dari bulan januari - maret 2019, dimana hasil capaian angka kejadian reaksi transfusi pada bulan januari yaitu 0.43 %, februari 0.58 %, maret 0.15 %', 'angka kejadian reaksi transfusi pada bulan januari - maret 2019 masih dibawah target indikator yang ditetapkan, meskipun tren angka kejadian reaksi transfusi dari bulan januari. februari dan maret mengalami peningkatan tetapi masih dibawah standart ', 'menegakkan SPO pada petugas tehnisi dan perawat, mengajukan penjadwalan rutin maintanance dan kalibrasi rutin pada alat', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(124, 23, 60, NULL, 'Mencapai angka kejadian reaksi transfusi 0 % , penurunan angka kejadian reaksi transfusi, meningkatkan kualitas keselamatan pasien', 'unit sudah mengumpulkan dan melaporkan data rekapitulasi kejadian reaksi transfusi dari bulan april - juni 2019, dimana hasil capaian angka kejadian reaksi transfusi pada bulan april yaitu 1.04 %, mei  0 %, juni 0.68 %', 'angka kejadian reaksi transfusi pada bulan april - juni 2019 menunjukkan tren yang naeik turun, dimana pada bulan april angka kejadian reaksi transfusi meningkat sampai 1.04 %, bulan mei mencapai target 0 % dan bulan juni meningkat lagi menjadi 0.68 %', 'meningkatakn penegakan pelaksanaan  SPO pada petugas tehnisi dan perawat,monitoring dan evaluasi terhadap pelayanan sesuai spo', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(125, 23, 60, NULL, 'Mencapai angka kejadian reaksi transfusi 0 % , penurunan angka kejadian reaksi transfusi, meningkatkan kualitas keselamatan pasien', 'unit sudah mengumpulkan dan melaporkan data rekapitulasi kejadian reaksi transfusi dari bulan oktober - desember 2018, dimana hasil capaian angka kejadian reaksi transfusi pada bulan oktober yaitu 0.17 %, november  0.17 %,  desember 0.4 %', 'angka kejadian reaksi transfusi pada bulan oktober - desember 2018 masih dibawah target indikator yang ditetapkan, meskipun tren angka kejadian reaksi transfusi dari bulan oktober, november dan desember mengalami peningkatan tetapi masih dibawah standart ', 'menegakkan SPO pada petugas tehnisi dan perawat, mengajukan penjadwalan rutin maintanance dan kalibrasi rutin pada alat, monitoring dan evaluasi pelayanan sesuai spo', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(126, 23, 62, NULL, 'menekan angka keterlambatan penyediaan darah pada pasien kebidanan mencapai target 0.5%', 'unit sudah mengumpulkan dan melaporkan data rekapitulasi keterlambatan penyediaan darah pada pasien kebidanan dari bulan mei - juni 2019, dimana hasil capaian angka keterlambatan penyediaan darah pada bulan  mei  11.11 %, juni 11.76 %', 'angka keterlambatan penyediaan darah pada pasien kebidanan pada bulan mei - juni 2019 masih dibawah target indikator yang ditetapkan , karena beberapa faktor yang terjadi seperti penundaan transfusi dari ruangan karena kondisi pasien yang belum stabil untuk ditransfusikan darah, pasien baru saja dipindahkan dari ruangan sebelumnya ke ruangan lain dan masih butuh observasi,  koordinasi serta edukasi untuk transfusi darah', 'menegakkan SPO pada petugas tehnisi dan perawat / bidan, meningkatkan keakuratan pencatatan rekap keterlambatan penyediaan darah dari bank darah dan ruang - ruang terkait', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(127, 33, 96, NULL, 'Kami merencanakan agar tidak ada kematian karena kasus perdarahan pada ibu hamil dan mlahirkan. Jika di temukan ada kasus perdarahan ,kami bisa menangani sehingga tidak terjadi kematian.Langkah - langkah yang akan kami laksanakan adalah melakukan pemantauan pasien perdarahan pra rujukan,mempersipkan ketenagaan dan sarana prasarana rumah sakit,penanganan pasien peradarahan sesuai dengan SOP, koordinasi dengan unit  lain sehubungan dengan ketersediaan darah ( pendonor dan PMI),', 'Kami mengamati selama periode bulan oktober sampai dengan desember ada 19 kasus perdarahan dengan jumlah kematian satu yang disebabkan karena perdarahan dengan diagnosa post SC atas indikasi plasenta previa totalis,anemi terjadi atonia uteri. dari 19 kasus yang rujukan ada 13 kasus, ,yang 6 adalah  persalinan terjadi di RS dari 19 kasus ini diadalam pemenuhan kebutuhan darah ada yang sudah siap tersedia di Bank Darah , ada yang masih perlu koordinasi dengan unit lain ( PMI dan pendonor segar)', 'hasil penagamatan kami dari kasus kematan ini kurang tepat dalam pengelolaan pasien pasca SC dengan atonia ,pengaasan yang seharusnya di ruang rawat intensif dimasukkan ke ruang nifas.dari jumlah kasus rujukan 13, ada 7 kasus yang belum maksimal dalam penaganan pra rujukan ', 'dari sarana RS untuk memfungsikan ruang RR sesuai standar, dari ketenagaan peningkatan deteksi kegaatdaruratan.ada standar /SPO penanganan pra rujukan sampai dengan rumah sakit', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(128, 26, 69, NULL, 'Memantau atau menanyakan kepada pihak yang bersangkutan, terkait sertifikat setelah mengikuti pelatihan eksternal selain itu DIklat membuat catatan kecil di setiap surat tugas beserta dokumen yang dibutuhkan jika akan diberangkatkan untuk mengikuti pelatihan eksternal.', 'Menanyakan kepada pihak yang bersangkutan setelah melakukan pendidikan dan pelatihan eksternal untuk kelengkapan sertifikat.', 'Sudah memenuhi goal measurement dalam implementasi yang telah terlaksana, Namun diharapkan lebih baik dan lebih disiplin lagi pada tahun selanjutnya.', 'Siklus dalam tiga bulan periode Oktober hingga Desember tahun 2018 berjalan dengan baik dan mengalami kenaikan pada akhir tahun. Harapannya lebih baik lagi untuk implementasi selanjutnya.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(129, 26, 69, NULL, 'Instalasi Diklat berusaha rajin memberikan catatan kecil terkait dokumen yang harus dikumpulkan setelah melakukan kegiatan pendidikan dan pelatihan eksternal yang telah terlaksana. Harapannya SDM mampu menaati dan disiplin mengumpulkan dokumen yang diminta agar indikator mutu ini dapat tercapai.', 'Selalu mengingatkan peserta (SDM) yang diberangkatkan untuk mengikuti kegiatan pendidikan dan pelatihan eksternal agar mengumpulkan dokumen yang dibutuhkan Diklat, sebagai bukti bahwa SDM tersebut telah mengikuti pelatihan dan memenuhi standar JPL yang berlaku.', 'Implementasi pada periode bulan Januari hingga Maret di deskripsikan dengan kurva turun-naik. Namun kenaikan kurva dari bulan Februari ke Maret hanya mengalami sedikit kenaikan. Jika dibandingkan dengan penurunan yang terjadi,lebih banyak penurunan daripada kenaikan dalam implementasi tiga bulan ini. ', 'Ada beberapa peserta yang tidak mengumpulkan dokumen yang harus dikumpulkan setelah pendidikan dan pelatihan eksternal, dimana Diklat sudah memberikan catatan kecil sebagai pengingat bagi peserta yang mengikuti pendidikan maupun pelatihan.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(130, 26, 69, NULL, 'Selalu mengingatkan para SDM yang diberangkatkan pendidikan dan pelatihan eksternal sehingga pemenuhan kelengkapan sertfikat dapat tercapai sesuai dengan goal mesurment yang telah ditentukan oleh Penanhggung jawab Indikator Mutu Diklat.', 'Sudah mengingatkan SDM jika selesai melakukan kegiatan pendidikan dan pelatihan eksternal untuk mengumpulkan sertifikat dan dokumen terkait lainnya sebagai bukti setiap SDM telah memenuhi standar JPL yang ditentukan.', 'Pengimplemetasian pada periode April hingga Juni menunjukan kurva yang baik dan perubahan yang signifikan jika dibandingkan tiga bulan sebelumnya. Angka penurunan lebih sedikit daripada kenaikan dimana dapat disimpulkan periode lebih baik, angka kenaikan yang terjadi pada bulan Juni bahkan mampu melebihi angka target yang ditentukan. ', 'Cukup banyak kegiatan pendidikan dan pelatihan pada bulan Juni, namun sertifikat yang terkumpul dengan jumlah SDM yang mengikuti pelatihan tidak sebanding karena angka hanya menunjukkan 85.71% belum mampu hingga 100%. Maka dapat dikatakan, ada beberapa SDM yang tidak mengumpulkan sertifikat kepada pihak Diklat.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(131, 26, 70, NULL, 'Instansi yang terkait melakukan koordinasi kepada pihak Instalasi Diklat sebagai fasilitator untuk kegiatan pendidikan dan pelatihan internal agar kegiatan tersebut dapat berjalan dengan baik.', 'Sudah melakukan koordinasi atau berkomunikasi dengan Diklat jika ingin mengadakan pelatihan internal dengan memberikan TOR atau kerangka acuan agar pihak Diklat sebagai fasilitator dapat menjalankan kegiatan dengan baik.', 'Implementasi pada periode bulan Oktober sampai Desember sudah terpenuhi pada bulan Oktober dan November. Namun untuk bulan Desember menunjukkan 0% karena memang tidak ada kegiatan pelatihan internal pada akhir tahun.', 'Sudah tercapai sesuai bahkan lebih dari goal measurement yang ditentukan, tetapi masih ada beberapa kegiatan internal yang belum terlaksana sehingga harus adanya pergeseran pada RBA Diklat 2018 ke 2019.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(132, 12, 81, NULL, 'Sosialisasi ke semua supir ambulance dan petugas ruangan untuk hasil capaian triwulan kedua 2019.', 'Hasil pencapaian bulan april sampai juni sudah 0 %.', 'Target yang ada 0 % dari bulan april sampai juni.', 'Sudah lakukan sosialisasi ke semua supir ambulance meningkatkan pelayanannya dan petugas ruangan untuk selalu melakukan koordinasi dengan supir ambulance.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(133, 12, 81, NULL, '', '', '', '', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(134, 12, 82, NULL, 'Satpam berkeliling untuk patroli keamanan secara berkelanjutan pada seluruh area yang berisiko keamanan.', 'Satpam berkeliling dengan jadwal 2 jam sekali ke area - area berisiko keamanan dan area terluar rumah sakit.', 'Buku patroli keamanan tidak selalu ditanda tangani paramedis ruangan yang dipatroli. Jadwal waktu patroli kadang - kadang masih belum dilaksanakan.', 'Buat SPO patroli keliling dan sosialisasi serta evaluasi pelaksanaannya, mendisiplinkan petugas SATPAM.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(135, 33, 96, NULL, 'Tidak ada kematian ibu hamil dan bersalin karena perdarahan di RSU. Kejadian kasus perdarahan ibu hamil dan ibu bersalin diRSU bisa teratasi. Kejadian kasus perdarahan ibu hamil dan bersalin dari rujukan selama merujuk ada pemantauan dari kedua petugas.Angka kejadian kasus perdarahan berkurang. Pengambila keputusan rujuk untuk kasus perdarahan tepat dan sudah ada stabilisasi kondisi teratasi. Harapan kami semua tim di RSU yang terkait dalam penangan kasus perdarahan siap(onsite) dan tepat waktu Semua kasus perdarahan baik dari RS dan kasus rujukan bisa teratasi. Langkah - langkah yang kami lakukan adalah petugas, sarana dan prasarana di RS mendukung dan siap. ada komunikasi, prosedur, yang sudah standart dari petugas perujuk dan RS, adanya deteksi dini dan jejaring rujukan kasus resiko tinggi yang mengancam peerdarahan, menyiapkan pendonor dalam rujukan kasus perdarahan.', 'selam bulan april sampai dengan juni ditemukan 27 kasus perdarahan dengan kematian 2 pasien. Dengan kasus rujukan 18 pasien dan 9 pasien di RS. Kematian 2 dari rujukan 1 dan 1 pasien RS. ', '1 kasus kematian karena rujukan disebabkan penanganan belum maksimal,datang sudah shock grade 3. 1 kasus kematian di RS ,koordinasi tim ada yang belum tepat waktu, kebutuhan darah tidak terpenuhi. ', 'penanganan kasus perujuk ke RSU belum maksilmal, tim RSU belum berkomitmen baik. Masih ada kendala di unit terkait sehubungan dengan penyediaan darah. Rencana untuk  lperbaikan dalam sistem penangan pra rujukan dan perbaikan sistem penanganan kegawatadaruratan ddi RS', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(136, 1, 7, NULL, 'Trimester I tahun 2019 kami melakukan sosialisasi ke semua DPJP untuk melakukan visite tepay waktu ( kurang dari jam 14.00wib)', 'Pada saat rapat bersama dengan DPJP', 'Targetnya 80% capaiannya  88% s/d 93% sehingga tercapai', 'Melakukan sosialisasi ulang dengan cara mengadakan rapat bersama DPJP', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(137, 1, 7, NULL, 'Trimester II tahun 2019 akan kami lakukan sosialisasi ulang dan pendekatan kepada DPJP yang belum patuh dan memberi semangat kepada DPJP yang patuh supaya tetap meningkatkan kinerjanya.', 'Kami mengadakan rapat mengundang DPJP untuk melakukan siaialisasi hasil analisa kepatuhan visite dokter spesiais trimester II tahun 2019', 'Target kami 80% untuk capaianya melebihi target', 'Mengagendakan rapat bulan Juli minggu I 2019', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(138, 1, 7, NULL, 'Trimester III tahun 2019 akan kami lakukan sosialisasi ulang dan pendekatan kepada DPJP yang belum patuh dan memberi semangat kepada DPJP yang patuh supaya tetap meningkatkan kinerjanya.', 'Kami mengadakan rapat mengundang DPJP untuk melakukan siaialisasi hasil analisa kepatuhan visite dokter spesiais trimester III tahun 2019', 'Target kami 80% untuk capaianya melebihi target', 'Melakukan sosialisasi ulang bulan Oktober 2019 minggu I dengan cara mengadakan rapat bersama DPJP', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(139, 19, 50, NULL, 'Untuk mewujudkan baku mutu air limbah yang selalu memenuhi baku mutu, dari instalasi sanitasi membuat jadwal pemeliharaan IPAL secara berkala dan dilakukan pemantauan proses pengolahan air limbah secara rutin.', 'Unit sudah mengumpulkan dan melaporkan data Kesesuaian Baku Mutu Limbah Cair Rumah Sakit secara berkala untuk evaluasi. Dan menyertakan hasil pemeriksaan laboratorium pengolahan limbah cair IPAL 1 dan IPAL 2 selama 3 bulan dari bulan Oktober â€“ Desember 2018 ', 'Untuk bahan pembelajaran, kami mengevaluasi hasil pemeriksaan air limbah setiap 3 bulan sekali dengan cara membuat grafik. Setelah grafik dibuat Dari hasil pemeriksaan air limbah yang dilakukan pada bulan oktober - desember 2018, dapat dilihat di grafik hasil dibulan oktober 81,25 % ada dua parameter yang tidak sesuai baku mutu. Tetapi pada bulan november hasil pemeriksaan air limbah mencapai target 100 % karena 16 parameter yang diperiksa telah memenuhi baku mutu/ standar. Hanya saja pada bulan desember terjadi penurunan dengan nilai 93,75 % disebabkan ada 1 parameter yang tidak memenuhi baku mutu atau standart.', 'Tindakan yang dilakukan untuk pemeliharaan IPAL 1 dan IPAL 2, dengan membuat jadwal pemeliharaan IPAL 1 dan IPAL 2 serta melakukan pemantauan proses pengolahan limbah cair secara rutin ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(140, 19, 50, NULL, 'Untuk mewujudkan baku mutu air limbah yang selalu memenuhi baku mutu, dari instalasi sanitasi membuat jadwal pemeliharaan IPAL secara berkala dan dilakukan pemantauan proses pengolahan air limbah secara rutin.', 'Unit sudah mengumpulkan dan melaporkan data Kesesuaian Baku Mutu Limbah Cair Rumah Sakit secara berkala untuk evaluasi. Dan menyertakan hasil pemeriksaan laboratorium pengolahan limbah cair IPAL 1 dan IPAL 2 selama 3 bulan dari bulan Januari â€“ Maret 2019', 'Untuk bahan pembelajaran, kami mengevaluasi hasil pemeriksaan air limbah setiap 3 bulan sekali dengan cara membuat grafik. Setelah grafik dibuat Dari hasil pemeriksaan air limbah yang dilakukan pada bulan Januari - Maret 2019, dapat dilihat di grafik hasil dibulan Januari 100 % dan sudah mencapai target. Tetapi pada bulan november hasil pemeriksaan air limbah melngalami penurunan dengan nilai 93,75 % karena 1 parameter yang diperiksa tidak memenuhi baku mutu/ standar. Hanya saja pada bulan desember terjadi peningkatan kembalui dengan nilai 100 % dan 16 parameter pemeriksaan air limbah telah memenuhi baku mutu/ standart.', 'Tindakan yang dilakukan untuk pemeliharaan IPAL 1 dan IPAL 2, dengan membuat jadwal pemeliharaan IPAL 1 dan IPAL 2 serta melakukan pemantauan proses pengolahan limbah cair secara rutin', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019);
