(141, 19, 50, NULL, 'Untuk mewujudkan baku mutu air limbah yang selalu memenuhi baku mutu, dari instalasi sanitasi membuat jadwal pemeliharaan IPAL secara berkala dan dilakukan pemantauan proses pengolahan air limbah secara rutin.', 'Unit sudah mengumpulkan dan melaporkan data Kesesuaian Baku Mutu Limbah Cair Rumah Sakit secara berkala untuk evaluasi. Dan menyertakan hasil pemeriksaan laboratorium pengolahan limbah cair IPAL 1 dan IPAL 2 selama 3 bulan dari bulan April â€“ Juni 2019', 'Untuk bahan pembelajaran, kami mengevaluasi hasil pemeriksaan air limbah setiap 3 bulan sekali dengan cara membuat grafik. Setelah grafik dibuat  Dari hasil pemeriksaan air limbah yang dilakukan pada bulan April - Juni 2019, dapat dilihat di grafik hasil dibulan April 81,25 % ada dua parameter yang tidak sesuai baku mutu. Tetapi pada bulan mei hasil pemeriksaan air limbah mencapai target 100 % karena 16 parameter yang diperiksa telah memenuhi baku mutu/ standar. Hanya saja pada bulan juni terjadi penurunan dengan nilai 75 % disebabkan ada 4 parameter yang tidak memenuhi baku mutu atau standart.', 'Tindakan yang dilakukan untuk pemeliharaan IPAL 1 dan IPAL 2, dengan membuat jadwal pemeliharaan IPAL 1 dan IPAL 2 serta melakukan pemantauan proses pengolahan limbah cair secara rutin', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(142, 33, 31, NULL, '', '', '', '', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(143, 33, 31, NULL, 'angka kejadia tidak dilakuikan IMD pada bayi baru lahir berkurang dengan cara setiap bayi baru lahir sehat dalam waktu setengah sampai 1 jam diletakkan didada ibu untuk melakukan kontak kulit. sehingga angka kesakitan dan kematian bayi baru lahir turun..Langkah - langkah yang kami lakukan adalah melakukan koordinasi dengan unit lain (kamar operasi ) agar IMD bisa berjalan di IBS,adanya edukasi pada ibu hamil dan pra nikah agar ibu siap dalam menyusui,yang dilakukan pada saat ANC di bidan desa atau dokter kandungan, adanya bidan /perawat yang siap melakukan edukasi /konselor ASI pada saat persalinan,.dukungan dari manajemen sehingga pelaksanaan IMD di kamar operasi bisa terlaksana', 'dilakukan pengamatan pada bulan oktober sampai dengan desember 2018. tim melakukan pengamatan pada bayi lahir sehat yang lahir di Ruang Kamar Bersalin, IGD Ponek dan Kamar Operasi. Pengamatan dilakukan mulai dari adanya persetujuan sebagai bukti kesiapan ibu dalam melakukan IMD sampai dengan 1 jam setelah bayi lahir berada di atas dada ibu.', 'Pengamatan yang dilakukan pada bulan oktober sampai dengan desember 2018 ditemukan angka 504 bayi lahir sehat dengan 22 bayi tidak dilakukan IMD. pada bulan november 2018 bayi tidak dilakukan IMD ada 11 bayi dari 169 kelahiran bayi tidak ada masalah kesehatan. 11 bayi tersebut antara lain karena 6 bayi dengan ibu HBsAG + dan HIV +,,2 karena adanya kegawataan pada ibu, sisanya karena ibunya tidak mau dilakukan IMD', 'Rencana yang sudah dilakukan belum sepenuhnya efektif karena masih banyak ditemukan ibu tidak mau melakukan IMD padahal kondis ibu dan bayi tidak ada masalah.sehingga perlu peningkatan komitmen edukasi ibu mulai dari masa pra nikah,hamil dan selama persalinan.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(144, 33, 31, NULL, 'jumlah bayi tidak dilakukan IMD pada bayi baru lahir berkurang sehingga dibawah standar.dengan cara bayi diletakkan diatas perut dan dada ibu setengah jam setelah lahir. sehingga angka kesakitan dan angka kematian bayi dapat menurun. langkah - langkah yang akan kami lakukan adalah melakukan koordinasi dengan unit lain terutama kamar operasi agar IMD dikamar operasi bisa dilaksanakan, melakukan koordinasi dengan lini terdepan tenaga kesehatan yaitu di desa dan praktek swasta agar melakukan edukasi tentang ASI Eksklusif,pada masa pralaktal,,peningkatan komitmen petugas RS agar melakukan IMD dan edukasi tentang ASI Eksklusif, Koordinasi dengan penunjang agar terpenuhinya sarana dan prasarana RS yang mendukung Laktasi yaitu adanya klinik laktasi', 'dilakukan pengamatan pada bulan januari sampai dengan maret 2019. pengamatan dilakukan oleh tim dari ruangna masing masing. pengamatan dilakukan mulai edukasi sebelum persalinan sampai dengan nempelnya bayi baru lahir didada ibu.pengamatan dilakukan di kamar bersalin, diigd poenk dan di kamar operasi.', 'dari hasil pengamatamn yang dilakukan pada bulan januari sampai dengan maret didapatkan jumlah kelahiran dengan bayi tidak ada masalah kesehatan 768 dengan angka kejadian tidak dilakukan nya IMD ada 47 bayi. pada bulan januari dan februari angka tidak dilakukannya IMD tinggi melebihi rata - rata dikarenakan banyaknya kasus kegawatan pada ibu dan dan ibu dengan HbSAg + atau HIV +.. tidak ada ibu yang menolak untuk dilakukan IMD', 'perubahan yang dilakukan sesuai langkah - langhkah diatas sudah terlaksana dengan bailk.. bila masih ada kejadian tidak dilakukannya IMD karena penyebab kegawatan diluar kendali dari tim karena bersifat situasional.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(145, 33, 31, NULL, 'jumlah bayi tidak dilkakukan IMD pada bayi baru lahir berkurang sehingga dibawah standar dengan cara bayi diletakkan diatas perut dan dada ibu setengah jam setelah lahir , sehingga angka kesakitan dan kematian bayi dapat menurun. Langkah - langkah yang akan kami lakukan adalah melakukan koordinasi dengan unit lain terutama kamr Operasi agar IMD dikamar operasi bisa dilaksanakan ., melakukan koordinasi dengan lini terdepan tenaga kesehatan yaitu didesa dan praktek swasta agar melakukan edukasi tentang ASI Eksklusif pada saat masa pralaktal. peningkatan komitmen petugas RS agar melakukan IMD dan edukasi tentang ASI Eksklusif . koordinasi dengan penunjang agar terpenuhinya sarana dan prasarana RS yang mendukung Laktasi yaitu klinik laktasi', 'dilakukan penagamatan pada bulan april sampai dengan juni 2019. pengamatan dilakukan oleh tim dari ruangan masing - masing , pengamatan dilakukan mulai edsukasi sebelum persalinan sampai dengan nemnpeelnya bayi baru lahir di dada ibu . pengamatan dilakukan dikamar bersalin ,igd ponek dan kamar operasi', 'dari hasil pengamatan yang dilakukan pada bulan april sampai dengan bulan juni 2019 didsapatkan jumlah kelahiran dengna tidak ada masalah kesehetan ada 740 dengan angka kejadian tidak dilakukannya IMD pada bayi baru lahir ada 62 bayi. paling banyak tidak dilakukannya IMD pada bulan mei yaitu 27 dari 268 .. penyebabnya adalah karena banyaknya kasus kegawatan yang terjadi pada ibu dan ibu dengan penyakit menular . ada 2 ibu yang menolak untuk melakukan iMD karena kurangnya pengetahuan ibu tentang IMD ( (bu merasa risih )', 'usaha yang dilakukan ada yang belum terealisasi yaitu belum adanya komimen dari manajemen untuk pelaksanaan edukasi pralaktal yaitu belum adanya klinik laktasi dan edukasi yang dilakukan di lini terdepan yaitu pada saat ANC di bidan atau dokter praktek swasta sewhingga ibu tidak paham pentingnya IMD (ibu jijik bayinya ditaruh didada)', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(146, 8, 26, NULL, 'TW 1 Mengupayakan tidak terjadi kesalahan setting', 'Monitoring tindakan setting dalam program HD', 'Berdasarkan hasil monitoring selama 3 bulan tidak pernah terjadi kesalahan setting dalam program HD', 'Sosialisasi secara berkala SPO persiapan HD atau mesin', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(147, 8, 27, NULL, 'Pertahankan supaya tidak terjadi insiden ketidaktepatan insersi vena dan arteri pada pasien hemodialisa untuk tri wulan yang akan datang', 'Semua perawat hemodialisa mahir dalam melakukan tindakan insersi vena dan arteri pada pasien hemodialisa sesuai SPO', 'Meningkatan kertampilan akses vaskuler perawat hemodialisa melalui pelatihan', 'Mempertahankan target insiden ketidak tepatan insersi vena dan arteri pada pasien hemodialisa untuk semester yang akan datang', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(148, 8, 29, NULL, 'Pertahankan target insiden kegagalan pemasangan Kateter Doubel Lumen di IBS untuk tri wulan yang akan datang', 'Dokter Spesialis Anastesi dan Tim IBS dalam pemasangan CDL sesuai SPO', 'Melakukan evaluasi terhadap pasien yang gagal di lakukan pemasangan CDL karena kegagalan pemasangan CDL berpengaruh terhadap pelaksanaan program HD ke pasien', 'Mempertahankan target insiden kegagalan pemasangan CDL di IBS untuk tri wulan yang akan datang', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(149, 26, 70, NULL, 'Instalasi yang akan melaksanakan kegiatan Internal sudah melakukan koordinasi baik dengan Instalasi Diklat sehingga Diklat sebagai fasilitator dapat memfasilitasi kegiatan dengan baik. ', 'Implementasi Diklat sudah menjalankan tugas fasilitator sudah baik, melakukan komunikasi dengan unit/instalasi serta mengumpulkan TOR terkait kegiatan internal kepada Diklat sebelum pelatihan terlaksana. ', 'Dengan kepatuhan unit/instalasi terkait mengumpulkan TOR sebelum kegiatan. Maka dari itu, kegiatan akan berjalan teratur dan baik sesuai dengan rundown yang telah dituangkan di dalam TOR kegiatan.', 'Pada bulan Januari hingga Maret, belum banyak kegiatan yang terlaksana, namun pada bulan Maret telah terlaksana beberapa kegiatan internal, untuk TOR kegiatan sudah terpenuhi ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(150, 33, 107, NULL, 'Kami merencanakan untuk mengurangi jumlah kematian bayi yang lahir di RSUD RAA Soewondo Pati dengan cara mengurangi kejadian infeksi /sepsis sehingga angka kematian pada bayi baru lahir sangat rendah karena sepsis berkurang  langkah -langkah yang akan kami lakukan adalah melakukan kolaborasi dengan bidan atau dokter praktek swasta untuk melakukan edukasi tentang kehamilan pada saat ANC,petugas rumah sakit patuh dalam melakukan kebersihan tangan dalam 5 momen, melakukan tindakan infasif sesuai dengan tehnik septik,melakukan edukasi refresh  tentang keberihan tangan (PPI) kepada petugas,,koordinasi dengan penunjang dan pelayanan untuk memperbaiki ruangan perinatal agar sesuai standar.', 'melakukan pengamatan selama bulan oktober sampai dengan november 2018. pengamatan dilakukan pada semua bayi yang lahir hidup di RSUD RAA Soewondo Pati. Bila meninggal di RSUD RAA Soewondo Pati maka mencari penyebab kematiannnya ', 'hasil dari pengamatan yang dilakukan selama bulan oktober sampai dengan november 2018 didapatkan jumlah kematian 13 bayi dengan jumlah bay lahir hidup di RSUD RAA Soewondo pati 736 bayi.dari data diatas kematian bayi terbesar disebabkan karena bayi lahir dengan berat badan sangat rendah dan selama perawatan semakin memburuk karena disebabkan sepsis.. ', 'usaha yang telah dilakukan belum optimal karena masih ada bayi meninggal BBLSR karena sepsis. blm ada perubahan tata ruang perinatal level 2,masih terkesan semwarut,,petugas belum patuh dalam melakukan kebersihan tangan.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(151, 33, 107, NULL, 'mengurangi angka kematian bayi dengan cara mengurangi angka kelahiran bayi lahir sangat rendah . langkah - langkah yang akan dilakukan adalah melakukan koordinasi dengan bidan atau dokter praktek swasta untuk melakukan edukasi tentang kehamilan, melakukan koordinasi dengan bidang pelayanan dan penunjang untuk melengkapi sarana dan prasarana yang belum sesuai standart, meningkatkan pengetahuan dan ketrampilan petugas dalam melakukan perawatan bayi baru lahir dengan berat sangat rendah, melakukan edukasi ulang ttg PPI, meningkatkan komitmen kepatuhan petugas dalam melakukan tindakan sesuai dengan standart aseptik dan septik', 'pengamatan dilakukan mulai bulan januari sampai dengan maret 2019. data yang diambil adalah semua bayi yang lahir hidup dirumah sakit dan bayi yang lahir kemudian meninggal di RS. ruang lingkup pengamatan mulai dari igd ponek, kamar bersalin, ruang nifas, ruang perinatal loevel 1 dan level 2, dan NICU..bila ditemukan kematian maka akan dilakukan AMP dan dicari penyebab kematian. ', 'dari hasil pengamatan bulan januari sampai dengan maret 2019, didapatkan angka kematian tertinggi pada bulan maret 2019, ini dikarenakan jumlah kelahiran juga banyak sehingga pasien rujukan dengan ibu hamil kurang bulan yang akan melahirkan di RS juga banyak. dari pengamatan petugas sudah melakukan tindakan sesuai standar septik dan aseptik.', 'langkah -langkah yang dilakukan sudah efektif sehingga angka kematian bayi dibawah target, sehingga bisa dilanjutkan untuk penatalaksanaan periode berikutnya.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(152, 19, 51, NULL, 'Membuat jadwal petugas pengambilan sampah infeksius dan membuat log book untuk pencatatan jumlah limbah setiap ruangan. Agar pengambilan limbah infeksius dari ruangan selalu dilakukan sesuai jadwal dan volume limbah yang masuk ke TPS B3 selalu terkontrol.', 'Unit sudah mengumpulkan dan melaporkan data penyimpanan B3 secara berkala untuk evaluasi. Dan menyertakan jumlah volume limbah setiap bulannya.', 'Dapat dilihat dari grafik diatas, untuk penyimpanan limbah B3 selalu memenuhi target dan mencapai 100% karena semua limbah yang dihasilkan ruangan rawat inap, rawat jalan  dan semua instalasi setiap hari selalu masuk ke TPS B3.', 'Setiap hari petugas pengambilan sampah infeksius sudah melakukan pengambilan sampah infeksius ke setiap ruangan di RSUD RAA Soewondo, dan selalu melaporkan jumlah volume sampah infeksius yang tersimpan diTPS B3 setiap bulannya.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(153, 19, 51, NULL, 'Membuat jadwal petugas pengambilan sampah infeksius dan membuat log book untuk pencatatan jumlah limbah setiap ruangan. Agar pengambilan limbah infeksius dari ruangan selalu dilakukan sesuai jadwal dan volume limbah yang masuk ke TPS B3 selalu terkontrol.', 'Unit sudah mengumpulkan dan melaporkan data penyimpanan B3 secara berkala untuk evaluasi. Dan menyertakan jumlah volume limbah setiap bulannya.', 'Dapat dilihat dari grafik diatas, untuk penyimpanan limbah B3 selalu memenuhi target dan mencapai 100% karena semua limbah yang dihasilkan ruangan rawat inap, rawat jalan  dan semua instalasi setiap hari selalu masuk ke TPS B3.', 'Setiap hari petugas pengambilan sampah infeksius sudah melakukan pengambilan sampah infeksius ke setiap ruangan di RSUD RAA Soewondo, dan selalu melaporkan jumlah volume sampah infeksius yang tersimpan diTPS B3 setiap bulannya.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(154, 2, 6, NULL, 'Mengetaahui angka ketetapan waktu tumggu rawat jalan â‰¤ 60 menit, sesuai target 100%', '- Melakukan sosialisasi tentang waktu tunggu rawat jalan  â‰¤ 60 menit, ,\r\n- Memberikan motivasi pada doker spesialis untuk melakukan waktu tunggu rawat jalan   60 menit, \r\n-Memonitoring dan mengevaluasi tentang pelaksanaan waktuunggu rawat jalan    60 menit', '- Capaian dari pelaksanaan waktu tunggu rawat jalan   â‰¤ 60 menit bulan Januari 79,17 %,Februari 82,61 %, Maret 75,00 % sedangkan rata rata mencapai 78,93 %', '- Sosialisasi tentang waktu tunggu rawat jalan  â‰¤ 60 menit , \r\n- Supervisi pelaksanaan waktu tunggu rawat jalan  â‰¤ 60 menit', '2020-01-09 02:07:27', '2020-01-19 18:31:36', 0, 0, 2019),
(155, 33, 107, NULL, 'mengurangi angka kematian bayi dengan cara mengurangi angka kelahiran bayi baru lahir sangat rendah. langkah - langkah yang akan dilakukan adalah melakukan koordinasi dengan bidan atau dokter prakrtek swasta untuk melakukan edukasi tentang kehamilan. melaukan kordinasi dengan bidang pelayanan dan penunjang untuk melengkapi sarana dan prasarana yang belum sesuai standart. meningkatkan pengetahuan dan ketrampilan petugas dalam melakukan perawatan bayi baru lahir dengan berat sangat rendah , melakukan edukasi ulang ttg PPI, meningkatkan komitmen kepatuhjan petugas dalam melakukan tindakan sesuai standart aspetik dan septik.', 'pengamatan dilakukan mulai bulan april sampai dengan juni 2019 ,data yang diambil adalah semua bayi yang lahir hidup di rumah sakit dan bayi yang lahir hidup kemudian meninggal selama perawatan di RS> ruang lingkup pengamatan mulai dari igd ponek, kamar bersalin, ruang nifas, perinatal level 1 dan level 2. dan NICU. bila ditemukan kematian maka akan dicari penyebabnya. ', 'dari hasil pengamatan bulan april sampai dengan juni 2019,. didapatkan jumlah kematian bayi 12 bayi dengan jumlah kelahiran hidup ada 783. angka yang didapat dibawah target. bayi yang meninggal beralih buka karena BBLSR tapi ada sebagian karena asfiksi berat.', 'langkah - langkah yang dilakukan sudah efektif sehingga angka kematian bayi dibawah target. tgapi penyebab kematian sudah beralih asfiksia berat. maka untuk pdsa berikutnya akan disesuaikan dengan penyebab kematiannya.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(156, 19, 52, NULL, 'Untuk mewujudkan pemeriksaan air bersih yang selalu memenuhi baku mutu, kami dari tim mengumpulkan data kesesuaian baku mutu air bersih secara bakteriologi, Melakukan rekapitulasi data yang terkumpul, dan membuat jadwal pemeriksaan air bersih secara bakteriologi ', ' Unit sudah mengumpulkan dan melaporkan data Kesesuaian Baku Mutu air bersih secara berkala untuk evaluasi. Dan menyertakan hasil pemeriksaan laboratorium air bersih secara bakteriologi selama 3 bulan dari bulan Oktober â€“ Desember 2018', 'Dapat dilihat dari grafik diatas, untuk kesesuaian baku mutu air bersih bakteriologi selalu memenuhi target dan mencapai 100% karena semua parameter pemeriksaan air bersih secara bakteriologi selalu memenuhi baku mutu / standart.', 'Melakukan pengambilan sampel air bersih 1 bulan sekali sesuai jadwal dan mengirim sampel ke laboratorium untuk dilakukan pemeriksaan secara bakteriologi', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
