(159, 19, 51, NULL, 'Membuat jadwal petugas pengambilan sampah infeksius dan membuat log book untuk pencatatan jumlah limbah setiap ruangan. Agar pengambilan limbah infeksius dari ruangan selalu dilakukan sesuai jadwal dan volume limbah yang masuk ke TPS B3 selalu terkontrol.', 'Unit sudah mengumpulkan dan melaporkan data penyimpanan B3 secara berkala untuk evaluasi. Dan menyertakan jumlah volume limbah setiap bulannya.', 'Dapat dilihat dari grafik diatas, untuk penyimpanan limbah B3 selalu memenuhi target dan mencapai 100% karena semua limbah yang dihasilkan ruangan rawat inap, rawat jalan  dan semua instalasi setiap hari selalu masuk ke TPS B3.', 'Setiap hari petugas pengambilan sampah infeksius sudah melakukan pengambilan sampah infeksius ke setiap ruangan di RSUD RAA Soewondo, dan selalu melaporkan jumlah volume sampah infeksius yang tersimpan diTPS B3 setiap bulannya.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(160, 33, 96, NULL, 'jumlah kematian ibu karena perdarahan berkurang atau tidak terjadi.. dengan  penanganan perdarahan secara tapat..langkah - langkah yang dilakukan adalah adanya pemantauan dari kedua perujuk pada saat prarujukan,dan selama rujukan. koordinasi dengan PPTK 1 dan bidan atau dokter praktek swasta untuk melakukan bimbingan sehingga pengambilan keputusan rujuk untuk kasus perdarahan tepat.dan sudah ada stabilisasi, koordinasi dengan penunjang untuk mencukupi sarana dan prasarana RS sehingga sesuai standart, koordinasi dengan bidang pelayanan untuk menyiapkan SPO tindakan penanganan perdarahan , melakukan koordinasi dengan unit lain kamar operasi sehingga petugas bisa onsite,, menyiapkan pendonor dalam rujukan kasus perdarahan.', 'pengamatan dilakukan pada bulan april sampai juni 2019 , data yang diambil adalah semua ibu yang mengalami perdarahan baik pada saat hamil, bersalin atau nifas. dan mendata ibu yang meninggal karena perdarahan kemudian melakukan AMP untuk mencari penyebab kematian karena perdarahannya', 'hasil pengamatan mulai bulan april sampai dengan juni 2019 didapatkan jumlah ibu meninggal karena perdarahan ada 2. terjadi pada bulan mei 1 dan bulan juni 1. pada bulan mei karena rujukan sudah terlambat,pasien datang sudah kondisi shok grade 3, kemudian untuk bulan juni pasien melahirka di RS dengan laserasi servik kemudian atonia, dan pasien menunggu lama untuk memenuhi kebutuhan darah.', 'langkah - langkah yang diambil belum bisa optimal, karena masih ada ibu meninggal karena perdarahan. masih ada kendala dalam kesiapan petugas kamar operasi dan penyediaan darah bila dibutuhkan untuk transfusi. langkah - langkah yang diambil akan dilanjutkan untuk perfode berikutnay karena hasil yang didapat belum optimal.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(161, 19, 53, NULL, 'Untuk mewujudkan kesesuaian pemeriksaan angka kuman kamar operasi dengan standart baku mutu, kami dari tim mengumpulkan data hasil pemeriksaan angka kuman kamar operasi, Melakukan rekapitulasi data yang terkumpul, dan membuat jadwal pemeriksaan angka kuman kamar operasi setiap 6 bulan sekali.', 'Unit sudah mengumpulkan dan melaporkan data hasil pemeriksaan angka kuman kamar operasi secara berkala untuk evaluasi. Dan menyertakan hasil pemeriksaan laboratorium angka kuman selama 6 bulan sekali dari bulan Juli â€“ Desember 2018', 'Data kesesuaian hasil pemeriksaan angka kuman di kamar operasi pada bulan november tidak memenuhi target, dapat dilihat di grafik angka realisasinya mencapai 0 % karena dari seluruh kamar operasi di IBS yang dilakukan pemeriksaan hasilnya tidak memenuhi standart baku mutu.', 'Melakukan pengambilan sampel udara untuk pemeriksaan angka kuman di kamar operasi IBS oleh petugas laboratorium kesehatan jawa tengah sesuai jadwal yang sudah di tentukan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(162, 19, 53, NULL, 'Untuk mewujudkan kesesuaian pemeriksaan angka kuman kamar operasi dengan standart baku mutu, kami dari tim mengumpulkan data hasil pemeriksaan angka kuman kamar operasi, Melakukan rekapitulasi data yang terkumpul, dan membuat jadwal pemeriksaan angka kuman kamar operasi setiap 6 bulan sekali.', 'Unit sudah mengumpulkan dan melaporkan data hasil pemeriksaan angka kuman kamar operasi secara berkala untuk evaluasi. Dan menyertakan hasil pemeriksaan laboratorium angka kuman selama 6 bulan sekali dari bulan Januari â€“ juni 2019', 'Data kesesuaian hasil pemeriksaan angka kuman di kamar operasi pada bulan juni memenuhi target, dapat dilihat di grafik angka realisasinya mencapai 100 % karena dari seluruh kamar operasi di IBS yang dilakukan pemeriksaan hasilnya memenuhi standart baku mutu.', 'Melakukan pengambilan sampel udara untuk pemeriksaan angka kuman di kamar operasi IBS oleh petugas laboratorium kesehatan jawa tengah sesuai jadwal yang sudah di tentukan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(163, 2, 6, NULL, 'Mengetahui angka waktu tunggu rawat jalanâ‰¤ 60 menit', '- Melaporkan ke bidang pelayanan tentang hasil waktu tunggu di rawat jalan,  \r\n- Memberikan motivasi pada doter spesialis untuk melakukan waktu tunggu kurang dari 60 menit,   \r\n- Mengevaluasi dan memonitoring pelaksanaan waktu tunggu   60 menit', '- Capaian dari pelaksanaan waktu tunggu rawat jalan  â‰¤  60 menit bulan April,86,29 % Mei 85 %,, Juni 83,33 % sedangkan rata rata capaian 84,87', '- Sosialisasi tentang waktu tunggu rawat jalan   60 menit , - Supervisi pelaksanaan waktu tunggu rawat jalan   60 menit', '2020-01-09 02:07:27', '2020-01-19 18:31:52', 0, 0, 2019),
(164, 33, 97, NULL, 'mengurangi jumlah ibu meninggal karena kasus eklamsi. dengan cara melakukan penanganan yang tepat bila ditemukan kasus eklamsia. langkah - langkah yang dilakukan adalah melakukan koordinasi dengan dinas untuk melakukan bimbingan ke PPTK 1 dalam pengelolaan kejang eklamsi, melakukan koordinasi dengan dinas untuk melakukan skrening dan deteksi awal resiko tinggi kehamilan, melakukan edukasi di klinik kandungan pada saat ANC trentang resiko tinggi kehamilan, melakukan prosedural ANC dengan 10 T, ,melakukan koordinasi dengan penunjang untuk menyiapkan  alat dan sarana yang sesuai standar penanganan eklamsi, koordinasi dengan pelayanan untuk menyiapkan prosedur penatalaksanaan kejang ekilamsi', 'akan dilakukan pengamatan bulan oktober sampai dengan desember 2019, yang diamati adalah semua pasien hamil,, bersalin dan nifas yang mengalami kejang eklamsi. ruang lingkup pengamatan semua ruangan di unit PONEK.', 'hasil dari pengamatan mulan bulan oktober sampai bulan desember 2018. didapatkan tidak ada pasien yang meninggal karena kejang eklamsi dengan jumlahb pasien eklamsib pada bulan oktober sampai dengan desember sejumlah 4 pasien.', 'langkah- langkah yang telah diolakukan sudah optimal ada beberapa yang perlu untuk ditindaklanjuti pada periode berikutnya.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(165, 33, 97, NULL, 'jumlah ibu yang meningal karena eklamsi tidak ada dan berkurang,dengan cara melakukan penanganan kejang ewklamsi secara tepat atau sesuai dengan standart.langkah - langkah yang kami lakukan adalah melakukan koordinasi dengan dinas untuk melakukan bimbingan kepada PPTK 1 dan bidan praktek swasta dalam menangani kejang eklamsi, melakukan kerjasama dengan dinas dalam melakukan skrening dan deteksi resiko tinggi kehamilan, melakukan koordinasi dengan penunjang untuk menyiapkan alat dan sarana yang sesuai dengan standar,melakukan koordsinasi dengan pelayanan untuk menyiapkan prosedur penanganan eklamsi secara tepat, meningkatkan skill kompetensi petugas dalam menangani kejang eklamsi', 'pengamatan dilakukan bulan januari sampai dengan maret 2019. yang diamati adalah semua ibu hamil, bersalin, nifas dengan kejang eklamsi. ruang lingkup pengamatan adalah semua ruang di unit PONEK. bila ditemukan kematian karena eklamsi maka akan dicari penyebab atau latar belakang kenapa kasus eklamsi bisa meninggal. ', 'hasil pengamatan pada bulan januari sampai dengan maret 2019 didapatkan tidak ada kematian dengan jumlah ibu eklamsi 3 pasien. maka grafik tidak melebihi target.', 'langkah - langkah yang dilakukan sudah optimal, tapi ada beberapa langkah yang belum optimal dan akan dilanjutkan untuk periode berikutnya', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(166, 33, 97, NULL, 'jumlah ibu yang meninggal karen eklamsi tidak ada berkurang ,dengan cara melakukan penanganan kejang eklamsi secar tepat  atau sesuai dengan standar.. langkah - langkah yang kami lakukan adalah melakukan koordinasi dengan dinas untuk melkaukan bimbingan kepad PPTK ! dan bidan praktek swasta dalam menangani kejang eklamsi,melakukan kerjasama dengan dinas dalam melakukan skrening dan deteksi resiko tinggi kehamilan, melakukan koordinasi dengan penunjang untuk ,memnyiapkan alat dan sarana yang sesuai dengan standar, melakukan koordinasi dengan pelayanan untuk menyiapkan prosedur penanganan eklamsi secara tepat, meningkatkan skill kompetensi petugasa dalam menangani kejang eklamsi.', 'pengamatan dilakukanb bulan april sampai dengan bulan juni 2019 yang diamati adalah semua ibu hamil, bersalin, nifas kejang eklamsi. ruang lingkup penagmatan adalah semua ruangan di unit PONEK. bila ditemukan kemartian karena aklamsi maka akan dicari penyebab atau latar belakang kenapa kasus ekamlsi terjadi', 'hasil pengamatan pada bulan april sampai dengan juni 2019 maka ditemukan 1 meninggal karena kejang eklamsi. pasien adalah pasien rujukan datang kondisi sudah memburuk. dilakukan penatalaksanaan bantuan hidup tidak bisa menolong', 'langkah - langkah yang dilakukan sudah optimal untuk penatalaksanaan di RS, untuk penanganan di praryjukan perlu untuk dikoordinasikan lagi, sehingga pasien rujukan datang sudah stabil atau kondisi terpantau.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
