(181, 25, 64, NULL, 'tingkat kepatuhan pengisian papan code red 100%', 'sosialisai tentang pentingnya  kepatuhan pengisian papan code red', 'Tingkat kepatuhan pengisian papan code red untuk Triwulan I periode Januari-Maret 2019 diperoleh hasil 64.21 % dibandingkan dengan bulan Januari yang mencapai 56.32% . rata-rata kepatuhan pengisian papan code red untuk triwulan I adalah 59.47% dan hasil tersebut masih jauh dari target yang direncanakan yaitu 100%. ', 'tetap melakukan monitoring ke semua unit kerja tiap bulan dan membuat laporan bulanan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(182, 25, 64, NULL, 'tingkat kepatuhan pengisian papan code red 100%', 'sosialisai tentang pentingnya  kepatuhan pengisian papan code red', 'kepatuhan pengisian papan Code Red untuk Triwulan III ( Juli-September 2019) mengalami penurunan dari 43.68 % pada bulan Juli turun menjadi 40.53% pada bulan September 2019. rata-rata pengisian kepatuhan papan code red selama triwulan III 2019 sebesar 42.28%, ini jauh masih dari target yang direncanakanan yaitu sebesar 100%. dari hasil tersebut tim K3 tetap melakukan sosialisasi pentingnya kepatuhan pengisian papan code red dan monitoring ke semua unit kerja tiap bulan dan membuat laporan bulanan.', 'tetap melakukan monitoring ke semua unit kerja tiap bulan dan membuat laporan bulanan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
