(185, 25, 66, NULL, 'Menimalisir kecelakaan kerja sampai 0%', 'Sosialisasi Kesehatan dan Keselamatan Kerja (K3) ke semua staff Rumah Sakit yang dilakukan setiap bulan sekali', 'untuk capaian kecelakaan kerja karyawan RSUD RAA Soewondo Pati Triwulan III (Juli-September 2019) tidak terjadi kecelakaan atau 0%. Hasil tersebut sesuai dengan target yang direncanakan yaitu 0% . ', 'Tetap melakukan monitoring K3 ke semua unit kerja setiap bulan sekali, menerapkan Regulasi K3 di Rumah Sakit, Melaporkan kecelakaan kerja ke Direktur dan menindaklanjuti Disposisi Direktur', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(186, 25, 67, NULL, 'meminimalisir Tumpahan B3 ke semua unit kerja sebesar 0%', 'sosialisasi tentang pentingnya bahaya Tumpahan B3 terhadap karyawan, pengunjung dan Pasien Rumah Sakit.', 'hasil capaian penanganan Tumpahan B3 untuk Triwulan III (Juli-September 2019) tidak terjadi tumpahan atau 0% sesuai target yang direncanakan yaitu 0%. ', 'tetap melakukan monitoring ke semua unit kerja tiap bulan dan membuat laporan bulanan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(187, 12, 81, NULL, 'Sosialisasi ke semua supir ambulance dan petugas ruangan untuk hasil capaian tri wulan ke tiga 2019. ', 'Hasil pencapaian bulan juli sampai september sudah 0 %.', 'Target yang ada 0 % dari bulan juli sampai september.', 'Sudah lakukan sosialisasi ke semua supir ambulance meningkatkan pelayanannya, dan petugas ruangan untuk selalu melakukan koordinasi dengan supir ambulance.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(188, 33, 31, NULL, 'jumlah bayi tidak dilakukan IMD pada bayi baru lahir berkurang sehingga dibawah standar dengan cara bayi diletakkan diatas perur dan dada ibu setengag jam setelah lahir , sehingga angka kesakitan dan kematian bayi dapat menurun. Langkah - langkah yang akan kami lakukan adalah melakukan koordinasi dengan lini terdepan yaitu bidan atau dokter praktek swasta agar melakukan edukasi tentang IMD dan ASI EKsklusif . koordinasi dengan penunjang dan pelayanan agar klinik laktasi segera berfungsi untuk melakukan edukasi ASI pada masa pralaktal, melakukan sosialisasi dan IHT tentang IMD dan ASI Eksklusif pada petugas RS, meningkatkan komitmen petugas RS untuk melakukan edukasi dan IMD pada pasien sebelum melahirkan dan IMD pada saat kala II', 'dilakukan pengamatan pada bulan juli sampai dengan september 2019 ,dilakukan oleh petugas yang ditunjuk oleh masing - masing ruangan. pengamatan dimulai sejak dilakukannya edukasi sebelum persalinan ,bayi menempel pada dada ibu sampai dengan bayi menempel kurang lebih 1 jam.. Pengamatan dilakukan dikamra operasi, igd PONEK, dan kamar operasi', 'dari hasil pengamatan yang dilakukan pada bulan juli sampai dengan september 2019 didapatkan jumlah kelahiran dengan tidak ada masalah kesehatan ada  423 bayi dengan angka kejadian tidak dilakukannya IMD pada  bayi baru lahir ada 15 5 bayi. hasil yang didapat menurut grafik maka trendnya adlah menurun ini berarti sudah ada kesadran baik dari petugas maupun ibu bayi untuk melakukan IMD', 'usaha yang dilakukan sesuai langkah - langkah pada periode ini membawa hasil yang baik,,sehingga langkah ini bisa untuk dilanjutkan ke periode berikutnya.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
