(191, 5, 15, NULL, 'Emergency Respon Time ( waktu tanggap pelayanan gawat darurat < 5 mnt ) capaian 100 % dapat tercapai pada tahun 2019', 'Meningkatkan skill dan pengetahuan baik perawat maupun dokterIGD dalam bentuk simposium, IHT ataupun pelatihan tentang triage, skrining maupun penanganan pasien di ruang gawat darurat sehingga dapat meningkatkan capaian waktu tanggap pelayanan di IGD sehingga akan mememinimalkan tingkat kecacatan bahkan kematian pasien serta meningkatkan kepuasan pasien', 'rata rata capaian waktu tanggap pelayanan gawat darurat 92,07% ', 'Petugas jaga di ruang triage harus selalu standby, sosialiosasi ulang tentang triage kepada seluiruh staf IGD,Breafing harian pada saat konferen di setiap shift .Bila pagi oleh karu atau katim, sore dan malam hari oleh kepala jaga.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
