(193, 7, 23, NULL, 'Waktu distribusi hasil pemeriksaan laborat Kamar Bersalin tertib ( pada waktu operan jaga hasil laborat sudah ada ).', 'Ada SPO dari pelayanan tentang pemeriksaan laborat dan pemberitahuan / pengambilan hasil laborat terutama pasien Obsgyn. 2. Semua petugas jaga patuh SPO sehingga pada waktu operan jaga hasil laborat sudah ada. 3. Ada data pasien yang pengiriman sampel laborat 7 - 10 jam hasil belum jadi atau belum ada. 4. Belum semua petugas Kamar Bersalin mengetahui indikator mutu ini.', ' Petugas jaga kurang paham fungsi hasil laborat dalam menegakkan diagnosa, fokusnya diagnosa kebidanan cuma hasil pemeriksaan kebidanan. 2. Petugas IKB dan petugas laborat belum patuh SPO.', '1. Terealisasinya SPO dari pelayanan. 2. Meningkatkan kinerja / kerja sama antara petugas IKB dan petugas laborat. 3. Meningkatkan kwalitas bidan untuk membuat diagnosa kebidanan / assesment kebidanan sudah ada data penunjang. 4. Sosialisasi dari PIC ruangan kepada semua anggota Kamar Bersalin.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(194, 32, 94, NULL, 'Mencapai kepatuhan petugas dalam melakukan penandaan (Marking) dalam proses pembedahan 100%.', 'Pelatihan tenaga medis. Monitoring dan evaluasi prosedur penandaan pada pasien yang akan dilakukan operasi.', 'Input : Kurangnya kepatuhan petugas dalam melakukan penandaan dalam proses operasi. Proses : Pelatihan tenaga medis. Output : Tepat lokasi, tepat prosedur, tepat pasien yang akan dilakukan operasi.', 'Monitoring dan evaluasi kepatuhan petugas dalam melakukan penandaan pada pasien yang akan dioperasi. Evaluasi hasil output.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
