(196, 32, 91, NULL, 'Mencapai kepatuhan petugas dalam melakukan hand over dengan SBAR.', 'Sosialisasi untuk peningkatan proses hand over dengan SBAR, monitoring dan evaluasi kepatuhan petugas dalam melakukan hand over dengan SBAR.', 'Input : Kurangnya kepatuhan petugas dalam melakukan hand over dengan SBAR. Proses : Sosialisasi pentingnya hand over dengan SBAR. Output : Peningkatan kepatuhan petugas dalam mealkukan hand over dengan SBAR.', 'Monitoring dan evaluasi hand over dengan SBAR. Evaluasi hasil output', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(197, 32, 92, NULL, 'Mencapai kepatuhan petugas dalam melakukan doubel cek terhadap pemberian obat high alert medication 100%.', 'Sosialisasi ke unit kerja tentang pentingnya doubel cek terhadap pemberian obat high alert medication. Monitoring dan evaluasi pelaksanaan doubel cek terhadap pemberian obat high alert medication.', 'Input : Ketidakpatuhan petugas dalam melakukan doubel cek terhadap pemberian obat high alert medication. Proses : Sosialisasi ke unit kerja tentang pentingya dalam melakukan doubel cek terhadap pemberian obat high alert medication, Pemberian daftar obat high alert medication ke unit kerja. Output : Peningkatan kepatuhan petugas dalam melakukan doubel cek terhadap pemberian obat high alert medication.', 'Monitoring dan evaluasi kepatuhan petugas dalam melakukan doubel cek terhadap pemberian obat high alert medication. Evaluasi hasil output.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
