(200, 32, 95, NULL, 'Mencapai kepatuhan upaya pencegahan risiko cedera akibat pasien jatuh pada pasien rawat inap 100%.', 'Setiap pasien yang rawat inap dilakukan skreening, asesmen awal, asesmen ulang dan edukasi. Pasien yang risiko jatuh tinggi diberikan gelang kuning risiko jatuh dan penanda risiko jatuh pada tempat tidur pasien. ', 'Input : Kurangnya kepatuhan Upaya pencegahan risiko cedera akibat jatuh pada pasien rawat inap. Proses : Setiap pasien yang rawat inap dilakukan skreening, asesmen awal, asesmen ulang dan edukasi. Pasien yang risiko jatuh tinggi diberikan gelang kuning risiko jatuh dan penanda risiko jatuh pada tempat tidur pasien. Output : Kepatuhan upaya pencegahan risiko cedera akibat pasien jatuh pada pasien rawat inap', 'Pemberian gelang risiko jatuh pada pasien risiko jatuh tinggi pada pasien rawat inap. Pemberian pita kuning risiko jatuh tinggi pada psien rawat jalan. Sosialisasi ulang mencegah agar pasien risiko jatuh tidak ada dengan cara sosialisasi SPO asesmen risiko jatuh dan SPO langkah - langkah pencegahan pasien jatuh.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
