(205, 32, 95, NULL, 'Mencapai kepatuhan upaya pencegahan risiko cedera akibat pasien jatuh pada pasien rawat inap 100%.', 'Setiap pasien yang rawat inap dilakukan skreening, asesmen awal, asesmen ulang dan edukasi. Pasien yang risiko jatuh tinggi diberikan gelang kuning risiko jatuh dan penanda risiko jatuh pada tempat tidur pasien. ', 'Input : Kurangnya kepatuhan Upaya pencegahan risiko cedera akibat jatuh pada pasien rawat inap. Proses : Setiap pasien yang rawat inap dilakukan skreening, asesmen awal, asesmen ulang dan edukasi. Pasien yang risiko jatuh tinggi diberikan gelang kuning risiko jatuh dan penanda risiko jatuh pada tempat tidur pasien. Output : Kepatuhan upaya pencegahan risiko cedera akibat pasien jatuh pada pasien rawat inap', 'Pemberian gelang risiko jatuh pada pasien risiko jatuh tinggi pada pasien rawat inap. Pemberian pita kuning risiko jatuh tinggi pada psien rawat jalan. Sosialisasi ulang mencegah agar pasien risiko jatuh tidak ada dengan cara sosialisasi SPO asesmen risiko jatuh dan SPO langkah - langkah pencegahan pasien jatuh.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(206, 21, 102, NULL, 'Input data pelaporan kerusakan bangunan gedung sesuai dengan laporan ruangan', 'Unit sudah mengumpulkan dan melaporkan data rekapitulasi indikator utama penanganan pemeliharaan sarana bangunan gedung selama 3 bulan mulai dari Juli - September 2019,Melakukan perbaikan sesuai laporan dari ruangan dan melakukan penggantian sarana yang dibutuhkan,Melakukan pengecatan bangunan gedung secara rutin.', 'Penanganan pemeliharaan sarana bangunan gedung di ruangan masih belum memenuhi target terbukti dengan grafik yang masih naik turun.pada bulan Juli 1,02% Agustus 0,74% September 1,17%', 'Melakukan pemeliharaan secara rutin,mengusulkan pengadaan sarana pengganti yang berkwalitas', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(207, 21, 58, NULL, 'Input data pelaporan kerusakan lampu penerangan sesuai dari ruangan.', 'Unit sudah mengumpulkan dan melaporkan data rekapitulasi indikator utama kesiapan penerangan bila lampu penerangan mati mulai bulan Juli - September 2019,Melakukan penggantian lampu dan perbaikan sesuai dengan laporan kerusakan dari ruangan', 'Penggantian lampu penerangan ruangan masih belum mencapai target karena pada bulan Juli mencapai 1,78%,Agustus 1,73%,September 1,73%', 'Merencanakan dan mengusulkan penggantian lampu yang memakai trafo dengan lampu LED juga menghimbau kepada semua ruangan agar mematikan lampu bila tidak dibutuhkan.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(208, 21, 57, NULL, 'Input data pelaporan kerusakan AC pendingin ruangan hampir setiap hari ,dengan berkurangnya kerusakan AC pendingin ruangan akan mengurangi biaya operasional dan dengan berfungsinya AC pendingin ruangan akan menambah kenyaman pasien dan petugas.', 'Unit sudah mengumpulkan dan melaporkan data rekapitulasi indikator utama penanganan alat pendingin ruangan/AC .mulai bln Juli - September 2019,Melakukan perawatan rutin dan perbaiakan AC serta membuat SOP cara menggunakan Ac pendingin.', 'Angka perbaikan AC pendingin ruangan pada bulan April - Juni 2019 masih dibawah standar indikator dimana pada bulan Juli 0,85% Agustus 0,51 September 0,60%', 'Melakukan pemeliharaan AC secara rutin ,membuat rekomendasi ke ruangan agar tidak menghidupkan AC saat ruangan kosong,Mengajukan usulan pembelian AC yang berkwalitas.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
