(212, 20, 54, NULL, 'Membuat jadwal petugas Alkes dalam pencatatan jumlah laporan perbaikan kerusakan alat dari setiap ruangan yang melaporkan. agar setiap ruangan yang akan melakukan pengambilan alat kesehatan di alkes dapat mengetahui alat yang sudah di perbaiki dalam batas waktu kurang dari 15 menit', 'petugas alkes sudah menulis laporan kerusakan dan tanda tangan dari setiap ruangan di laporan perbaikan kerusakan alat, dan melaporkan secara berkala untuk dievaluasi.', 'dapat dilihat dari grafik diatas , untuk laporan perbaikan kerusakan alat kesehatan sudah memenuhi target dan mencampai 100%  karena alat yang rusak langsung di tangani oleh petugas teknisi di Instalasi Alkes.', 'setiap hari setiap ada laporan keruskan alat petugas akan menulis di laporan perbaikan keruskan alat dan selalu mendata data respons time yang sudah di tulis di laporan setiap bulan.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(213, 21, 102, NULL, 'Input data laporan kerusakan bangunan gedung sesuai dengan laporan ruangan', 'Data rekapitulasi indikator utama penanganann pemeliharaan sarana bangunan gedung dari bulan Juli-September 2019 , unit telah melakukan perbaikan sesuai dengan laporan kerusakan dari ruangan.', 'Kenaikan grafik penanganan yang telah  dilakukan dengan rata-rata persentase 0,97% menunjukkan peningkatan karena kualitas barang yang semakin menurun dan usia bangunan gedung yang sudah semakin tua.', 'Melakukan pemeliharaan secara rutin, memberikan usulan pengadaan sarana pengganti yang berkualitas.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(214, 21, 58, NULL, 'Input data pelaporan kerusakan lampu penerangan sesuai dengan laporan kerusakan ruangan.', 'Data rekapitulasi indikator utama dalam kesiapan penerangan selama 3bulan dari bulan Juli-September 2019 , unit telah melakukan perbaikan sesuai dengan laporan kerusakan bangunan gedung.', 'Berdasarkan grafik indikator menunjukkan angka kenaikan dikarenakan bertambahnya jumlah ruangan menyebabkan semakin banyaknya pemakaian lampu ruangan yang non-stop dalam penggunaannya.', 'Merencanakan dan memberikan usulan penggantian penerangan lampu yang menggunakan trafo menjadi lampu hemat energi (LED). serta memberikan himbauan kepada ruangan untuk mematikan lampu apabila sudah tidak dibutuhkan.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(215, 21, 57, NULL, 'Input data pelaporan kerusakan AC pendingin ruangan hampir setiap hari ,dengan berkurangnya kerusakan AC pendingin ruangan akan mengurangi biaya operasional dan dengan berfungsinya AC pendingin ruangan akan menambah kenyaman pasien dan petugas.', 'Unit telah melakukan perawatan rutin dan perbaikan pendingin AC pada bulan Juli -September 2019 serta membuat SOP cara penggunaan Pendingin AC ', 'Angka penanganan perbaikan  pendingin AC pada bulan Juli-September  belum memenuhi target karena semakin bertambahnya jumlah AC yang digunakan .', 'Melakukan pemeliharaan AC secara rutin ,membuat rekomendasi ke ruangan agar tidak menghidupkan AC saat ruangan kosong,Mengajukan usulan pembelian AC yang berkwalitas.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(216, 16, 43, NULL, 'Tidak adanya kejadian linen yang hilang diruangan rawat inap diharapkan jumlah dan jenis linen untuk kebutuhan ruang senantiasa terpenuhi/ tercukupi dari jumlah dan jenisnya guna menunjang kelancaran pelayanan.', 'Tidak tercapainya target linen yang hilang di ruang rawat inap, terjadi karena petugas ruangan yang tidak teliti terhadap linen kelengkapan pasien sehingga ada linen yang ikut terbawa pasien.', 'Tidak tercapainya target linen yang hilang di ruang rawat inap bulan Juli adalah 95,26 %, Agustus 95 % dan September 95,02 %.', 'Perlunya kepedulian dan ketelitian petugas ruangan terhadap pasien yang pulang.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
