(229, 10, 33, NULL, '1. Terus mengupayakan peningkatan capaian waktu keterlambatan ekspertise dokter spesialis radiologi terhadap pemeriksaan nilai kritis hingga dapat mencapai 0 %. 2. Membangun komunikasi efektif dengan dokter pengirim untuk mendapatkan diagnosa awal yang tepat 3. Membangun komunikasi sebaik mungkin dengan dokter spesialis radiologi melalui WA, SMS, maupun telepon supaya dapat segera mendapatkan hasil ekspertise guna menegakkan diagnosa pasien.', '1. Dokter pengirim harus selalu menuliskan diagnosa pada lembar permintaan foto. 2. Dokter radiolog harus selalu standby dengan alat komunikasinya sehingga mudah untuk dihubungi jika ada kasus-kasus kritis. 3. Petugas radiologi (radiografer) harus selalu meng-up-date ilmu mengenai radiologi hasil kritis sehingga tidak ada pasien yang terlewat.', '1. Capaian pada bulan Juli sampai September 2019 belum semuanya mencapai target. 2. Dokter pengirim masih ada yang tidak menuliskan diagnosa pada lembar permintaan foto. 3. Dokter Radiolog tidak selalu standby di tempat maupun standby dengan HPnya.', '1. Membangun komunikasi antara radiografer dengan dokter pengirim sehingga dicapai kesepakatan untuk kasus pemeriksaan pasien nilai kritis sehingga tercapai tujuan yang diinginkan oleh dokter pengirim. 2. Petugas radiologi aktif melakukan komunikasi dengan dokter Radiolog sehingga pelaksanaan ekspertise nilai kritis bisa tepat waktu.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
