(239, 23, 62, NULL, 'menekan angka keterlambatan penyediaan darah pada pasien kebidanan mencapai target 0.5%', 'unit sudah mengumpulkan dan melaporkan data rekapitulasi keterlambatan penyediaan darah pada pasien kebidanan dari bulan Juli - September 2019, dimana hasil capaian angka keterlambatan penyediaan darah pada bulan Juli 5 %, Agustus 5,56 %, dan September 9,3 %', 'angka keterlambatan penyediaan darah pada pasien kebidanan pada trisemester ke 3 bulan Juli - September 2019 masih dibawah target indikator yang ditetapkan meski sudah ada penurunan dibanding trisemester sebelumnya, karena beberapa faktor seperti penundaan transfusi dari ruangan karena kondisi pasien yang belum stabil untuk ditransfusikan darah, pasien baru saja dipindahkan dari ruangan sebelumnya ke ruangan lain dan masih butuh observasi, koordinasi serta edukasi untuk transfusi darah', 'menegakkan SPO pada petugas tehnisi dan perawat / bidan, meningkatkan keakuratan pencatatan rekap keterlambatan penyediaan darah dari bank darah dan ruang - ruang terkait, evaluasi pelaksanaan SPO pelayanan ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
