(243, 10, 34, NULL, '1. Mengupayakan semua foto dapat terbaca oleh dokter spesialis radiologi. 2. Mengupayakan semua foto rontgen yang dipinjam oleh ruangan yang belum terekspertise bisa dikembalikan ke radiologi untuk dibaca oleh Radiolog.', '1. Meletakkan semua foto yang belum diekspertise di atas meja dokter Radiolog. 2. Memberi label atau tanda pada amplop foto yang dipinjam oleh ruangan.', '1. Masih banyak foto rotgen yang diambil oleh ruangan sebelum diekspertise. 2. Petugas ruangan tidak segera mengembalikan foto yang dipinjam setelah selesai digunakan. 3. Foto yang belum terekspertise terlanjur dibawa pulang oleh pasien.', '1. Meningkatkan komunikasi dengan petugas ruangan untuk segera mengembalikan foto yang dipinjam setelah digunakan. 2. Meningkatkan kinerja dokter spesialis radiologi untuk datang tepat waktu dan standby di ruangan saat jam dinas.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
