(251, 10, 32, NULL, 'Mempertahankan capaian waktu keterlambatan ekspertise dokter spesialis radiologi terhadap pelayanan pasien foto thorax persiapan operasi elektif 0 %.', 'Berkoordinasi dan melakukan sosialisasi dengan poli rawat jalan terkait persiapan operasi elektif di poliklinik.', 'Capaian pada triwulan III mengalami penurunan yaitu dengan rata-rata capaian 17,78%.', '1. meningkatkan kinerja petugas radiologi agar pelayanan bisa berjalan lancar. 2. Meningkatkan profesionalitas dokter spesialis radiologi agar bisa datang tepat waktu. ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(252, 6, 18, NULL, 'meningkatkan kepatuhan petugas IBS melengkapi transfer internal pasien post operasi yang masuk ke ruang ICU', 'melakukan pemantauan terhadap petugas IBS yang mengirim pasien ke ICU untuk menulis tranfer internal', 'petugas IBS dalam mengisi transfer internal pasien baru yang masuk ruang ICU belum patuh 100%', 'evaluasi dan ingatkan petugas IBS dalam mengisi transfer internal. Koordinasi dengan kepala ruang IBS dan petugas IBS dalam penyampaian hasil evaluasi pengisisn transfer internal', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
