(256, 15, 41, NULL, 'Mempertahankan pencapaian tidak ada kesalahan tindakan terapi', 'Melakukan tindakan terapi sesuai program yang telah direncanakan', 'Kejadian kesalahan tindalan dalam triwulan I tidak ada sama sekali', 'Tim rehab telah melakukan tindakan sesuai program yang telah direncanakan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(257, 15, 41, NULL, 'Mempertahankan pencapaian tidak ada kesalahan tindakan terapi', 'Melakukan koordinasi antar staf untuk program terapi yang sesuai, perlu ada perubahan program terapi atau tetap', 'Kejadian kesalahan tindakan terapi pada triwulan II telah mencapai target yaitu 0%', 'Koordinasi perlu ditingkatkan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(258, 15, 41, NULL, 'Mempertahankan pencapaian kejadian tindakan terapi', 'Koordinasi dengan rekan unit terkait tindakan terapi yang dijadikan program', 'Kenadian kesalahan tindakan sudah mencapai target 100%', 'Tim rehab medik telah melakukan koordinasi tim mengenai tindakan terapi yang dijadikan program', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(259, 33, 107, NULL, 'mengurangi angka kematian bayi dengan cara mengurangi angka kelahiran bayi pada umur kehamilan muda atau kelahiran bayi baru lahir sangat rendah. langkah - langkah yang dilakukan adalah melakukan koordinasi dengan bidan atau dokter praktek swasta untuk melakukan edukasi tentang kehamilan, menganjurkan untuk kontrol kehamilan secara rutin,, melakukan edukasi di klinik kandungan tentang makanan bergizi sehinggan ibu hamil selama kehamilannya cukup mendapatkan asupan gizi lengkap, koordinasi dengan bidang pelayanan untuk melengkapi sarana dan prasarana yang belum sesuai standar, meningkatkan kemampuan petugas perinatal dalam menangani kegawatdaruratan bayi.', 'pengamatan dilakukan mulai bulan juli sampai dengan september 2019 ,data yang diambil adalah semua bayi yang lahir si RSUD RAA Soewondo Pati dan kemudian meninggal. Ruang lingkup pemngamatan mulai dari ruang IGD PONEK, kamar bersalin, ruang rawat nifas, perinatal level 1 dan 2 dan NICU.', 'dari hasil pengamatan mulai bulan juli sampai dengan september 2019 didapatkan angka kematian 12 bayi dari 578 kelahiran. pada bulan september ditemukan trend grafiknya mengalami peningkatan.. Dari hasil pengamatan didapatkan data penyebab kematiannya yang terbanyak adalah karena bayi baru lahir berat badannya sangat rendah dan 2 bayi meninggal karena kelainan kongenital.', 'langkah - langkah yang sudah dilakukan sudah efektif tapi perlu lebih ditingkatkan lagi untuk edukasi ibu hamil tentang gizi selama hamil sehingga bayi lahir dengan kelainan kongenital bisa dicegah dan bayi lahir dengan berat badan yang cukup', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(260, 33, 96, NULL, 'tidak ada kematian ibu hamil dan bersalin karena perdarahan di RSU. dengan cara semua kasus perdarahan yang terjadi baik pada ibu hamil maupun ibu bersalin bisa teratasi. langkah - langkah yang dilakukan adalah melakukan pembinaan kepada puskesmas poned tentang penanganan kegawatdaruratan perdarahan,, melakukan komunikasi pra rujukan sehingga pasien dalam perjalanan atau proses rujuk kondisi dalam keadaan stabil, meningkatkan kemampuan petugas RS baik dokter, perawat dan bidan dalam menangani kegawatdaruratn perdarahan dengan mengikutkan pelatihan yang bersifat eksternal dan internal dengan IHT,', 'pengamatan dilakukan pada bulan juli sampai dengan september 2019 ,data yang diambil adalah semua ibu hamil ,bersalin dan nifas  yang mengalami perdarahan . pengamatan dilakukan diruangan IGD PONEK, OKB, Nifas dan ICU. bila ditemukan adanya kematian ibu karena perdararahan maka akan duilakukan AMP untuk mencari akar permasalahan untuk tindak lanjut bila ditemuka kasus yang sama', 'hasil pengamatan pada bulan juli sampai dengan september 2019 didapatkan angka jumlah kasus perdarahan ada 27 dengan tidak ada kematian. ', 'langkah - langkah yang dilakukan sudah optimal tapi masih perlu untuk lebih ditingkatkan lagi terutama tentang bimbingan ke Puskesmas PONED karena belum bisa terealisasi dan peningkatan kemampuan petugas dalam penangan kegawatan dengan rutin mengadakan IHT.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(261, 33, 97, NULL, 'angka kematian ibu hamil atau bersalin yang meningagal karena eklamsi tidak ada,,dengaan mengurangi ibu hamil dengan resiko tinggi PEB dan Eklamsi. Langkah - langkah yang dilakukan adalah melakukan bimbingan dan pembinaan pada puskesmas PONED dalam melakukan penanganan kejang eklamsi, melaukan deteksi awal / penjaringan ibu hamil resiko tinggi pada faskes tingkat I, melakukan koordinasi dengan penunjang dan pelayanan untuk menyiapkan sarana dan prasarana yang sesuai dengan standar, meningkatkan sklill kompetensi petugas rumah sakit dalam melalukan pengelolaan kejang ekimasi', 'dilakukan pengamtan pada bualn juli sampai dengan september 2019 yang diamati adalah semua ibu hamil, bersalin, dan nifas yang menaglami kejang eklamsi . ruang lingkup pengamatan yang dilakukan semua ruangan di unit PONEK. Bila ditemukan  kematian karena kejang eklamsi maka akan dilakukan AMP untuk mencari akar masalah sdehingga untuk tindak lanjut bila ditemukan masalah yang sama.', 'hasil pengamatan pada bulan juli sampai dengan september 2019 didapatka kematian ibu 1 dari 6 ibu dengan kasus eklamsi. 1 ibu yang meninggal bukan karena kejang eklamsi tapi karena oedem pulmo PEB dan CHF..dengan umur kehamilan 33 mgg. Pasien rujukan datang kondisi sudah KU jelek ,pasien sudah terdeteksi CHF sejak sebelum hamil.', 'langkah - langkah yang dilakukan sebelumnya sudah optimal tapi perlu ditingkatkan lagi untuk kerjasama lintas sektoral dengan dinas kesehatan kabupaten dan profesi IBi untuk melakuan deteksi resiko tinggi kehamilan dan edukasi bahaya kematain kepada ibu hamil  beresiko tinggi bila melanjutkan kehamilannya.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(262, 18, 49, NULL, '1. Meningkatkan pemahaman pasien terkait diet yang diberikan di RS 2. Meningkatkan kualitas makanan yang disajikan kepada pasien baik dari segi rasa maupun penampilan 3. Meningkatkan kualitas kinerja petugas produksi makanan', '1. Dietesien melakukan edukasi semua pasien baru 2 x 24 jam. 2. Dietesien melakukan evaluasi kegiatan produksi makanan pada saat breefing pagi 3. Dietisien melakaukan uji organoleptik makanan yang akan disajikan kepada pasien 4. Merubah tampilan penyajian makanan pasien', 'Berdasarkan hasil pengolahan data bulan Juli - September tahun 2019 sisa makanan yang tidak termakan oleh pasien rata-rata sebesar 21,54 % Ada peningkatan capaian prosesntase sisa makanan dari trimester II( April - Juni 2019) sebesar 0,04%. Hal ini terkait kondisi internal pasien yang sesak, mual, muntah, nyeri perut, pusing dan ada luka ada pipi. hasil ini belum sesuai target yaitu kurang dari atau sama dengan 20 %. ', '1. Melakukan evaluasi asupan makanan pasien  2. Memodifikasi makanan pasien sesuai kemampuan / kondisi pasien 3. Memberikan motivasi pasien agar mau menghabiskan makanan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(263, 7, 22, NULL, 'Menurunkan angka kejadian SC pada nullipara hamil aterm janin tunggal letak vertex / belakang kepala', '1. Melakukan pengawasan dan mengidentifikasi semua pasien nullipara waktu inpartu lebih intens. 2. Kolaborasi dengan TIM medis untuk syarat pemberian induksi dan stimulasi. 3. Sudah ada SPO tentang induksi dan stimulasi tetapi belum semua DPJP patuh terhadap SPO tersebut.', '1. Pada triwulan kedua ini periode April - Juni 2019 target belum tercapai tetapi sudah ada penurunan dibandingan pada triwulan pertama sehingga masih perlu kepatuhan dalam pelaksanaan SPO', '1. Masih perlu peningkatan skill bidan dalam penilaian bishoop score. 2. Perlu peningkatan kepatuhan terhadap SPO induksi / stimulasi', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(264, 7, 22, NULL, 'Menurunkan angka kejadian SC pada nullipara hamil aterm janin tunggal letak vertex / belakang kepala sampai tercapai target', ' Melakukan pengawasan dan mengidentifikasi semua pasien nullipara waktu inpartu lebih intens. 2. Kolaborasi dengan TIM medis untuk syarat pemberian induksi dan stimulasi. 3. Diharapkan semua DPJP patuh terhadap SPO induksi / stimulasi.4. Peningkatan edukasi terhadap pasien dan keluarga tentang proses persalinan.', 'Pada triwulan ketiga ini periode Juli - September 2019 target rata - rata sudah tercapai.', 'Meskipun target rata - rata sudah tercapai tetapi perlu dipertahankan dalam peningkatan skill bidan untuk penilaian bishoop score dan meningkatkan kepatuhan terhadap SPO induksi / stimulasi.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(265, 7, 23, NULL, 'Waktu distribusi hasil pemeriksaan laborat Kamar Bersalin tertib ( pada waktu operan jaga hasil laborat sudah ada ) mencapai target 100 %.', '1. Ada SPO dari pelayanan tentang pemeriksaan laborat dan pemberitahuan / pengambilan hasil laborat terutama pasien Obsgyn. 2. Meningkatkan kerja sama antara petugas IKB dan petugas laborat. ', '1. Pada triwulan kedua ini periode April - Juni 2019 target belum tercapai tetapi sudah ada peningkatan dibandingkan pada triwulan 1 sehingga masih perlu peningkatan kerja sama antara petugas IKB dan petugas laborat.', '1. Terealisasinya SPO dari pelayanan. 2 Masih perlu peningkatan lagi kerja sama antara petugas IKB dan petugas laborat. 3. Masih perlu sosialisasi lagi dari petugas PIC ke semua anggota Kamar Bersalin.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(266, 7, 23, NULL, 'Waktu distribusi hasil pemeriksaan laborat Kamar Bersalin tertib ( pada waktu operan jaga hasil laborat sudah ada ) mencapai target 100 %', '1. Ada SPO dari pelayanan tentang pemeriksaan laborat dan pemberitahuan / pengambilan hasil laborat terutama pasien Obsgyn. 2. Meningkatkan kerja sama antara petugas IKB dan petugas laborat. 3. Meningkatkan kepatuhan dan kedisiplinan petugas IKB dalam pengambilan hasil laborat pada satu shif jaga.', 'Pada triwulan ketiga ini periode Juli - September 2019 target belum tercapai 100 % tetapi sudah ada peningkatan dibandingkan pada triwulan kedua sehingga masih perlu peningkatan kerja sama antara petugas IKB dan petugas laborat.', '1. Terealisasinya SPO dari pelayanan. 2 Masih perlu peningkatan lagi kerja sama antara petugas IKB dan petugas laborat. 3. Masih perlu sosialisasi lagi dari petugas PIC ke semua anggota Kamar Bersalin.4. Meningkatkan kepatuhan dan kedisiplinan petugas IKB dalam pengambilan hasil laborat pada satu shif jaga.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(267, 7, 24, NULL, 'Bayi lahir di IKB dengan penyulit diindikasikan IMD sebelum dirawat di Perinatal Level 1 petugas IKB bisa melakukan IMD sampai berhasil yaitu bayi bisa aktif menghisap puting susu ibu atau dengan lama waktu kurang lebih 2 jam sesuai target 100 %.', ' 1. Sudah ada panduan / SPO indikasi ibu dan bayi IMD tetapi belum semua petugas patuh.2.Semua petugas ruang IKB sudah paham dengan program mutu unit ini tetapi masih ada yang belum patuh.', 'Pada triwulan kedua ini periode April - Juni 2019 target belum tercapai tetapi sudah ada peningkatan dibandingkan pada triwulan satu sehingga masih perlu peningkatan kepatuhan petugas terhadap SPO.', '1. Meningkatkan edukasi petugas, pasien dan keluarga untuk mendukung IMD. 2. Meningkatkan kepatuhan petugas dalam melaksanakan IMD sesuai SPO.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(268, 7, 24, NULL, 'Bayi lahir di IKB dengan penyulit diindikasikan IMD sebelum dirawat di Perinatal Level 1 petugas IKB bisa melakukan IMD sampai berhasil yaitu bayi bisa aktif menghisap puting susu ibu atau dengan lama waktu kurang lebih 2 jam mencapai 100 %.', '1. Sudah ada panduan / SPO indikasi ibu dan bayi IMD tetapi masih belum semua petugas patuh.2.Semua petugas ruang IKB sudah paham dengan program mutu unit ini tetapi masih ada yang belum patuh. 3. Masih kurangnya kedisiplinan petugas IKB dalam pelaksanaan IMD sesuai SPO.', 'Pada triwulan ketiga ini periode Juli - September 2019 target masih belum tercapai 100 % tetapi sudah ada peningkatan dibandingkan pada triwulan dua sehingga masih perlu peningkatan kepatuhan petugas dalam melaksanakan IMD.', 'Meningkatkan  kedisiplinan petugas IKB dalam pelaksanaan IMD sesuai SPO.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(269, 1, 8, NULL, 'Meningkatkan kepatuhan DPJP terhadap CP sampai 100%', 'Petugas Case Manager dan kepala ruang mengingatkan DPJP bila terjadi penyimpangan dalam pelaksanaan CP ', 'Dari hasil evaluasi CP dari 5 kasus yang diambil sampel masih ditemukan adanya pelaksanaan CP yang tidak sesuai dengan cek list CP tetapi pada triwulan ini sudah ada peningkatan dibandingkan dengan triwulan kedua meskipun belum mencapai 100% ', 'meningkatkan kepatuhan DPJP dalam pelaksanaan CP sesuai cek list dengan cara melakukan audit medis bila terjadi penyimpangan dalam pelaksanaa CP', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(270, 24, 63, NULL, '1. Health Educator memastikan pasien yang akan dilakukan tindakan operasi mendapat informasi dan edukasi dari PPA.', '', '', '', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(271, 8, 27, NULL, 'Mengupayakan tidak terjadi kesalahan dalam tindakan insersi vena dan arteri pada pasien HD', 'Monitoring tindakan insersi vena dan arteri pada pasien HD dan Pencatatan kesalahan tindakan dalam RM pasien', 'Berdasarkan hasil monitoring dan pencatatan  selama 3 bulan tidak pernah terjadi kesalahan insersi vena dan arteri pada pasien HD', 'Sosialisasi secara berkala SPO akses vaskuler', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(272, 3, 11, NULL, 'pada triwulan IV angka penundaan operasi elektif akan menurun dan tetap dibawah 5%.', 'Mengadakan rapat mengundang operator untuk memaparkan hasil capaian triwulan III serta sosialisasi ulang tentang pendaftaran operasi serta persyaratan sebelum didaftarkan mengurangi keluhan terhadap proses pembatalan terutama bagi pasien dan keluarga serta tim operasi, mengurangi angka penundaan operasi elektif', 'Input : terjadi penurunan angka penundaan operasi elektif kurang dari 5%. Proses : sebelum diputuskan melakukan penundaan pembedahan, DPJP bedah / Operator melakukan reviewnkembali meliputi : kondisi pasien pra bedah, ketersediaan ruang rawat khusus jika diperlukan, ketersediaan peralatan khusus jika diperlukan dan tersedia. Output : Angka penundaan operasi elektif kurang dari 5%.', 'melakukan sosialisasi ulang kepada operator tentang Semua kelengkapan persyaratan administrasi, alat kesehatan dan pasien itu sendiri sudah harus siap sebelum dijadwalkan atau minimum sebelum pasien masuk kamar operasi', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(273, 15, 39, NULL, 'Koordinasi dengan unit terkait untuk meningkatkan kualitas', 'Melakukan koordinasi internal tim rehab medik tentang penjadwalan visit rawat inap dan melakukan assessmen pada pasien baru yang telah dikonsulkan', 'Pencapaian mengalami penurunan pada kuartal ke II (April - Juni 2019). Pembagian jadwal visit pasien ranap sudah dilakukan dengan baik. Beberapa pasien tidak mendapatkan assesmen karena tim tidak langsung melakukan visit pasien segera setelah mendapat konsulan dari ranap', 'Tim rehab medik telah bertugas dengan baik sesuai pembagian jadwal. ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(274, 3, 112, NULL, 'Pada Triwulan IV tahun 2019 akan melakukan sosialisasi kepada operator tentang pengisian assesment pra bedah sehingga terjadi peningkatan target dalam pengisian assesment pra bedah', 'mengadakan sosialisasi saat rapat kepada operator capaian mutu dan analisa tentang pengisian assesment pra bedah serta himbauan untuk mengisis assesment pra bedah', 'Input : Dokter operator untuk mengisi  assesment pra bedah sebelum pasien masuk ke kamar operasi. Proses : Sosialisasi tentang pentingnya pengisian assesment pra bedah serta pengisian di RM kepada dokter operator. Output : dokter operator mengisi assesment prabedah dengan lengkap sebelum pasien dikirim ke kamar operasi', 'Melakukan sosialisasi tentang pentingnya assesment pra bedah dan pengisiannya. monitoring dan evaluasi tentang kepatuhan operator dalam pengisian assesment pra bedah', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(275, 15, 39, NULL, 'Menyesuaikan data pasien yang didapat dari SIM RS dan yang dilakukan tindakan', 'Mengajukan usulan untuk bisa mengakses data Rawat Inap ke sistem Rawat Rawat Jalan agar bisa sinkron', 'Adanya penurunan pencalaian pada kuartal III (Juli - September 2019) dikarenakan data yang tidak selaras. ', 'Belum mampu mengakses data rawat inap untu menyelaraskan data', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(276, 24, 63, NULL, 'Health Educator memastikan pasien yang akan dilakukan tindakan operasi mendapat informasi dan edukasi dari PPA. Informasi dan edukasi berdasarkan dari hasil asesmen dan kebutuhan pasien/keluarga.', 'Health Educator mengisi form RM RI 7 sesuai dengan asesmen dan perencanaan edukasi.', 'Berdasarkan hasil pengamatan triwulan III ada penurunan dalam pemberian informasi edukasi kepada pasien dengan kasus bedah sebelum dilakukan tindakan di IBS sebesar 0,20% karena adanya faktor internal pasien yang terkendala dalam pemahaman tehnik kesehatan dan kebutuhan edukasi pasien.', 'HE memastikan semua PPA memberikan informasi dan edukasi kepada pasien dan mengisi lembar RM RI 7 sebelum dilakukan tindakan di IBS.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(277, 19, 51, NULL, 'Membuat jadwal petugas pengambilan sampah infeksius dan membuat log book untuk pencatatan jumlah limbah setiap ruangan. Agar pengambilan limbah infeksius dari ruangan selalu dilakukan sesuai jadwal dan volume limbah yang masuk ke TPS B3 selalu terkontrol.', 'unit sanitasi mengontrol pengambilan limbah infeksius di ruangan, dengan cara pendekatan ke petugas pengambilan limbah. dan kami juga memberikan loog book untuk mencatat volume limbah per ruangan rawat inap dan rawat jalan yang diambil limbahnya.', 'penyimpanan limbah infeksius mencapai nilai 100% dan dinyatakan memenuhi standart yang kami tetapkan.', 'Unit sanitasi sudah membuat jadwal, dan mengontrol  petugas pengambilan limbah infeksius dan mengecek ke TPS B3 selama 3 hari sekali serta memberikan form loog book untuk diisi.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(278, 19, 52, NULL, 'Untuk mewujudkan pemeriksaan air bersih yang selalu memenuhi baku mutu, kami dari tim membuat jadwal pengambilan sampel air bersih secara bakteriologi selama 1 bulan sekali dan mengirim sampel ke laboratorium daerah kab. Pati untuk dilakukan pemeriksaan.', 'Unit melakukan pemeriksaan air bersih setiap bulan sekali ke laboratorium daerah kab. Pati dan membuat jadwal pengambilan sampel air bersih.', 'Hasil pemeriksaan laboratorium air bersih secara bakteriologi selalu memenuhi syarat dan mencapai 100% serta dinyatakan memenuhi standar yang telah ditentukan.', 'Pemeriksaan laboratorium air bersih dilakukan setiap bulan dan lilaksanakan pada tanggal 20.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(279, 19, 114, NULL, 'unit melakukan penilaian keliling setiap bulan sekali dan menilai hasil kinerja cleaning service', 'Melakukan survey lapangan dan menilai hasil kinerja cleaning service di ruangan dan sekitar lingkungan rumah sakit', 'hasil penilaian kinerja cleaning service mencapai 100% dan sudah sesuai dengan standar yang telah ditentukan', 'penilaian kinerja cleaning service dilakukan diakhir bulan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019);
