(281, 6, 0, NULL, 'mempertahankan angka kejadian supaya tidak terjadi pasien yang kembali ke ICU dengan kasus yang sama kurang dari 72 jam ', 'melakukan pemantauan terhadap angka kejadian pasien yang kembali ke ICU dengan kasus yang sama kurang dari 72 jam', 'tidak  ada kejadian pasien yang kembali ke ICU dengan kasus yang sama kurang dari 72 jam', 'evaluasi penyebab terjadinya pasien kembali di rawat di ruang ICU dengan kasus yang sama kurang dari 72 jam. Mencari penyebab masalah kembalinya pasien yang di rawat di icu dengan kasus yang sama kurang dari 72 jam. Melaporkan kejadian ke tim PMKP', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(282, 18, 47, NULL, 'Dietisien satu blok/area bekerjasama menghendel ruang rawat inap yang sedangf tidak ada nutrisionisnya.', '1. nutrisionis mulai ke ruang rawat inap lebih awal 1 jam dari biasanya. 2. Mengunjungi pasien post operasi,kemudian melakukan asuhan gizi,melakukan monitoring dan evaluasi.', 'Rata-rata asuhan gizi untuk pasien post operasi pada triwulan ke III(Juli-September) sebesar 76,35 %. Ada penurunan capaian dari semester sebelumnya sebesar 13,53%. Hal ini terjadi karena ada beberapa dietisien yang ikut dalam kegiatan POKJA. Untuk persiapan penilaian akreditasi , pokja yang bersangkutan sering mengadakan rapat pada jam kerja. Sehingga dietisien tidak bisa maksimal melakukan kegiatan di ruang rawat inap.', 'Melakukan diskusi bersama dengan semua dietisien untuk membahas kegiatan di ruang rawat inap. Dietisen yang masuk dalam POKJA bisa mengatur waktu lebih efektif, agar kegiatan di ruang rawat inap juga bisa terlaksana dengan baik. ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
