(320, 21, 58, NULL, 'Input data pelaporan kerusakan lampu penerangan sesuai dari ruangan', '* unit sudah mengumpulkan dan melaporkan data rekapitulasi indikator utama kesiapan penerangan bila lampu penerangan mati mulai bulan januari sampai denganmaret 2019. *Melakukan penggantian lampu sesuai dengan laporan dari ruangan', 'Penggantian lampu penerangan ruangan pada trimester pertama masih belum mencapai target karena bulan januari hanya 1,58%, Februari 1,70% dan Maret 1,61%', 'Merencanakan dan mengusulkan penggantian lampu LED , serta menghimbau kepada semua petugas ruangan untuk mematikan lampu bila sudah tidak dibutuhkan.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
