(322, 21, 57, NULL, 'Input data pelaporan kerusakan AC pendingin ruangan hampir setiap hari, dengan berkurangnya kerusakan AC pendingin ruangan akan mengurangi biaya operasional dan dengan berfungsinya AC pendingin ruangan akan menambah kenyamanan pasien dan petugas', 'Pada trimester pertama, unit sudah mengumpulkan dan melaporkan data rekapitulasi indikator utama penanganan alat pendingin ruangan / AC mulai bulan Januari - Maret 2019 . Melakukan perawatan rutin dan perbaikan AC serta membuat SOP cara menggunakan AC pendingin.', 'Angka perbaikan AC pendingin ruangan pada bulan Januari - Maret masih dibawah standar indikator utama. karena pada bulan Januari hanya 0,16%, Februari 0,06% dan Maret 0,09%.', 'Melakukan pemeliharaan AC secara rutin, membuat rekomendasi ke ruangan agar tidak menghidupkan AC saat ruangan kosong. Serta mengajukan usulan pembelian AC yang berkualitas', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(323, 21, 57, NULL, 'Input data pelaporan kerusakan AC pendingin ruangan hampir setiap hari, dengan berkurangnya kerusakan AC pendingin ruangan akan mengurangi biaya operasional dan dengan berfungsinya AC pendingin ruangan akan menambah kenyamanan pasien dan petugas', 'Unit sudah melakukan perawatan rutin dan perbaikan AC serta membuat SOP cara penggunaan AC pendingin. SDerta mengumpulkan dan melakukan rekapitulasi indikator utama penanganan alat pendingin ruangan /AC.', 'Angka perbaikan AC pendingin ruangan pada trimester kedua belum mencapai target karena pada bulan April 0,10%, Mei 0,64% dan Juni 0,40%. ', 'Melakukan pemeliharaan AC secara rutin, membuat rekomendasi ke ruangan agar tidak menghidupkan AC saat ruangan kosong. Serta mengajukan usulan pembelian AC yang berkualitas', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
