(326, 18, 48, NULL, ' Meningkatkan monitoring dan edukasi secara berkala kepada tenaga penjamah makanan. ', '1. Pemantauan dilakukan secara berkala dengan mengisi ceck lis ketaatan pemakaian APD. 2.Edukasi tentang tujuan dan manfaat pemakaian APD dalam proses produksi makanan pada saat breefing pagi.  2.Mengusulkan reward dan punisman terkait kepatuhan pemakaian APD, dengan harapan ada peningkatan kepatuhan pemakaian APD.', 'berdasarkan hasil pengamatan di triwulan ke II tahun 2019 ( april - juni ) kepatuhan pemakaian APD penjamah makanan rata-rata 97.34%. Ada peningkatan capaian dari trimester sebelumnya 83.46%. hal ini menunjukkan adanya upaya para penjamah makanan memakai APD sesuai standar.', ' Melakukan rapat dan diskusi dengan penjamah makanan, terkait hambatan yang menyebabkan APD dipakai kurang tepat dan benar.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(327, 18, 48, NULL, 'Penjamah makanan yang sedang bertugas di ruang produksi memakai APD secara lengkap dan benar tercapai 100%', '. Sosialisasi secara terus menerus terkait persyaratan Alat Pelindung Diri yang harus dipakai penjamah makanan saat melakukan kegiatan produksi makanan. 2. meningkatkan pengawasan.', 'Rata-rata ketertiban pemakaian APD petugas penjamah makanan pada triwulan ke III ( juli-september 2019) sebesar 96,94%. Hasil ini belum dapat mencapai target yg ditentukan yaitu sebesar 100%. Ada 3.04 % petugas penjamah makanan memakai APD tidak sesuai ketentuan, yaitu: masker tidak menutup hidung', 'Melakukan rapat dan diskusi dengan penjamah makanan, terkait hambatan yang menyebabkan APD dipakai kurang tepat dan benar.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(328, 9, 0, NULL, 'imd bisa dilakukan pada semua bayi lahir sc kecuali pada kondisi tertentu', 'terus mengingatkan kepada petugas peri 2 akan pentingnya imd pada bayi baru lahir, - berupaya mengurangi masalah yang menyebabkan imd tidak bisa dilakukan sesuai kemampuan,- refresh manajemen bayi lahir patologis untuk mengurangi terjadinya bayi lahir asfiksia,', 'bayi yang tidak bisa dilakukan imd karena tindakan sc yang frekuensinya tinggi dan bersamaan sehingga menyulitkan pengawasan md', 'koordinasi dengan pihak obsgyn dan ibs agar sc tidak susul menyusul ,- motivasi petugas peri 2 untuk berusaha melajksanakan imd meski hanya sebentar', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
