(335, 34, 98, NULL, 'Melakukan kajian kembali terkait penggunaan antibiotic di ruangan rawat inap dan sosialisasi hasil capaian.', 'Sosialisasi ke DPJP bersama bidang pelayanan terkait penggunaan antibiotic di ruang rawat inap.', 'Hasil capaian indicator mutu kami sudah sesuai dengan Target yang telah dibuat, yaitu <70%. Hasil capaian pada tahun 2018 sebesar 68,42% dan tahun 2019 sebesar 67,26%, dari hasil tersebut terjadi penurunan penggunaan antibiotic sebesar 1,16%', 'Pelaksanaan sosialisasi penggunaan antibiotic pada tanggal 2 September 2019 ke semua DPJP untuk mengkaji ulang penggunaan antibiotic di ruangan rawat inap', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
