(337, 27, 71, NULL, 'Capaian angka cost recovery pada level mendekati standar 100% per bulan', 'Kondisi yang akan dicapai yaitu angka cost recovery mendekati 100% dengan menyeimbangkan angka  numerator (pendapatan) dan menurunkan angka denumerator (belanja)', 'pada bulan januari sampai dengan maret nilai pendapatan melonjak naik dan menurun drastis, sedangkan belanja relatif stabil', 'Melakukan penagihan piutang secara intensif untuk menaikkan pendapatan ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
