(339, 20, 56, NULL, 'Untuk terlaksananya Kalibrasi Alat di Ruang IBS Tepat waktu sesuai dengan ketentuan petugas alkes sebelumnya membuat surat permintaan penawaran untuk dikirimkan kepada pihak rekanan untuk melakukan realisasi kalibrasi, setelah surat permintaan di kirim maka pihak rekanan akan memberi surat penawaran untuk kita mengajukan alat apa yang akan di kalibrasi di ruang IBS dan rekanan akan melakukan realisasi kalibrasi di ruang IBS dengan tepat waktu.', 'petugas alkes sudah membuat membuat surat permintaan penawaran untuk dikirimkan kepada pihak rekanan untuk melakukan realisasi kalibrasi, Untuk terlaksananya Kalibrasi Alat di Ruang IBS Tepat waktu sesuai dengan ketentuan, dan Alat Kesehatan yang ada di ruang IBS sudah terkalibrasi dengan baik.', 'dari target yang ada Alat di Ruang IBS Tepat waktu sesuai dengan ketentuan harus di perbaiki untuk mencapai target mendekati 100% dan harus dilaksanakan dengan baik.', 'setiap akan dilaksanakan kalibrasi yang akan ditentukan jadwalnya  petugas alkes sudah membuat jadwal dan  surat permintaan penawaran untuk dikirimkan kepada pihak rekanan untuk melakukan realisasi kalibrasi dan pembagian pada setiap alat di ruang IBS akan di check lagi dengan baik mana alat yang akan di ajukan kalibrasi.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
