(346, 28, 74, NULL, 'Triwulan II --> Hasil Survey Kepuasan Masyarakat Bulan Mei - Juni Tahun 2019 mengalami penurunan dari angka 74.93 ke 72.61, akan tetapi penurunan tersebut tidak terlalu signifikan. Hal tersebut harus diimbangi dengan peningkatan kualitas pelayanan di RSUD RAA Soewodo Pati.', 'Rapat dengan Penanggung Jawab untuk ditindak lanjuti terkait kualitas pelayanan di RSUD RAA Soewondo Pati', 'Target Survey Kepuasan Masyarakat >80%, akan tetapi capaian yang kami dapat dilapangan hasilnya <80% yang artinya perlu adanya sosialisasi peningkatan pelayanan di RSUD RAA Soewondo Pati supaya semakin baik lagi', 'Rapat unit terkait pelayanan, kemudian sosialisasi tindak lanjut atas hasil survey kepuasan masyarakat terhadap kualitas pelayanan yang harus ditingkatkan di RSUD RAA Soewomdo Pati', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
