(349, 28, 75, NULL, 'Triwulan II --> Hasil Kecepatan Respon terhadap Komplain sangat baik sekali, unit terkait seperti Humas, Customer Service ataupun Bidang Pelayanan sangat baik untuk menindaklanjuti dan menyelesaikan komplain yang diterima di RSUD RAA Soewondo Pati', 'Rapat intern Kasubbag Humas terkait sosialiasasi untuk mempertahankan kualitas pelayanan dan kecepatan respon terhadap komplain, karena komplain yang diterima tidak selalu banyak misalkan dari Bulan Mei sampai Bulan September jumlah komplain yang kami terima setiap bulannya hanya 1 (satu) dan bisa ditindaklanjuti sampai selesai', 'Target 75%, akan tetapi hasil yang diperoleh untuk Kecepatan Respon terhadap Komplain adalah 100% yang artinya sangat baik. Perlu dipertahankan untuk mendukung kualitas pelayanan di RSUD RAA Soewondo Pati', 'Sosialisasi intern oleh Kasubbag Hukmas dengan unit terkait penerimaan komplain untuk mempertahankan faktor kecepatan respon terhadap komplain', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
