(360, 4, 12, NULL, 'Pada triwulan IV 2019 dapat mempertahankan capaian target 100% dalam upaya pencegahan risiko cedera akibat pasien jatuh pada pasien post anesthesi', 'Setiap pasien post anesthesi dilakukan screening, assesment awal, assesment ulang dan edukasi serta diberikan gelang kuning resiko jatuh.', 'Input: Kurangnya kepatuhan upaya pencegahan resiko cedera akibat pasien jatuh pada pasien post anesthesi.. Proses: Setiap pasien yang dilakukan anesthesi dilakukan assesment awal, assesment ulang, edukasi dan pemasangan gelang resiko jatuh Output: Kepatuhan upaya pencegahan resiko cedera akibat pasien jatuh pada pasien post anesthesi', 'Pemberian gelang kuning pada pasien post anesthesi. Sosialisasi ulang SPO langkah-langkah  pencegahan pasien jatuh ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(361, 4, 109, NULL, 'Mempertahankan capaian kepatuhan petugas dalam melengkapi laporan monitoring proses pemulihan anesthesi dan sedasi dalam 100% pada triwulan IV tahun 2019.', '1. Sosialisasi ulang tentang pengisian laporan monitoring proses pemulihan anesthesi dan sedasi dalam . 2. Monitoring dan evaluasi kepatuhan petugas dalam pengisian laporan monitoring proses pemulihan anesthesi dan sedasi dalam ..', 'Input: Kurangnya kepatuhan petugas dalam melengkapi laporan monitoring proses pemulihan anesthesi dan sedasi dalam..Proses:Sosialisasi ulang tentang pengisian laporan monitoring proses pemulihan anesthesi dan sedasi dalam  Output: kepatuhan petugas dalam melengkapi laporan monitoring proses pemulihan anesthesi dan sedasi dalam ', 'Monitoring dan evaluasi laporan monitoring  proses pemulihan anesthesi dan sedasi dalam... Evaluasi hasil output', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(362, 4, 110, NULL, 'Mempertahankan capaian kepatuhan dokter anesthesi dalam melengkapi assesmen pra anesthesi pada pasien pre operasi 100% pada triwulan IV tahun 2019.', 'Mengadakan sosialisasi saat rapat kepada Sp An capaian mutu dan analisa tentang pengisian assesment pra anesthesi serta himbauan untuk berkomitmen mengisis assesment pra anesthesi', 'Input : Kurangnya kepatuhan  Sp. An mengisi assesment pra anesthesi sebelum pasien masuk ke kamar operasi. Proses : Sosialisasi tentang pentingnya pengisian assesment pra anesthesi serta pengisian di RM kepada SP. An. Output : Sp. An mengisi assesment pra anesthesi dengan lengkap sebelum pasien dikirim ke kamar operasi', 'Sosialisasi tentang pentingnya assesment pra anesthesi dan pengisiannya. monitoring dan evaluasi tentang kepatuhan Sp. An dalam pengisian assesment pra anesthesi', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(363, 4, 14, NULL, 'Memberikan edukasi anestesi pada keluarga pasien pre operasi elektif mencapai target 100%', 'Sselalu mengingatkan kepada petugas ranap umtuk memberitahu keluarga pasien pre operasi agar mengikuti edukasi anestesi', 'Hasil pelaksanaan pemberian edukasi anestesi pada keluarga pasien bulan Juli 56,23%, Agustus 58,29%, September 62,96%', 'Pendokumentasian pelaksanaan edukasi anestei pada keluarga pasien pre operasi elektif', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(364, 26, 68, NULL, 'Melanjutkan kegiatan yang belum terlaksana di tiga bulan sebelumnya untuk pemenuhan JPL sumber daya manussia Rumah Sakit yang belum terpenuhi dengan menjalankan koordinasi dengan para pelaksana (Tim Pokja ataupun Unit terkait) dengan pihak fasilitator (Diklat) sehingga kegiatan berjalan dengan baik.', 'Realisasi pada periode bulan Juli hingga September mengalami perubahan yang sangat baik karena dapat dilihat dari grafik yang menunjukkan kenaikan drastis pada bulan Agustus (diadakannya banyak kegiatan) serta telah terpenuhi dalam measurement goal jika dianalisis dalam periode ini.', 'Sudah tercapainya angka target di periode ini karena banyaknya kegiatan internal dilengkapi dengan kegiatan eksternal yang terlaksana untuk pemenuhan JPL sumber daya manusia Rumah Sakit', 'Kenaikan kurva pada grafik yang sangat signifikan menunjukkan bahwa setiap SDM Rumah Sakit telah memenuhi JPL nya dalam satu tahun baik melaui pelatihan internal maupun eksternal.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(365, 26, 69, NULL, 'Selain memberikan catatan kecil terkait dokumen yang harus dikumpulkan setelah melakukan kegiatan pelatihan eksternal, pihak Diklat juga menjelaskan kembali dengan mengingatkan berupa berbicara langsung ke pihak yang diberangkatkan sehingga indikator ini dapat terpenuhi dengan baik. Selain itu diharapkan pemerataan kegiatan eksternal setiap bulannya dapat terbagi rata, sehingga tidak terjadi penrunan yang signifikan seperti bulan September.', 'Mengingatkan kembali saat kembali dari pelatihan ataupun mengingatkan melalui personal contact agar dapat mengumpulkan dokumen terkait pelatihan yang diikutinya.', 'Pada periode Juli hingga September, implementasi indikator ini ditunjukkan dengan kurva penurunan yang drastis jika dibandingkan dengan dua bulan bulan sebelumnya yang mampu ataupun lebih mencapai angka target yang telah ditentukan. Ini bisa terjadi karena tidak adanya kegiatan eksternal yang terlaksana sehingga tidak ada sertifikat pelatihan eksternal yang terkumpul.', 'Peserta telah mengumpulkan dokumen pelatihan terkait termasuk sertifikat, dibuktikan dengan angka kurva yang melebihi target yang ada. Namun pada bulan September mengalami penurunan yan drastis karena memang pada bulan tersebut tidak ada kegiatan eksternal yang terlaksana. ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(366, 26, 70, NULL, 'Instalasi sudah mengumpulkan TOR (Term of Reference) dan melakukan koordinasi baik dengan pihak fasilitator (Diklat) sehingga kegiatan internal berjalan dengan baik.', 'Implementasi dalam kesediaan TOR pada setiap pengajuan kegiatan pendidikan dan pelatihan internal pada bulan April hingga Juni sudah lebih dari cukup.', 'Kepatuhan unit/instlasi terkait dalam mengupulkan TOR sebelum kegiatan meningkat jika dibandingkan beberapa bulan sebelumnya.', 'Periode April - Juni sudah ada beberapa kegiatan pendidikan dan pelatihan yang berjalan dengan baik sehingga TOR (Term of Reference) terkumpul sesuai kegiatan yang terlaksana.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(367, 26, 70, NULL, 'Harapannya untuk unit/instalasi yang akan melakukan kegiatan pendidikan dan pelatihan internal lebih meningkatkan lagi pengumpulan TOR (Term of Reference)  sebelum kegiatan terlaksana untuk mempersiapkan segalanya yang ada dalam kegiatan, agar tidak terkesan mendadak.', 'Implementasi pada periode Juli hingga September ini terbilang sangat baik, meskipun mengalami kurva penurunan dikarenakan, tidak mengalami penurunan yang drastis hingga jauh dari angka target.', 'Koordinasi lebih ditingkatkan lagi karena terkadang masih terjadi miskomunikasi antara pihak unit/instalasi terkait dengan pihak fasilitator (Diklat). ', 'Dari kurva yang ada,dapat dikatakan periode ini jauh lebih baik jika dibandingkan dengan bulan - bulan sebelumnya walaupun kurva menunjukkan penurunan tetapi penurunan tersebut tidak langsung anjlok seperti yang terjadi di beberapa bulan sebelumnya.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019);
