(393, 30, 119, NULL, 'Berusaha untuk mewujudkan pelayanan pasien yang maksimal dengan memenuhi kebutuhan tenaga di IBS.', 'Melihat lamaran yang masuk di RSUD RAA Soewondo Pati, dan melihat data pegawai yang ada yang memenuhi kualifikasi pendidikan tenaga perawat IBS, tenaga Anesthesi maupun PPA dengan dilakukan mutasi/rotasi.', 'Dari lamaran yang ada maupun data pegawai yang ada, belum ditemukan tenaga yang mempunyai keahlian untuk memenuhi kebutuhan tenaga di IBS.', 'Berusaha mencari dari lamaran yang masuk sesuai kompetensi yang dibutuhkan di IBS.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2018),
(394, 30, 119, NULL, 'Berusaha untuk mewujudkan pelayanan pasien yang maksimal dengan memenuhi kebutuhan tenaga di IBS.', 'Melihat lamaran yang masuk di RSUD RAA Soewondo Pati, dan melihat data pegawai yang ada yang memenuhi kualifikasi pendidikan tenaga perawat IBS, tenaga Anesthesi maupun PPA dengan dilakukan mutasi/rotasi.', 'Dari lamaran yang ada maupun data pegawai yang ada, didapatkan tenaga yang mempunyai keahlian untuk memenuhi kebutuhan tenaga di IBS.', 'Menempatkan pegawai sesuai kompetensi di ruang IBS dengan pembuatan Surat Perintah Direktur.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(395, 30, 119, NULL, 'Berusaha untuk mewujudkan pelayanan pasien yang maksimal dengan memenuhi kebutuhan tenaga di IBS.', 'Melihat lamaran yang masuk di RSUD RAA Soewondo Pati, dan melihat data pegawai yang ada yang memenuhi kualifikasi pendidikan tenaga perawat IBS, tenaga Anesthesi maupun PPA dengan dilakukan mutasi/rotasi.', 'Dari lamaran yang ada maupun data pegawai yang ada, belum ditemukan tenaga yang mempunyai keahlian untuk memenuhi kebutuhan tenaga di IBS.', 'Berusaha mencari dari lamaran yang masuk sesuai kompetensi yang dibutuhkan di IBS.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(396, 30, 119, NULL, 'Berusaha untuk mewujudkan pelayanan pasien yang maksimal dengan memenuhi kebutuhan tenaga di IBS.', 'Melihat lamaran yang masuk di RSUD RAA Soewondo Pati, dan melihat data pegawai yang ada yang memenuhi kualifikasi pendidikan tenaga perawat IBS, tenaga Anesthesi maupun PPA dengan dilakukan mutasi/rotasi.', 'Dari lamaran yang ada maupun data pegawai yang ada, belum ditemukan tenaga yang mempunyai keahlian untuk memenuhi kebutuhan tenaga di IBS.', 'Berusaha mencari dari lamaran yang masuk dan dari data pegawai sesuai kompetensi yang dibutuhkan di IBS.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(397, 22, 59, NULL, 'Kepuasan pelanggan pada pemulasaran jenazah 100%', 'Peningkatan pelatihan petugas dalam merawat jenazah dari dalam maupun luar Rumah Sakit', 'Dari Hasil Kepuasaan pemulasaran jenazah dari triwulan I Januari sampai Maret dapat diambil hasil paling banyak pada bulan februari sebesar 75 % sedangkan untuk rata rata triwulan I dapat diperoleh 57 %. Dan hasil tersebut masih jauh dari target 100%.', 'Tetap Melakukan Tindakan Sesuai dengan SPO dan membuat laporan Triwulan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(398, 22, 59, NULL, 'Kepuasan pelanggan pada pemulasaran jenazah 100 %', 'p', '', '', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(399, 22, 59, NULL, 'Kepuasan pelanggan pada pemulasaran jenazah 100 %', 'Peningkatan pelatihan petugas dalam merawat jenazah dari dalam maupun luar Rumah Sakit', 'Dari Hasil Kepuasaan pemulasaran jenazah dari triwulan II April sampai juni dapat diambil hasil kesimpulan paling banyak pada bulan mei sebesar 75 % sedangkan paling sedikit pada bulan juni 42,82 %. sedangkan rata rata dapat diperoleh 55,95 %. Dan hasil tersebut masih jauh dari target 100%', 'Tetap Melakukan Tindakan Sesuai dengan SPO dan membuat laporan Triwulan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(400, 22, 59, NULL, 'Kepuasan pelanggan pada pemulasaran jenazah 100 %', 'Peningkatan pelatihan petugas dalam merawat jenazah dari dalam maupun luar Rumah Sakit', 'Dari Hasil Kepuasaan pemulasaran jenazah dari triwulan IIi Juli  sampai September dapat diambil hasil kesimpulan paling banyak pada bulan juli sebesar 60 % sedangkan mengalami penurunan sedikit pada bulan Agustus dan September. sedangkan rata rata dapat diperoleh 55,51 %. Dan hasil tersebut masih jauh dari target 100%', 'Tetap Melakukan Tindakan Sesuai dengan SPO dan membuat laporan Triwulan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(401, 34, 99, NULL, 'Melakukan kajian serta penghitungan secara rutin terkait data pola kuman di setiap tahunnya.', 'Sosialisasi hasil penghitungan data pola kuman di area RSUD RAA Soewondo Pati.', 'Hasil capaian penghitungan data pola kuman ESBL kami belum sesuai target, dimana masih ditemukan deteksi kuman ESBL pada ruangan tertentu. ', 'Pelaksanaan sosialisasi data pola kuman terutama tentang ESBL (penyebab, klinis, cara penularan, pengelolaan dan pencegahan)  telah dilaksanakan pada saat IHT (In House Training) Penanggulangan Resistensi Antimikroba yang terselenggara pada tanggal 2 September tahun 2019 ', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(402, 34, 101, NULL, 'Melakukan kajian serta penghitungan secara rutin terkait data pola kuman di setiap tahunnya.', 'Sosialisasi hasil penghitungan data pola kuman di area RSUD RAA Soewondo Pati.', 'Hasil capaian penghitungan data pola kuman MRSA kami sudah sesuai target, dan akan dilakukan sosialisasi ke jajaran direksi terkait hasil pola kuman', 'Pelaksanaan sosialisasi data pola kuman terutama tentang MRSA (penyebab, klinis, cara penularan, pengelolaan dan pencegahan)  telah dilaksanakan pada saat IHT (In House Training) Penanggulangan Resistensi Antimikroba yang terselenggara pada tanggal 2 September tahun 2019.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(403, 12, 82, NULL, 'Satpam melaksanakan patroli keamanan diseluruh area Rumah Sakit. Pembagian area tugas Satpam di lingkup Rumah Sakit.', 'Melaksanakan patroli keliling di area - area rawan gangguan keamanan dan membagi petugas jaga sesuai area yang ditentukan.', 'Dari target 70% sudah tercapai hasil 93,20% dalam tri wulan pertama selama bulan Januari sampai bulan Maret 2019.', 'Dari target 70% hasil patroli petugas Satpam disimpulkan mengalami peningkatan kondisi keamanan.', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(404, 12, 82, NULL, 'Satpam melaksanakan keliling area - area rawan gangguan keamanan dan rolling pembagian area tugas satpam.', 'Satpam melaksanakan patroli area - area rawan gangguan keamanan di lingkup Rumah Sakit dan pergantian personil sesuai area tugas yang ditentukan.', 'Dari target 70% sudah tercapai 86,96% dalam tri wulan kedua selama bulan April sampai bulan Juni 2019.', 'Dari target 70% patroli Satpam mengalami penurunan hasil dibanding dengan tri wulan pertama', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
(405, 12, 82, NULL, 'Satpam melaksanakan patroli area - area rawan keamanan dan memberikan penyuluhan kepada keluarga pasien maupun pengunjung.', 'Satpam melaksanakan patroli area - area rawan keamanan setiap 2 jam sekali dan memberikan penyuluhan kepada keluarga pasien maupun pengunjung tentang larangan di lingkungan Rumah Sakit.', 'Dari target 70% sudah tercapai hasil 92,40% dalam triwulan ketiga selama bulan Juli sampai bulan September 2019.', 'Dari target 70% hasil patroli Satpam disimpulkan bahwa ada peningkatan keamanan dibanding dengan tri wulan kedua,Sosialisai dan evaluasi Satpam agar lebih ditingkatkan patroli area - area rawan gangguan keamanan', '2020-01-09 02:07:27', '2020-01-09 02:07:27', 0, 0, 2019),
